INSERT INTO `phpbb_posts` VALUES (3,3,5,58,1,'94.232.216.242',1649249242,0,1,1,1,1,'','Cykl Technology Features','<r>Cykl publikacji dotyczących cech technologicznych wyróżniających nasze scootery.<br/>\n<br/>\n<B><s>[b]</s>Post 1: Magnetic Propulsion<e>[/b]</e></B><br/>\n<br/>\nPublikacja: 04.04.2022<br/>\n<br/>\nFeatures that make the difference - Magnetic Propulsion. <br/>\nThe most unique element of Seacraft construction is its motor which operates directly in the water<EMOJI seq=\"1f30a\" tseq=\"1f30a\">&#127754;</EMOJI>. Specially designed and patented solutions <EMOJI seq=\"1f9f2\" tseq=\"1f9f2\">&#129522;</EMOJI> allow complete elimination of the drive shaft and the need for unreliable seals and gear transmissions used in other DPVs.<br/>\nThe motor <EMOJI seq=\"1f680\" tseq=\"1f680\">&#128640;</EMOJI> working in the water is much more durable and resistant to workload and also completely eliminates overheating inside the scooter. Innovative solutions enable the user to <EMOJI seq=\"1f93f\" tseq=\"1f93f\">&#129343;</EMOJI> work much deeper, longer  and with much greater motor power. Moreover, the motor runs almost silently, currently it’s the quietest scooter on the market.</r>','2d79f6b4d0851848a209b33decfb5494',0,'','9srv1',1,0,'',0,0,0,1,0,'',0),(4,4,5,58,7,'94.232.216.242',1649249545,0,1,1,1,1,'','Cykl Sprzedawcy','<t>Cykl publikacji dotyczących naszych sprzedawców. Na chwilę obecną czekamy na odpowiedzi z Ankiet, jak na razie bez odpowiedzi. Wygląda na to, że aby cykl doszedł do skutku sami będziemy musieli ich opisać i zwrócić się do nich o weryfikację treści.<br/>\n<br/>\nNa chwilę obecną posiadamy szablony grafik z mapkami.<br/>\n<br/>\nKogo powinnyś przedstawić pierwszego? Moje propozycje poniżej.<br/>\n<br/>\n1. Upstream Niemcy<br/>\n2. DPV-Tech USA<br/>\n3. Snorkel and Dive Safari Australia</t>','24f86dc5d330af9debaddbfaac768643',0,'','1vxqmhd',1,0,'',0,0,0,1,0,'',0),(5,5,23,58,0,'94.232.216.242',1649250325,0,1,1,1,1,'','7-9.06.2022 [MIL] UDT Rotterdam, Holandia','<r>Temat poświęcony targom militarnym UDT 2022<br/>\n<br/>\nGdzie: Rotterdam, Holania<br/>\nKiedy: 7-9.06.2022<br/>\n<br/>\n<URL url=\"https://www.udt-global.com/\"><s>[url]</s>https://www.udt-global.com/<e>[/url]</e></URL><br/>\n<br/>\n<IMG src=\"https://cdn.asp.events/CLIENT_Clarion__96F66098_5056_B733_492B7F3A0E159DC7/sites/UDT-2020/media/Logos/UDT%202022_Logo_no%20back_margin.png\"><s>[img]</s><URL url=\"https://cdn.asp.events/CLIENT_Clarion__96F66098_5056_B733_492B7F3A0E159DC7/sites/UDT-2020/media/Logos/UDT%202022_Logo_no%20back_margin.png\"><LINK_TEXT text=\"https://cdn.asp.events/CLIENT_Clarion__ ... margin.png\">https://cdn.asp.events/CLIENT_Clarion__96F66098_5056_B733_492B7F3A0E159DC7/sites/UDT-2020/media/Logos/UDT%202022_Logo_no%20back_margin.png</LINK_TEXT></URL><e>[/img]</e></IMG></r>','ba8df19c9f9922c4d4c1dedaf5bac0ae',0,'','en35guo',1,0,'',0,0,0,1,0,'',0),(6,6,20,58,0,'94.232.216.242',1649250592,0,1,1,1,1,'','GO! - scenariusz filmu','<t>Temat poświęcony na pomysły dotyczące filmu promującego GO!</t>','b118474eabd05a1388ac6413cfd49c81',0,'','9t3',1,0,'',0,0,0,1,0,'',0),(7,7,41,58,0,'94.232.216.242',1649250753,0,1,1,1,1,'','Sugestie, pomysły, zgłoszenia','<t>Temat poświęcony na wszelkiego rodzaju sugestie, pomysły i przemyślenia dotyczące usprawenienia i ogranizacji forum.</t>','65532f30f6ecdf9fd8b2674543f8c8db',0,'','11l',1,0,'',0,0,0,1,0,'',0),(8,8,5,58,7,'94.232.216.242',1649251068,0,1,1,1,1,'','Cykl Ambasadorzy','<t>Cykl publikacji dotyczących naszych ambasadorów. Temat przyszłościowy, ale można rozważyć prowadzenie kilku cykli jedocześnie np na przemian ze sprzedawcami i technology features, żeby urozmaicić troche treści publikowanych materiałów? Co sądzicie?</t>','b4ec7ee235f365f23b9d49dc7096f63a',0,'','4c855x',1,0,'',0,0,0,1,0,'',0),(9,9,31,58,9,'192.162.175.145',1649267233,0,1,1,1,1,'','Czy potrzebujemy nowych kanałów SM?','<t>Rozważania na temat potencjalnej obecności Seacraft na nowych kanałach social media.<br/>\n<br/>\nWychodząc naprzeciw dynamicznie rozwijających się kanałów social media, warto się zastanowić czy w naszej branży warto uruchomić któryś ze wspomnianych w ankiecie kanałów social media. Co w środowisku nurków jest na topie?</t>','bb4d5c05c31a28bfb6e2458c162bbf9d',0,'','33k0hd06',1,0,'',0,0,0,1,0,'',0),(12,12,31,58,0,'192.162.175.145',1649267808,0,1,1,1,1,'','Godne uwagi tematy','<t>Temat przeznaczony do wrzucania ciekawych tematów lub wydarzeń o których warto wspomnieć na naszym FB/Insta.<br/>\n<br/>\nJeżeli macie jakieś ciekawe tematy i info, dajcie proszę znać.</t>','50e163e3fb00e3b6f53382ae30d6fa4f',0,'','nmgpj',1,0,'',0,0,0,1,0,'',0),(13,13,9,58,0,'192.162.175.145',1649267890,0,1,1,1,1,'','Aktualizacja produktów','<t>Temat poświęcony na dyskusje sugestie i informację jakie produkty powinniśmy na stronę dodać/usunąć/aktualizować.</t>','a53f8e961d3aab9b24152839d0cbc9f5',0,'','1q840lo',1,0,'',0,0,0,1,0,'',0),(14,14,9,58,0,'192.162.175.145',1649268020,0,1,1,1,1,'','Aktualizacja wydarzeń','<t>Temat poświęcony aktualizacji wydarzeń o których powinniśmy wspomnieć na naszej stronie.</t>','27efbd2cd8c794cf76466f2a0e22aeb5',0,'','dinywqf',1,0,'',0,0,0,1,0,'',0),(16,16,9,58,0,'192.162.175.145',1649268751,0,1,1,1,1,'','Aktualizacja zakładki MIL','<t>Aktualizacja i uzupełnienie zakładki MIL.<br/>\n<br/>\nCo musimy dodać:<br/>\n- Rozdzielić/doać produkty na wzór REC<br/>\n- Informacje na temat koncesji<br/>\n- B+R</t>','0a0e8ae54304af99229c82f14b805cf5',0,'','ss1u5cg',1,0,'',0,0,0,1,0,'',0),(17,17,10,58,0,'192.162.175.145',1649268940,0,1,1,1,1,'','Zmiana modułu newsy','<t>Obecny moduł i prezentacja newsów zdecydowanie odbiega od naszych oczekiwań w tym temacie przedyskutujemy kwestie jego wymiany, nowych propozycji.</t>','e6a180984084dd7e36c31aae2bba1206',0,'','2egof3',1,0,'',0,0,0,1,0,'',0),(18,18,15,58,0,'192.162.175.145',1649269260,0,1,1,1,1,'','Tematy na Business Update MIL','<t>Temat przeznaczony do wymiany pomysłów o czym warto poinformować partnerów militarnych w najbliższym Business Update.<br/>\n<br/>\nUpdate wysyłamy nieregularnie, gdy chcemy o czymś istotnym poinformować naszych partnerów. Wyślemy gdy uzbiera się kilka ciekawych tematów.<br/>\n<br/>\nPropozycja tematów:<br/>\n1. Informacja o naszej obecności na UTD Rotterdam Czerwiec 2022.<br/>\n2. Nowy katalog M&amp;S<br/>\n<br/>\n...</t>','465f00f9aab6d0ce00a1454078013489',0,'','26ifwn',1,0,'',0,0,0,1,0,'',0),(19,19,14,58,0,'192.162.175.145',1649269314,0,1,1,1,1,'','Tematy na Business Update REC','<t>Temat przeznaczony do wymiany pomysłów o czym warto poinformować partnerów REC w najbliższym Business Update.<br/>\n<br/>\nUpdate wysyłamy nieregularnie, gdy chcemy o czymś istotnym poinformować naszych partnerów. Wyślemy gdy uzbiera się kilka ciekawych tematów.</t>','401d4fb5a2a8d915e90a3e2e5157787d',0,'','168',1,0,'',0,0,0,1,0,'',0),(20,20,43,58,8,'192.162.175.145',1649269798,0,1,1,1,1,'','Kalendarz wydarzeń - co, gdzie i kiedy','<r>Informacje na temat kalendarza wszelkiego rodzaju wydarzeń nurkowych.<br/>\n<br/>\nAktualny kalendarz i rozpiska z informacjami, który z naszych partnerów gdzie się pojawi dostepny i aktualizowany na Synology pod ścieżką:<br/>\n<br/>\n<B><s>[b]</s>C:\\SynologyDrive\\MT\\MT_MARKETING\\SPRZEDAWCY\\TARGI_EVENTY_NURKOWE.xlsx<e>[/b]</e></B><br/>\n<br/>\nTemat ma służyć wymianie informacji na temat wszelkiego rodzaju wydarzeń nurkowych.</r>','bacecb99e8b8d719cb4542d0599125f4',0,'','jiwswlb',1,0,'',0,0,0,1,0,'',0),(21,5,23,58,0,'94.232.216.242',1649314767,0,1,1,1,1,'','Re: [MIL] UDT Rotterdam, Holandia 7-9.06.2022','<r>W naszym planie pracy uwzględniliśmy, że targi odbywają się w lipcu, z oficjalnej strony wynika, że są one w czerwcu. Nie wiem, czy nastąpiła zmian, czy omyłkowo wpisaliśmy tam lipiec, a nie czerwiec.<br/>\n<br/>\nZmianie muszą ulec deadliny na karty katalogowe i katalog i inne materiały które musimy mieć miesiąc wcześniej niż zakładaliśmy.<br/>\n<br/>\nRozmawiałem wczorja z przedstawicielką oficjalnego partnera targów Event Guide zajmującego się promocją i reklamą uczestników targów m.in. w oficjalnym przewodniku targów.<br/>\n<br/>\nLog z rozmowy i oferta reklamowa, którą nam zaoferowali poniżej, ceny kosmiczne ok 5k gbp za umieszczenie dobrych reklam i naszej obecność w ich publikacjach:<br/>\n\n<QUOTE><s>[quote]</s>Hi Damian, <br/>\n<br/>\nThank you for your time today, please find attached the information as discussed. 2 sponsorship options below: <br/>\n<br/>\nOption 1. Floorplan Sponsorship – Official Event Guide <br/>\n• Full colour logo branding on the Floorplan and Exhibitor A-Z with the words “sponsored by xxx”<br/>\n• A message saying “Visit us at stand xx” printed with your logo<br/>\n• A directional trail marked from the entrance to your stand location on the Floorplan<br/>\n• Your stand highlighted on the Floorplan<br/>\n• Full page advertisement on the Inside Front Cover (Gatefold)<br/>\n• Horizontal banner advertisement at the bottom of the same page as your Exhibitor Profile<br/>\n• Logo/image upgrade with your Exhibitor Profile listing<br/>\n=£4,995 <br/>\n<br/>\nExamples will follow below. <br/>\n<br/>\nOption 2. <br/>\nExhibitor Profile Sponsorship – Official Event Guide <br/>\n•	Logo branding across the bottom of every editorial page of the Exhibitor Profiles Section<br/>\n•	A message saying “Visit us at stand xx” printed with your logo<br/>\n•	Full page advertisement opposite the opening page of the Exhibitor Profiles section<br/>\n•	Company name and stand number highlighted in all lists<br/>\n•	Logo/image upgrade with your Exhibitor Profile listing<br/>\n•	Horizontal banner advertisement at the bottom of the same page as your Exhibitor Profile<br/>\n=£4,995<br/>\n<br/>\nExamples below. <e>[/quote]</e></QUOTE>\n\nNie wiem, czy wcześenij kupowaliśmy tego typu reklamy na targach, interesują nas tego typu opcje?</r>','5582b7f7f9c992453eede6cb185029f8',0,'','1bf5qhu',1,0,'',0,0,0,1,0,'',0),(22,21,43,60,0,'94.232.216.242',1649314934,0,1,1,1,1,'','CaveCamp Mexico 2022','<t>Cześć,<br/>\nw dniach 10-24 września 2022 odbędzie się szósta edycja CaveCamp Mexico. <br/>\nSkontaktowałam się z Lannym i w związku z małym zainteresowaniem czerwcową akademią skupiają się w 100% na wrześniowym wydarzeniu. Poniżej szczegóły przekazane przez Lanny\'ego.<br/>\n<br/>\nKorzyści dla sponsorów:<br/>\n- promocja sponsora na stronie www CaveCamp z logo,<br/>\n- promocja w mediach społecznościowych podczas eventu,<br/>\n- pakiet profesjonalnych zdjęć z eventu,<br/>\n- reklama w magazynie nurkowym CaveCamp (1 strona),<br/>\n- zamieszczenie logo sponsora na koszulce eventowej, banerze<br/>\n- impreza tematyczna \"Seacraft\" wyłącznie z naszymi logotypami, prezentacją produktów itp. <br/>\n<br/>\nWkład sponsora:<br/>\n- 1199$ na pokrycie t-shirtów, banerów, imprezy tematycznej i broszur,<br/>\n- 55 szt. przedmiotu tematycznego do toreb prezentowych dla uczestników,<br/>\n- nagroda główna do losowania.<br/>\n<br/>\nProszę o następujące informacje:<br/>\n* czy na pewno zgadzamy się na wkład pieniężny?<br/>\n* jakie produkty oferujemy do torby prezentowej w ilości 55 szt.?<br/>\n* jaki produkt główny przekażemy?</t>','c012455ae8d96e03a205976b83868e0b',0,'','85373',1,0,'',0,0,0,1,0,'',0),(23,6,20,60,0,'94.232.216.242',1649315380,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>POST EDYTOWANY PO SPOTKANIU ONLINE<br/>\nRozmawiałam z Adamem Wasiakiem (FrogTV) i obiecałam odezwać się początkiem przyszłego tygodnia z pomysłami na scenariusz. Temat pilny, bo Adam może działać do końca czerwca. Na ten moment lista pomysłów zawiera:<br/>\n<br/>\nZałożenia do filmu promocyjnego:<br/>\n- na wstępie krótko chcemy pokazać, że produkcja skutera odbywa się u nas w Krośnie, bez większych szczegółów,<br/>\n- następnie skuter trafia do klienta,<br/>\n- przygotowanie skutera do podróży,<br/>\n- zapakowanie skutera do torby podróżnej, baterie osobno do podręcznego,<br/>\n- odprawa bagażowa i kontrola (x-ray baterii) ,<br/>\n- wejście do samolotu ze skuterem, ewentualnie ujęcie samolotu i innej osoby, która żegna/macha w stronę samolotu<br/>\n- użycie skutera w fajnym miejscu, może egzotycznym,<br/>\n- użycie skutera przez kobietę - sprzęt jest lekki<br/>\n<br/>\nWpisujcie swoje pomysły, będę uzupełniać listę.<br/>\n<br/>\n<B><s>[b]</s>Witku - zweryfikuj proszę możliwość nagrania wstawek do filmu w Poznaniu. <br/>\nDobrze byłoby też ustalić kto, gdzie i na kiedy może nagrać wstawki z nurkowania w ładnych miejscach. <e>[/b]</e></B></r>','e3be1cefec033b00beb5280f6bc83748',0,'','1de5jlk',1,0,'',0,0,0,1,0,'',0),(24,21,43,63,0,'85.221.240.2',1649319750,0,1,1,1,1,'','Re: CaveCamp Mexico 2022','<t>Lanny prawdopodobnie byłby również chętny na barter skuterowy. To idealny event, oraz daty by włączyć wydarzenie w kampanię GO! i udostępnić 3 skutery na miejscu.<br/>\n<br/>\nOstatnio uczestnicy dostali klucze w kształcie skutera oraz nagroda główna - ENC3.<br/>\n<br/>\nZawsze jest z nimi mega dobry kontakt, działają w social mediach, mają też dużą etykę pracy i jakości tego co robią. <br/>\n<br/>\nPoszedłbym w kierunku próby barteru (dla nas zawsze taniej) + wplecenia w kalendarz premiery GO!.</t>','e1d25870634833a26e885d03be81c4c4',0,'','7ocfn',1,0,'',0,0,0,1,0,'',0),(25,22,18,58,0,'94.232.216.242',1649320975,0,1,1,1,1,'','Karty katalogowe','<t>Temat poświęcony przygotowaniu kart katalogowych. <br/>\n<br/>\nNa bazie katalogu MIL który Witek przygotował wychodzi mi tak list kart katalogowych, które chcę przygotować:<br/>\n<br/>\n-Scooters, Dual scooters<br/>\n-Accessory and spart parts - DPV<br/>\n-Light system<br/>\n-Power converter<br/>\n-ENC<br/>\n-Accessory and spart parts - ENC<br/>\n- Normy i certyfikaty<br/>\n<br/>\nCzy coś pominałem/powinniśmy dodać? Oczywiscie karty nowości będziemy mogli bezproblemowo tworzyć i dodawać na bazie szablonu który tworzę, wersja uproszona i wersja w stylu katalogu.</t>','a7d24dd5a410d29237dbe84664c332a4',0,'','tgbkrk4',1,0,'',0,0,0,1,0,'',0),(26,23,9,58,0,'94.232.216.242',1649322338,0,1,1,1,1,'','Język koreański','<t>Temat poświęcony wdrożeniu języka koreańskiego na naszej strnie.</t>','db20ec8bb4fa3bbc85704f1ef70b791e',0,'','5h4u',1,0,'',0,0,0,1,0,'',0),(27,24,28,63,0,'85.221.240.2',1649323093,0,1,1,1,1,'','Zdjęcia i materiały','<r>Hej<br/>\nMają być gotowe 3 skutery GO! Do rozesłania. Opcje:<br/>\n<br/>\n-Cavebase---&gt; kadry techniczne, urywki filmów z nurkami technicznymi --&gt; samodzielnie<br/>\n<br/>\n-Irena Stangierska- zdjęcia z ciepłych wód. Trzeba zorganizować wyjazd, oraz zapewnić modela.<br/>\n<br/>\n- <URL url=\"https://www.digitalmovie.it/\">https://www.digitalmovie.it/</URL>  --&gt; nasza opcja na zdjęcia \'suche\', lifestyle\'owe. (Dziewczyny w bikini na plaży <E>;)</E>). Właśnie prosi o skuter ze zniżką dla członka zespołu, można połączyć tematy. Doskonała jakość materiałów. Również opcje na video - ta sama sesja.</r>','54e5b449b6ab12aae1b6b80833521735',0,'','4p2ma54v',1,0,'',0,0,0,1,0,'',0),(28,22,18,63,0,'85.221.240.2',1649329201,0,1,1,1,1,'','Re: Karty katalogowe','<r><URL url=\"https://www.equipnor.com/media/3003/2019_military_buyersguide.pdf\"><LINK_TEXT text=\"https://www.equipnor.com/media/3003/201 ... sguide.pdf\">https://www.equipnor.com/media/3003/2019_military_buyersguide.pdf</LINK_TEXT></URL></r>','56d4af9e38c9cde2d180ca2a1c7e9713',0,'','8rb6g',1,0,'',0,0,0,1,0,'',0),(29,5,23,61,0,'94.232.216.242',1649331759,0,1,1,1,1,'','Re: [MIL] UDT Rotterdam, Holandia 7-9.06.2022','<t>Kwestie tych targów należy w większości ustalać z Frankiem. To bardzo drogie targi stąd takie kosmiczne ceny. Reklamy nie będziemy wykupywać.<br/>\n<br/>\nWitek, poproś Franka o sporządzenie listy sprzętu na targi. Musimy wiedzieć, że np. DPC ma być gotowe ...<br/>\nProszę o przygotowanie tego w formie zamówienia na sprzęt targowy.<br/>\n<br/>\nJakaś korespondencja, plany stoiska itp są na redmine podpięte w formie plików.</t>','8691aaa550547528367bdbd3c417b5b9',0,'','i5p',1,0,'',0,0,0,1,0,'',0),(30,21,43,60,0,'94.232.216.242',1649334661,0,1,1,1,1,'','Re: CaveCamp Mexico 2022','<t>Ustalenia po spotkaniu online: <br/>\nWitek skontaktuje się z Lannym, żeby wypytać o możliwości barteru w zamian za rezygnację ze składki sponsorskiej. <br/>\nEwentualna nagroda główna jeśli nie skuter to kartownik.</t>','a7f161fb56b42bfa8e5a6ed50f0c36e9',0,'','3v3ow',1,0,'',0,0,0,1,0,'',0),(31,25,10,58,0,'94.232.216.242',1649398683,0,1,1,1,1,'','Błędy, nie działające linki','<r>Temat przeznaczony na zgłaszanie błędów i nieprawidłowości na stronie www.<br/>\n<br/>\nPo przejęciu opieki nad stroną przez Marcina doświadczyliśmy problemów z linkami w sekcji produkty.<br/>\nPo głębszej analizie strony zauważyliśmy z Witkiem kilka innych nie działających komponentów:<br/>\n<br/>\nBłąd 1: <br/>\n\n<QUOTE><s>[quote]</s>Po wejściu w każdy produkt - na dole, zakładki \"Support portal\" kieruje do <URL url=\"https://seacraft.eu/seacraft/support/support-portal/\">https://seacraft.eu/seacraft/support/support-portal/</URL>, a powinna do <URL url=\"https://support.seacraft.eu/\">https://support.seacraft.eu/</URL>, ten sam problem dotyczy nie działających linków do cennika i innych komponentów prypisanych do dolnego menu produktów.<e>[/quote]</e></QUOTE>\n\nRozwiązanie: <br/>\n\n<QUOTE><s>[quote]</s>W toku, Marcin został już poinformowany, pracuję nad tym.<e>[/quote]</e></QUOTE>\n\n<B><s>[b]</s>Jeżeli zauważycie jeszcze jakieś nie działające linki czy inne błędy na stronie, proszę napiszcie w tym temacie, a ja będę to zgłaszał Marciowi aby błędy zostały szybko zdiagnozowane i usunięte.<e>[/b]</e></B></r>','c8540767db5772484d230a976716d442',0,'','9fznr',1,0,'',0,0,0,1,0,'',0),(32,7,41,61,0,'185.153.39.80',1649407009,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<t>KARTOWNIK - do dodania nowy produkt.<br/>\n<br/>\nDetale zostaną wyprodukowane do 22.04.2022.<br/>\nPo złożeniu można zabrać do zrobienia zdjęcia produktowego.</t>','9f0a99dd89a8c15d4b7135daf27cbcfc',0,'','94tbbf8a',1,0,'',0,0,0,1,0,'',0),(33,26,44,58,0,'94.232.216.242',1649407938,0,1,1,1,1,'','Kartownik','<t>Wątek poświęcony Kartownikowi.<br/>\n<br/>\nDetale zostaną wyprodukowane do 22.04.2022.<br/>\nPo złożeniu można zabrać do zrobienia zdjęcia produktowego.</t>','99199e502648d1def5e1e60d1aee0b0e',0,'','c1zt',1,0,'',0,0,0,1,0,'',0),(34,7,41,58,0,'94.232.216.242',1649408009,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<r>Dodane <E>:)</E></r>','82d1ecdb6af36e2fc393a29f31cbe5ce',0,'','105drqr',1,0,'',0,0,0,1,0,'',0),(35,22,18,61,0,'185.153.39.80',1649409745,0,1,1,1,1,'','Re: Karty katalogowe','<r>Folder MARKETING ---&gt; MILITARY_KARTY KATALOGOWE<br/>\nWgrałam to od czego zaczynaliśmy w tamtym roku. <br/>\nWgrałam obowiązujący cennik militarny (świeżutki <E>:)</E><br/>\n<br/>\nUkład musi być oczywiście pionowy - format A4 daje w sumie dużo miejsca na treść. <br/>\nTeraz jest czas na szablon a potem pójdziemy dalej.</r>','9490d6fd86e3a8dbfe19c61ebb59165d',0,'','9utuk',1,0,'',0,0,0,1,0,'',0),(36,22,18,58,0,'94.232.216.242',1649409938,0,1,1,1,1,'','Re: Karty katalogowe','<t>Świetnie, biorę się za przygotowanie szablonu.</t>','f7d19c836acf0d5c884cb768b1f667ae',0,'','3qmc7g',1,0,'',0,0,0,1,0,'',0),(37,25,10,60,0,'91.196.8.186',1649417786,0,1,1,1,1,'','Re: Błędy, nie działające linki','<r>Tak jak zgłaszałam Damianowi, nie działają linki <URL url=\"https://seacraft.eu/seacraft/technology/features/\">https://seacraft.eu/seacraft/technology/features/</URL> pod każdą zakładką \"learn more\".</r>','4756d48dfe1f7c53f8022491a14d4163',0,'','198xz7v',1,0,'',0,0,0,1,0,'',0),(38,25,10,58,0,'94.232.216.242',1649418619,0,1,1,1,1,'','Re: Błędy, nie działające linki','<r>Jak się okazuję, problem bardziej rozległy..<br/>\n<br/>\nNie działają:<br/>\n<br/>\n<URL url=\"https://seacraft.eu/seacraft/technology/features/\">https://seacraft.eu/seacraft/technology/features/</URL><br/>\n<URL url=\"https://seacraft.eu/go-deeper/ambassador/\">https://seacraft.eu/go-deeper/ambassador/</URL><br/>\n<URL url=\"https://seacraft.eu/go-deeper/environment/\">https://seacraft.eu/go-deeper/environment/</URL><br/>\n<URL url=\"https://seacraft.eu/go-deeper/world-records/\">https://seacraft.eu/go-deeper/world-records/</URL><br/>\n<URL url=\"https://seacraft.eu/go-deeper/exploration/\">https://seacraft.eu/go-deeper/exploration/</URL><br/>\n<br/>\nPrzy próbie wejscią w każdą z podstron głównego działu wyrzuca błąd 404.<br/>\n<br/>\nLinki  na stronie nie działają wg schematu:<br/>\n<br/>\nMenu głowne -&gt; Dział nadrzędy OK. -&gt; Kategoria OK. -&gt; Dział OK. -&gt; podddział USZKODZONE linki.<br/>\n<br/>\n<B><s>[b]</s>Zgłoszone Marcinowi.<e>[/b]</e></B></r>','3341dae5923ec57cc7f7afa0edbccd5c',0,'','8xwbs',1,0,'',0,0,0,1,0,'',0),(39,25,10,63,0,'85.221.240.2',1649420639,0,1,1,1,1,'','Re: Błędy, nie działające linki','<t>Nie chcę \'kopać leżącego\' - ale wersja DE leży po całości. Marcin pisał że ją postawią (więc teoretycznie ma świadomość że nie działa).<br/>\n<br/>\nBoję się że modyfikują linki manualnie, zamiast poprawić całą funkcjonalność wtyczki która zarządza linkami w wersjach wielojęzycznych.</t>','29e7a822f427e8f3c5b7137cdcd05b15',0,'','2n2ffp',1,0,'',0,0,0,1,0,'',0),(40,25,10,61,0,'185.153.39.80',1649423134,0,1,1,1,1,'','Re: Błędy, nie działające linki','<t>Czy dajemy im czas do poniedziałku? <br/>\nCzy trzeba w trybie natychmiastowym dać to komuś innemu do reanimacji?<br/>\n<br/>\nDamianie, <br/>\nproszę o Twoje zdanie na ten temat.</t>','a9fa33504b842cc14b0d0f3e9da3c919',0,'','mj9ctve',1,0,'',0,0,0,1,0,'',0),(41,25,10,58,0,'79.187.195.66',1649442295,0,1,1,1,1,'','Re: Błędy, nie działające linki','<t>Na chwilę obecną większość linków została naprawiona. Wersja niemiecka też, potestuje w wolnej chwili czy problem został rozwiązany. Wydaję się, że pożar ugaszony.<br/>\n<br/>\nMarcin musi się dostosować do naszego systemu pracy i komunikacji, oraz naszych warunków, to na pewno.</t>','573f932d625322b678f6a8fd325608f1',0,'','4xnpmur3',1,0,'',0,0,0,1,0,'',0),(43,27,23,63,0,'85.221.240.2',1649660113,0,1,1,1,1,'','21.04.2022 [MIL] Event Gearpoint','<r>Hej<br/>\nNiżej cytaty wiadomości w tym temacie :\n<QUOTE><s>[quote]</s>Właśnie zdzwoniłem się z Rubenem. Przetarg dla sił specjalnych jest już rozpisany i będą tam osobne (wchodzące w skład oceny sprzętu) testy w wodzie, natomiast tak czy siak będą osoby decyzyjne na evencie. Będą też zainteresowane skuterami jednostki policyjne, możliwe ze też Belgia. Flamur- gość z 5h pływania na Sieniawie, też będzie.<br/>\n<br/>\nEvent jest zamknięty, tylko na zaproszenia - nie promowany. Odbywa się u nich na miejscu : <URL url=\"https://www.facebook.com/GearPoint/\">https://www.facebook.com/GearPoint/</URL><br/>\n<br/>\nKoordynowałem możliwość testów w wodzie połączonych z jednym przejazdem, ale w tej chwili  (przed wyjściem przetargu), zapraszanie sił specjalnych na spotkanie bezpośrednio z producentem może być podstawą prawną do wykluczenia - opcja odpadła. (od 3 tygodnie próbowali to tak zorganizować)<br/>\n<br/>\nGeograficznie z Poznania do Amersfoort jest 850km. Chyba najlepszą opcją sprzętową jest wysyłka.<br/>\n<br/>\n-Iga, potrzebowałbym informacji czy skutery :<br/>\n<br/>\nmają zamontowane przetwornice. W jakim są stanie wizualnym? Wypalone wyświetlacze, zainstalowany soft itd.?<br/>\n<br/>\n<br/>\nCzy skutery MIL z magazynu mają przetwornice? Będzie to działanie \'nie w wodzie\', na targi w lipcu również potrzebujemy sprzęg \'targowy\':<br/>\n<br/>\nCzy te sprzęgi są z nowymi uchwytami i platformami?<br/>\n<br/>\n<br/>\nBędę też wdzięczny za informacje o opcjach na:<br/>\n<br/>\n-targowy maszt<br/>\n<br/>\n-SUM do pokazania Flamourowi<br/>\n<br/>\n-ENC3M skoordynuję z Albinem.<br/>\n<br/>\n<br/>\nSą dostępne na miejscach stoły wystawowe - jeden standard dla wszystkich, więc prawdopodobnie optymalne są stojaki na skutery.<br/>\n<br/>\n<br/>\nJeśli są gotowe jakieś dodatkowe ciekawostki jakie warto pokazać, dajcie znać.<br/>\n<br/>\nWysyłka- druga połowa przyszłego tygodnia, przynajmniej jak chodzi o najważniejsze elementy.<e>[/quote]</e></QUOTE>\n\nLista pakowania(wysyłane z Krosna):<QUOTE><s>[quote]</s>Katalog MIL - pozostałe				15<br/>\nUlotka MIL 				60<br/>\nTAC2000 ns211 (z przetwonicą)				1<br/>\nTAC2000 ns165 (z przetwonicą)				1<br/>\nSkutery TAC2000- będzie na nich zbudowany sprzęg dual TAC2000 z szeroką platformą				x<br/>\nSzeroka platforma sprzęgająca z nowym systemem, łącznie 4 uchwyty 208 do sprzęgania (komplet)				1<br/>\nStojak 208mm				2<br/>\nKabel z wyjściem E/O wkręcany w gniazdo ładowania				1<br/>\nLatarki SLS2				1<br/>\nTAC1000 (ns 279) (z przetwornicą)				1<br/>\nStojak 160mm				1<br/>\nMaszt GPS mocowany do 2 uchwytów 				1<br/>\nPlatforma ENC3M - komplet, z bojką GPS typ B (nie musi być w walizce)				1<br/>\nFlaga MIL (koordynuje Paulina)				2<br/>\nMilitary&amp;Special Seacraft Black cotton t‐shirt (print in front) - rozmiary L, XL, XXL				po 3 szt z rozmiaru<br/>\nMiliary&amp;Special Seacraft M&amp;S 3 cotton hat ‐ unisex				10<br/>\nMilitary&amp;Special Seacraft M&amp;S 3 cap ‐ unisex				10<br/>\nSeacraft universal key (klucz w kształcie skutera				5<br/>\nŁadowarka 400W do hermetycznego złącza ładowania				1<br/>\nUSB charging outlet (2 x 5V) ‐ from scooter\'s hermetic charging port				1<br/>\nTrigger lock				2<br/>\nPoniższe- opcjonalne (pytać Piotra)				x<br/>\nZwalniacz (jeśli dostępny)				1<br/>\nSUM (będzie odesłany na koniec kwietnia)				1<br/>\nniewielkie drobiazgi do pokazania - jeśli coś jest (nowe mocowanie do ENC?)				x\n<e>[/quote]</e></QUOTE></r>','fdd75aad6212b66fd0aa0003f026b8ab',0,'','1mgihdz',1,0,'',0,0,0,1,0,'',0),(44,27,23,63,0,'85.221.240.2',1649660493,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Stan na chwilę obecną.<br/>\n<br/>\n-Mają na miejscu zorganizować ekran/telewizor (pokazywanie filmów w akcji, szczególnie DPC)<br/>\n<br/>\n-do dyspozycji na miejscu są stoły - zwykłe - 180x80cm, niskie. W razie czego, lepiej mieć obrusy/ tkaninę na górę żeby jakoś to wyglądało.<br/>\nChcę zamówić coś w stylu: <URL url=\"https://allegro.pl/oferta/obrus-diamond-plamoodporny-140x200-gruby-kolory-11748459474\"><LINK_TEXT text=\"https://allegro.pl/oferta/obrus-diamond ... 1748459474\">https://allegro.pl/oferta/obrus-diamond-plamoodporny-140x200-gruby-kolory-11748459474</LINK_TEXT></URL> - grafit albo granat. Na czarnym zlewają się skutery. Jeśli stoły będą estetyczne- można pominąć, ale nie zaszkodzi mieć. (mają wysłać mi zdjęcie stołu)<br/>\n<B><s>[b]</s>Dajcie znać który kolor waszym zdaniem najlepszy.<e>[/b]</e></B><br/>\n<br/>\n-trochę rzeczy mam na miejscu - teczki, worki, kilka czapek.</r>','4deda3045dedd7371690287564ac53a6',0,'','pl3jcl',1,0,'',0,0,0,1,0,'',0),(45,27,23,60,0,'91.196.8.186',1649661914,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Hej, co do obrusów - średnio widzi mi się ten wiszący obrus. Wygląda trochę obiadowo, mimo ładnego koloru. <br/>\nChyba lepiej zakupić pokrowce pełne: <URL url=\"https://wynajem-krzesel.pl/?118,pokrowiec-elastyczny-bialy-180x80\"><LINK_TEXT text=\"https://wynajem-krzesel.pl/?118,pokrowi ... aly-180x80\">https://wynajem-krzesel.pl/?118,pokrowiec-elastyczny-bialy-180x80</LINK_TEXT></URL></r>','f388ebc9d2f6751620c36bf0d765db3a',0,'','9qr7j1f5',1,0,'',0,0,0,1,0,'',0),(46,27,23,60,0,'91.196.8.186',1649662223,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Podsyłam link: <URL url=\"https://pracowniahoreca.pl/pl/p/pokrowiec-na-stol-cateringowy-180x75-cm/46\"><LINK_TEXT text=\"https://pracowniahoreca.pl/pl/p/pokrowi ... 0x75-cm/46\">https://pracowniahoreca.pl/pl/p/pokrowiec-na-stol-cateringowy-180x75-cm/46</LINK_TEXT></URL></r>','612234fcaf8689c6a0a0635ab1325461',0,'','1m7yrkk',1,0,'',0,0,0,1,0,'',0),(47,27,23,60,0,'91.196.8.186',1649663634,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Najlepiej szare: <URL url=\"https://pracowniahoreca.pl/pl/p/pokrowiec-na-stol-cateringowy-180x75-cm/46\"><LINK_TEXT text=\"https://pracowniahoreca.pl/pl/p/pokrowi ... 0x75-cm/46\">https://pracowniahoreca.pl/pl/p/pokrowiec-na-stol-cateringowy-180x75-cm/46</LINK_TEXT></URL><br/>\nMożesz poprosić Igę, żeby zamówiła potrzebną ilość. <E>:)</E></r>','f17af4f4e90560daabef0fa7551b8667',0,'','1z0yoq',1,0,'',0,0,0,1,0,'',0),(50,28,21,61,0,'91.196.8.186',1649674842,0,1,1,1,1,'','RENDERY','<t>Jakie rendery potrzebujemy teraz i na przyszłość?<br/>\nDam Bartkowi do wykonania hurtem, bo i tak potrwa to wieki...</t>','58323201fdcbb76d1fdd4705521224bd',0,'','9c1cgy1',1,0,'',0,0,0,1,0,'',0),(51,28,21,58,0,'94.232.216.242',1649676913,0,1,1,1,1,'','Re: RENDERY','<t>Tak na szybko na pewno przydałyby się Skutery Future i Ghost pod karty katalogowe MIL, bo nie mamy takich czystych bez logo seacraft made to explore.</t>','d96fde3d66ef7a8ae1b52bcf9f420b97',0,'','329',1,0,'',0,0,0,1,0,'',0),(52,27,23,63,0,'85.221.240.2',1649678714,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Zamówiłem kartą MT z wysyłką na POZ- świetny pokrowiec! Dobrze to wygląda, dzięki za namiar <E>;)</E><br/>\nNa pewno się przyda i na przyszłość, pod wszelakie prezentacje, taki stół wygodnie się wozi: <URL url=\"https://allegro.pl/oferta/stol-ogrodowy-cateringowy-skladany-180x75cm-rattan-11925489030?bi_s=ads&amp;bi_m=listing%3Adesktop%3Aquery&amp;bi_c=OThkZDZhYzAtMDIyZC00ODY0LTk0NTgtNjFhZmVmYWJhM2EwAA&amp;bi_t=ape&amp;referrer=proxy&amp;emission_unit_id=ac097212-1e52-4e36-88c5-fcee55c62415\"><LINK_TEXT text=\"https://allegro.pl/oferta/stol-ogrodowy ... ee55c62415\">https://allegro.pl/oferta/stol-ogrodowy-cateringowy-skladany-180x75cm-rattan-11925489030?bi_s=ads&amp;bi_m=listing%3Adesktop%3Aquery&amp;bi_c=OThkZDZhYzAtMDIyZC00ODY0LTk0NTgtNjFhZmVmYWJhM2EwAA&amp;bi_t=ape&amp;referrer=proxy&amp;emission_unit_id=ac097212-1e52-4e36-88c5-fcee55c62415</LINK_TEXT></URL></r>','1d6139c26afc9549a2386a20c4b7b1e2',0,'','3fysp',1,0,'',0,0,0,1,0,'',0),(53,29,26,58,0,'94.232.216.242',1649743251,0,1,1,1,1,'','14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>11 edycja NURKOWE DEMO DAYS 2022<br/>\nMiejsce: Jaworzno, Koparki<br/>\nKiedy: 14-15.05.2022<br/>\n<br/>\nCzy w tym roku, Deep Adventure także będzie nas tam reprezentował? Mamy już jakieś info od Marcina Bramsona.<br/>\n<br/>\nWiem, że Marcin Pawełczyk będzie tam obecny, mogłby pewnie dla nas zrobić jakieś fajne zdjęcia do wykorzystania w SM.</t>','ca2b7bd4a98bc094bc45b435e543a845',0,'','73s6k',1,0,'',0,0,0,1,0,'',0),(54,30,45,58,0,'94.232.216.242',1649745136,0,1,1,1,1,'','Uchwyt na kamerę','<t>Wątek poświęcony Uchwytowi na kamerę.</t>','73061d72ec2a0a42a263443f8b4e6417',0,'','chjpnnr',1,0,'',0,0,0,1,0,'',0),(55,29,26,61,0,'94.232.216.242',1649746743,0,1,1,1,1,'','Re: Nurkowe Demo Days Jaworzno, Koparki 14-15.05.22','<t>Napiszę do niego maila w tej sprawie.</t>','5c4c928207de772beaf49e2c4fb4ea4f',0,'','eq199vr',1,0,'',0,0,0,1,0,'',0),(56,31,46,58,0,'94.232.216.242',1649749208,0,1,1,1,1,'','Obciążenie elektroniczne','<t>Wątek poświęcony nowemu produktowi Obciążenie elektroniczne - Electronic load, for battery capacity testing</t>','f5f91546611c815e74b78d45254d0c5b',0,'','bnrcm9m',1,0,'',0,0,0,1,0,'',0),(57,32,21,63,0,'85.221.240.2',1649754914,0,1,1,1,1,'','Zdjęcia produktowe- paczka, materiały marketingowe','<t>Jest mocna potrzeba uporządkowania i skatalogowania zdjęć produktowych - zarówno cywilnych jak i militarnych- w aktualne paczki, z kodami produktowymi i nazwami produktowymi. Materiały powinny wisieć na chmurze cloud.seacraft i mieć możliwość łatwego udostępniania klientom.<br/>\n<br/>\nPodobnie wygląda temat paczki materiałów reklamowych. Mamy starawą, z logtypami, zdjęciami w akcji, i podobnymi materiałami. Generalnie sądzę że materiały powinny być \'na twardo\' hostowane na cloud.seacraft, ale... przewodnik? Spis treści? Poradnik? z odnośnikami do nich - umieszczony na support.seacraft.eu w strefie dla resellerów.</t>','ddc7454f616c923d24bfedcc2b7126cd',0,'','4wktr',1,0,'',0,0,0,1,0,'',0),(59,30,45,63,0,'85.221.240.2',1649755375,0,1,1,1,1,'','Re: Uchwyt na kamerę','<t>Mamy testerów z dużymi kamerami - choćby ekipa z Malty - która może i chętnie przetestuje w akcji uchwyt. Jeśli dostanę alokację 1-2szt do wysyłek, skoordynuję temat.</t>','c32b1e5924ee015630ce27c1163dfc68',0,'','mx8c5xu',1,0,'',0,0,0,1,0,'',0),(62,22,18,58,0,'94.232.216.242',1649757959,0,1,1,1,1,'','Re: Karty katalogowe','<r>Prosze rzućcie okiem na:<br/>\n<br/>\nC:\\SynologyDrive\\MT\\MT_MARKETING\\MILITARY_KARTY KATALOGOWE\\<B><s>[b]</s>Karty.pdf<e>[/b]</e></B><br/>\n<br/>\nJest tam wzór propozycji kart katalogowych do naszego segregatora (nad okładką popracuje Karwowski).<br/>\nStarałem się zachować spójność z  naszymkatalogiem MIL (kolorystyka, czcionki, tło, styl etc.) i iść z cennikiem.<br/>\n<br/>\nWzór na przykładzie scooterów. W myśl schematu:<br/>\n<br/>\nPierwsza strona to taka przekładka kategorii, aby zachować organizację, <br/>\n<br/>\nWstępnie przykładowe kategorie podziału:<br/>\n<br/>\n- Diving Propultion Vehicle<br/>\n- Accessory and spart parts - DPV<br/>\n- Light system (osobno to ująć, czy podpianamy pod akcesoria?)<br/>\n- Power converter (osobno to ująć, czy podpianamy pod akcesoria?)<br/>\n- ENC<br/>\n- Accessory and spart parts - ENC<br/>\n- Standards and certificates<br/>\n<br/>\nStrony 2-5 to już właściwe karty katalogowe, kolejno Scooter TAC1000 i TAC2000<br/>\n<br/>\n<B><s>[b]</s>Na przykładzie TAC1000:<e>[/b]</e></B><br/>\n<br/>\nU góry nazwa nadrzędna kategorii (Diving Propultion Vehicle), poniżej nr katalogowy i nazwa scootera.<br/>\nPo prawej logo.<br/>\nNiżej zdjęcie produktu (tam są na razie wersje robocze tych renderów na szybko usunięte logo, zostało tam jeszcze logo na ENC, ale to się już się podmieni na właściwe).<br/>\n<br/>\nKolejno tabelki z informacjami technicznymi:<br/>\n<br/>\n- Specyfikacja (motor, battery, dimensions)<br/>\n- Co zawiera zestaw (set includes) z nr katalogowymi poszczególnych elementów.<br/>\n- Powiązane elementy (linked with) z czym możemy łączyc scooter, jak coupling platform set, wersje z nawigacją, zestaw czesci zamiennych, wszystko z przypisanymi nr katalogowymi. (akcesoria dla dpv  będą ujęte w kartach osobno, w kategorii (Accessory and spart parts - DPV)  jest ich sporo.<br/>\n- Coś jeszcze powinniśmy ujać w danej karcie produktu? Myslalem o normach i certyfikatach, ale to jako osobne karty.<br/>\n<br/>\nI wg tego schematu TAC2000, ENC, dla aksesorii wlasna kategoria i tam karty, z bateriami, ladowarkami i innymi elementami. <br/>\n<br/>\nTak bym to wstępnie widział. <br/>\n<br/>\nOprocz tej wersji, mozna tez utworzyć wersje \"ekonomiczną/roboczą\" bez tła na białym tle, gdzie każdy moze wydrukować na zwyklej drukarce.<br/>\n<br/>\nNapiszcie proszę co sądzicie, no i czekam na pomysły, opinie sugestie <E>:)</E></r>','7bd6d98008c787a2b3239aa75228c71f',0,'','lw6t',1,0,'',0,0,0,1,0,'',0),(63,12,31,58,0,'94.232.216.242',1649758241,0,1,1,1,1,'','Re: Godne uwagi tematy','<r><URL url=\"https://seacraft.eu/products/accessories-and-spares/dedicated-tube-engraving/\"><s>[url]</s><LINK_TEXT text=\"https://seacraft.eu/products/accessorie ... engraving/\">https://seacraft.eu/products/accessories-and-spares/dedicated-tube-engraving/</LINK_TEXT><e>[/url]</e></URL><br/>\n<br/>\nInformowaliśmy kiedyś o tej opcji personalizacji scootera na social mediach czy też newsletterze?<br/>\n<br/>\nBardzo fajny temat do publikacji.</r>','ed8f852e7d421c1c011436e87afde289',0,'','1vckvwr',1,0,'',0,0,0,1,0,'',0),(64,12,31,61,0,'94.232.216.242',1649760323,0,1,1,1,1,'','Re: Godne uwagi tematy','<t>Ja nie kojarzę.<br/>\nNawet jeżeli było to można powtórzyć.<br/>\n<br/>\nNa pewno mamy dużo surówki zdjęciowej od Adama i można by wykorzystać wycinki materiałów do pokazania procesów technologicznych.<br/>\nNiektóre były naprawdę ciekawe, ale zostały wycięte i na maxa przyśpieszone.</t>','002aef5ecec9436421cfa1bcc1cb2481',0,'','14jd8a',1,0,'',0,0,0,1,0,'',0),(65,22,18,58,0,'94.232.216.242',1649762744,0,1,1,1,1,'','Re: Karty katalogowe','<t>Układ sekcji i ich zawartość została dziś ustalona z p. Beatą. <br/>\n<br/>\nPo wprowadzeniu zmian wg wytycznych, przedyskutujemy.</t>','ab80dd8815994ec881aa5a1c344aa4a5',0,'','3or44',1,0,'',0,0,0,1,0,'',0),(66,22,18,60,0,'91.196.8.186',1649765816,0,1,1,1,1,'','Re: Karty katalogowe','<t>Wg mnie czytelne i wizualnie związane z polityką wizerunkową marki - fajnie.</t>','a6af7e0a38f5091d95898ea15c8f40b8',0,'','6a3fh',1,0,'',0,0,0,1,0,'',0),(67,12,31,60,0,'91.196.8.186',1649765950,0,1,1,1,1,'','Re: Godne uwagi tematy','<t>Chyba wspominaliśmy o tym, ale bardzo dawno temu, powinniśmy powtórzyć. Rzeczywiście może wykorzystując coś z materiałów od Adama. Ewentualnie możemy też zrobić coś w formie kolażu zdjęć naszych zaprzyjaźnionych nurków, którzy mają grawer.</t>','15a1fbe9d7658055723d15b5129c7238',0,'','1db',1,0,'',0,0,0,1,0,'',0),(68,30,45,61,0,'94.232.216.242',1649766183,0,1,1,1,1,'','Re: Uchwyt na kamerę','<r>Obecnie testują:<br/>\nPawełczyk i Paćko<br/>\n<E>;)</E><br/>\n<br/>\nNależy ich poprosić o zdjęcia - co konkretnie potrzebujemy? <br/>\nW Krośnie ani jednego nie ma.  Typuję dostępność na czerwiec/lipiec  - zanim się coś z tego wykluje seryjnego.<br/>\n<br/>\nJak zwrócą Polacy można i należy wysłać gdzieś dalej...</r>','6479735163d821aa5dd13a42936af59e',0,'','16kyz4',1,0,'',0,0,0,1,0,'',0),(69,29,26,61,0,'185.153.39.80',1649785819,0,1,1,1,1,'','Re: Nurkowe Demo Days Jaworzno, Koparki 14-15.05.22','<r>Damianie, dodaj kolejne wydarzenia.<br/>\n<br/>\nmail od Marcina Bramsona:<br/>\n<br/>\n\"Imprezy w Polsce, w których mam już uczestnictwo potwierdzone:<br/>\n<br/>\n1. Nurkowe Demo Days „Koparki” Jaworzno: 14-15.05<br/>\n2. Piknik Bananowy, Hańcza Banana Divers: 13-15.08<br/>\n<br/>\nW zaawansowanych planach mam:<br/>\n<br/>\n1. Seacraft Event na DeepSpot - ustalam datę ale będzie to maj lub początek czerwca<br/>\n2. Seacraft Event na Honoratka - to chciałbym powiązać z otwarciem tam centrum testowego Seacraft. Narazie ustalam warunki współpracy z nimi.<br/>\n3. Seacraft Event na Bałtyku - plan na drugą połowę roku, jesień<br/>\n<br/>\nI jeszcze Chorwacja, VIS 18.06-03.07. Tu robię dwutygodniowy event wrakowy połączony z testowaniem Seacraft i NAVI.<br/>\n<br/>\nCo do wsparcie to teoretycznie wszystko mam. Ale zawsze dodatkowe skutery i navi się przydadzą. No i przede wszystkim czekam na „GO” <E>:)</E>\"</r>','ed3cc374633f255e13694ea7ec20db4f',0,'','du4i',1,0,'',0,0,0,1,0,'',0),(71,5,23,61,0,'185.153.39.80',1649790532,0,1,1,1,1,'','Re: [MIL] UDT Rotterdam, Holandia 7-9.06.2022','<t>Osoby uczestniczące z naszej strony:<br/>\nFrank i Witold - całe targi<br/>\nPiotr i Oskar - chcą jechać na 2 dni z jednym noclegiem w celach zwiadowczych.<br/>\n<br/>\nTrzeba sprawdzić jakie są połączenia i zarezerwować hotel. Witek - poproś Igę by to ogarnęła w miarę szybko.</t>','6afc33a02fa97d3641b3d222d133c001',0,'','u1tkqpt',1,0,'',0,0,0,1,0,'',0),(72,31,46,61,0,'185.153.39.80',1649833042,0,1,1,1,1,'','Re: Obciążenie elektroniczne','<t>Nadano nazwę angielską produktu:<br/>\nElectronic load, for battery capacity testing<br/>\n<br/>\noraz wyceniono na 730 euro<br/>\n<br/>\nOskar przygotowuje instrukcję i zdjęcie (tylko do e-sklepu).<br/>\nProdukt będzie dodany do cennika serwisowego. Nie wymaga zdjęcia profesjonalnego.<br/>\n<br/>\nCałość będzie gotowa do wysyłki po świętach.</t>','b8cab9fc98dad2564d38456b11e90db1',0,'','1ghh',1,0,'',0,0,0,1,0,'',0),(73,33,40,61,0,'185.153.39.80',1649833325,0,1,1,1,1,'','Cennik - 12.04.2022','<r>Wkradł się indyjski chochlik  <E>:D</E> <br/>\n<br/>\nW częściach zamiennych do duali pominęłam śrubę napędową ((wyszło jak zaczęłam robić polską wersję)<br/>\nPoprawiłam obydwie wersje (Witku, zamień załącznik do umowy) oraz dodałam do folderu marketing ---&gt; MIL_KARTY KATALOGOWE.<br/>\nDaty zatwierdzenia już nie zmieniam.</r>','aa6e4230f454048a6d61639322ff66ed',0,'','32mfd6',1,0,'',0,0,0,1,0,'',0),(74,34,9,58,0,'94.232.216.242',1649834081,0,1,1,1,1,'','Aktualizacja newsów','<r>Temat poświęcony aktualizacji Newsów o których powinniśmy wspomnieć na naszej stronie.<br/>\n<br/>\nTemat newsa do wrzucenia (gdy już przetestujemy i sprawdzimy finalnie stronę): <br/>\n<br/>\n<B><s>[b]</s>Działaność B+R<e>[/b]</e></B><br/>\n<br/>\nChcemy, aby coś konkretnego było zawarte w tym newsie, czy krótka informacja o powstaniu takiego działu w naszym przedsiębiorstwie?</r>','52056f3de57d19d0768fe2c26d79f5cb',0,'','10ssqdx',1,0,'',0,0,0,1,0,'',0),(75,22,18,61,0,'185.153.39.80',1649834203,0,1,1,1,1,'','Re: Karty katalogowe','<t>Przygotuję w excelu zestawienia do kart militarnych w oparciu o cennik - by ułatwić nieco pracę Damianowi.<br/>\n<br/>\nPo przygotowaniu wzoru pójdzie nam wtedy szybciej.</t>','31acdb1e88a24796c7a0e053a3bac29f',0,'','19fjc2b',1,0,'',0,0,0,1,0,'',0),(76,32,21,61,0,'185.153.39.80',1649835097,0,1,1,1,1,'','Re: Zdjęcia produktowe- paczka, materiały marketingowe','<t>Najpierw trzeba ustalić potrzeby i zrobić strukturę.<br/>\n<br/>\nPotrzeba:<br/>\nzdjęcia każdego produktu do użytku dla nas oraz dla dystrybutorów na www<br/>\nZdjęcia muszą być łatwo identyfikowalne z cennikiem. W jednym katalogu, spójne z tym co mamy u siebie.<br/>\n<br/>\nproponuje 2 katalogi:<br/>\nRec<br/>\nMilitary<br/>\n<br/>\nMoże w każdym katalogu cennik i hiperłącze do zdjęcia?<br/>\n<br/>\nNumerowanie zdjęć - liczba porządkowa_nr katalogowy<br/>\nLiczba porządkowa: należy nadać numery w cenniku (i tu pojawi się problem, bo jak dodamy jakąś pozycję w środku cennika liczby porządkowe będą pomieszane. <br/>\nJakieś inne propozycje?<br/>\n<br/>\nJest również potrzeba kolejnego katalogu ze zdjęciami i rewizji cennika serwisowego<br/>\nCzy jeszcze jakiś katalog?</t>','deff93f0eae996db010afaba7e09dca2',0,'','10jytul',1,0,'',0,0,0,1,0,'',0),(77,34,9,61,0,'185.153.39.80',1649835752,0,1,1,1,1,'','Re: Aktualizacja newsów','<r>Właściwie MT od zawsze prowadziło badania  i rozwój i może niekoniecznie wyglądać dobrze informacja, ze taki dział dopiero utworzyliśmy dopiero  <E>:)</E> .<br/>\nMoże lepiej jakaś wzmianka o poszerzeniu zepołu badawczo rozwojowego? Doszło 2 specjalistów od elektroniki oraz kolega z UA. Może info, że nad czymś pracujemy obecnie?<br/>\nWitek, może coś Ci do głowy przyjdzie ...</r>','6200146601609a1104155e6fe79bf157',0,'','2ktul7bj',1,0,'',0,0,0,1,0,'',0),(78,35,42,58,0,'94.232.216.242',1649838746,0,1,1,1,1,'','Brandbook MIL ENG','<t>Zakładam wątek, żeby sprawa nam nie uciekła.<br/>\n<br/>\nPosiadamy obecnie brandbook MIL w wersji PL, potrzebujemy też ENG (z opisami kolorów), która nie była zlecana u Jarka Karwowskiego.<br/>\n<br/>\nPoproszę go o pliki źródłowe brandbooka MIL, jeżeli sami tego nie będziemy w stanie ogarnąć lub nam tego nie prześlę, będziemy musieli to zlecić u niego.</t>','3189060273b210675f06a950b0671af4',0,'','f4u0q4d',1,0,'',0,0,0,1,0,'',0),(79,22,18,61,0,'185.153.39.80',1649841012,0,1,1,1,1,'','Re: Karty katalogowe','<r>Umieściłam w folderze kart katalogowych zestawienie do TAC1000 - uzgodnione z Witkiem.<br/>\n<br/>\nPrzy tworzeniu zwróciliśmy uwagę na pomieszane kategorie w cenniku.<br/>\n<br/>\nZatem najpierw uporządkujemy karty a potem cennik zgodnie z nimi. <br/>\n<br/>\nW karcie trzeba dodać również krótki opis produktu - czyli co to w ogóle jest <E>:)</E><br/>\n<br/>\nByć może trzeba nieco zmniejszyć render a obok umieścić pole tekstowe na opis.</r>','c2a987e58597b66cec4d494129966529',0,'','f0',1,0,'',0,0,0,1,0,'',0),(80,22,18,58,0,'94.232.216.242',1649841165,0,1,1,1,1,'','Re: Karty katalogowe','<t>Dziękuję, mega przydatne i pomocne. Postaram się jeszcze dzis kartę TAC1000 przygotować w oparciu o ustalone zmiany.</t>','47abf34161c6332ce07b1ad2c4077ed0',0,'','1vlsybk',1,0,'',0,0,0,1,0,'',0),(81,36,28,63,0,'85.221.240.2',1649850248,0,1,1,1,1,'','Premiera - Korea','<t>Informacje od Mares Korea o proponowanym timelinie/ tematy jakich oni potrzebują:<br/>\n<br/>\n<br/>\nThanks for the information.<br/>\n<br/>\nYes, we\'d like to take the batteries for GO with the actual sample.<br/>\n<br/>\nAlso, it\'s great to hear you\'ll have a premiere for \"GO\". <br/>\nCould you provide us more specific plans of your event? (The place, how it\'d be done, and more details) <br/>\n<br/>\nFYI, the plan for Seacraft is as below.<br/>\n<br/>\nOverall plan <br/>\n<br/>\nEnd of APR - KC Radio certification for Future 1000 &amp; Ghost 2000 <br/>\n<br/>\nMAY - Work on creating DPV Manuals (Student &amp; Instructor), plan to complete it in June<br/>\n  * More Images for the manual may be required. (We\'ll check the images from your MEGA link at first) <br/>\n<br/>\nJUN/AUG - DPV specialty Insructor course by Mr. Witold Hoffmann in Korea or Italy (Total 2-3 participants)<br/>\n<br/>\nPlan for \"GO\" <br/>\n<br/>\nA month before official launch - KC cert for Batteries and Radio cert for GO<br/>\n                                                       - Preparation of Flyer/Leaflet/ Mini brochure dedicated for \"GO\" (Since they\'re not on our catalog)<br/>\n                                                       - 40-50pcs of souvenir (T-shirts? or other small items) <br/>\nAfter we get 50 units in Korea - Product presentation &amp; Level 1 training for 2 days (40-50 participants expected), Appointment of Gold(?) Reseller<br/>\n                                                      - DPV course in Pool for few military agents (Mr. Sung and those who are related to military delivery) <br/>\n<br/>\nHope this helps, and some of our events may require your visit to Korea. <br/>\nI\'d appreciate it if you could share your idea on this plan.<br/>\n<br/>\nThanks and best regards,<br/>\nHONG, Joe<br/>\nMares SSI Korea</t>','679e5c7b05f2c171135bd4c2d86786ff',0,'','hrxji',1,0,'',0,0,0,1,0,'',0),(82,34,9,63,0,'85.221.240.2',1649850556,0,1,1,1,1,'','Re: Aktualizacja newsów','<r>Temat 1 - dogranie układu newsów (grafiki w tle), opcja linkowania bezpośredniego do podstron (na przykładzie platformy sprzęgającej - nie ma sensu pisać newsa o platformie powielając treść z zakładki produktowej, lepiej podlinkować newsa od razu do odpowiedniej podstrony). Temat był w toku u Tinssena, ale został przerwany.<br/>\n<br/>\nTemat 2 - dział R&amp;D pasuje dodać pod jedną z tych 2 kategorii głównych, oraz opisać. Do newsów można jedynie dodać informację o dojściu nowych osób do działu badawczo rozwojowego. \n<ATTACHMENT filename=\"Screenshot 2022-04-13 134657.png\" index=\"0\"><s>[attachment=0]</s>Screenshot 2022-04-13 134657.png<e>[/attachment]</e></ATTACHMENT>\n\nMamy troszkę opisane pod: <URL url=\"https://seacraft.eu/seacraft/company/about-seacraft/\">https://seacraft.eu/seacraft/company/about-seacraft/</URL><br/>\nMożna to poszerzyć.</r>','26d45b79ff58612dfff0411da33218f2',1,'','4won0c6',1,0,'',0,0,0,1,0,'',0),(83,33,40,63,0,'85.221.240.2',1649850999,0,1,1,1,1,'','Re: Cennik - 12.04.2022','<r>Hej<br/>\nWłaśnie odkryłem że było kolejne włamanie i zmienili ilość na tylko jedną śrubę- dawniej były dwie: <ATTACHMENT filename=\"Screenshot 2022-04-13 135622.png\" index=\"0\"><s>[attachment=0]</s>Screenshot 2022-04-13 135622.png<e>[/attachment]</e></ATTACHMENT></r>','3500ad159a96c47185c9ecaaf1f20b5d',1,'','13u8hnm',1,0,'',0,0,0,1,0,'',0),(84,33,40,61,0,'185.153.39.80',1649851431,0,1,1,1,1,'','Re: Cennik - 12.04.2022','<t>Poprawione w obydwu wersjach - usunęłam również od razu rotor.</t>','b28863f8778e6232267b821101998cdf',0,'','etc2m',1,0,'',0,0,0,1,0,'',0),(85,34,9,58,0,'94.232.216.242',1649851726,0,1,1,1,1,'','Re: Aktualizacja newsów','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"82\" time=\"1649850556\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=82 time=1649850556 user_id=63]</s>\nTemat 1 - dogranie układu newsów (grafiki w tle), opcja linkowania bezpośredniego do podstron (na przykładzie platformy sprzęgającej - nie ma sensu pisać newsa o platformie powielając treść z zakładki produktowej, lepiej podlinkować newsa od razu do odpowiedniej podstrony). Temat był w toku u Tinssena, ale został przerwany.\n<e>[/quote]</e></QUOTE>\n\nTak, moduł z newsami jest do zmiany, obecny nie jest ani atrakcyjny, ani funkcjonalny. <br/>\n<br/>\nJak już Marcin ogarnie stronę..., będziemy szukać tam innego modułu.</r>','e7fb50628b142b748796f741a67e5fe5',0,'','x58b13',1,0,'',0,0,0,1,0,'',0),(86,22,18,58,0,'94.232.216.242',1649852050,0,1,1,1,1,'','Re: Karty katalogowe','<t>W wolnej chwili rzućcie okiem na wzró kart TAC1000:<br/>\n<br/>\nC:\\SynologyDrive\\MT\\MT_MARKETING\\MILITARY_KARTY KATALOGOWE\\Karta TAC1000.pdf</t>','402bb99382be0a0d84cfb7f78a74915e',0,'','1efl',1,0,'',0,0,0,1,0,'',0),(87,22,18,61,0,'185.153.39.80',1649855015,0,1,1,1,1,'','Re: Karty katalogowe','<r>Jak dla mnie graficznie jest super!<br/>\nBrawo  <E>:D</E> <br/>\n<br/>\nMyślę, że ze specyfikacji trzeba usunąć część nieistotnych parametrów a są takowe - dzięki czemu będzie więcej przestrzeni.<br/>\nCałość tekstu wypadło zbyt blisko dolnego marginesu. Idealnie gdyby treść kończyła  się tutaj gdzie obecnie kończy się tabelka. <br/>\nNa dole pod kreską kod produktu jest mało czytelny - może jakiś odstęp? Może nieco większa czcionka?<br/>\n<br/>\nWitek się na pewno wypowie o co można tekst \"odchudzić\".</r>','b5ea23c3ca63bfbb1ef5259db1778c4c',0,'','3zevfv',1,0,'',0,0,0,1,0,'',0),(88,5,23,63,0,'85.221.240.2',1649856741,0,1,1,1,1,'','Re: [MIL] UDT Rotterdam, Holandia 7-9.06.2022','<r>Lista sprzętu z Krosna jest w miarę określona wcześniej. (DPC, DUAL-TAC2000, TAC1000). Więcej nie upchamy.<br/>\nProjekt stoiska jest przygotowany, jedyne co to temat wydruku. Odświeżę Jarkowi.<br/>\n<br/>\nshow:<br/>\n<br/>\nRotterdam Ahoy<br/>\n<br/>\nAhoyweg 10<br/>\n<br/>\n3084 BA Rotterdam<br/>\n<br/>\n<br/>\nloty przykładowe:<br/>\n<br/>\n<URL url=\"https://www.skyscanner.pl/transport/flights/rze/eind/220607/220609/?adultsv2=1&amp;cabinclass=economy&amp;childrenv2=&amp;inboundaltsenabled=false&amp;outboundaltsenabled=false&amp;preferdirects=false&amp;rtn=1\"><LINK_TEXT text=\"https://www.skyscanner.pl/transport/fli ... alse&amp;rtn=1\">https://www.skyscanner.pl/transport/flights/rze/eind/220607/220609/?adultsv2=1&amp;cabinclass=economy&amp;childrenv2=&amp;inboundaltsenabled=false&amp;outboundaltsenabled=false&amp;preferdirects=false&amp;rtn=1</LINK_TEXT></URL><br/>\n<br/>\n<URL url=\"https://www.skyscanner.pl/transport/loty/rze/amst/220607/220609/?adultsv2=1&amp;cabinclass=economy&amp;childrenv2=&amp;inboundaltsenabled=false&amp;outboundaltsenabled=false&amp;preferdirects=false&amp;priceSourceId=&amp;priceTrace=&amp;qp_prevCurrency=PLN&amp;qp_prevPrice=ReturnNoPrices&amp;qp_prevProvider=ins_month&amp;rtn=1\"><LINK_TEXT text=\"https://www.skyscanner.pl/transport/lot ... onth&amp;rtn=1\">https://www.skyscanner.pl/transport/loty/rze/amst/220607/220609/?adultsv2=1&amp;cabinclass=economy&amp;childrenv2=&amp;inboundaltsenabled=false&amp;outboundaltsenabled=false&amp;preferdirects=false&amp;priceSourceId=&amp;priceTrace=&amp;qp_prevCurrency=PLN&amp;qp_prevPrice=ReturnNoPrices&amp;qp_prevProvider=ins_month&amp;rtn=1</LINK_TEXT></URL><br/>\n<br/>\n<br/>\nBezp. do rotterdamu ciężkawo. Prawdopodobnie i tak trzeba samochód na miejscu jakiś wynająć, albo tak zgrać czasowo że przylot jest przed/ po targach (podjadę np.)</r>','08be26f0787dbe231e5d2f77b28742aa',0,'','atuflry0',1,0,'',0,0,0,1,0,'',0),(89,12,31,63,0,'85.221.240.2',1649859711,0,1,1,1,1,'','Re: Godne uwagi tematy','<r>Dobre fotki - żeby skubany był przyjemniejszy we współpracy... <E>;)</E><br/>\n<URL url=\"https://www.facebook.com/photo/?fbid=5603066939738070&amp;set=pcb.7733543126657657\"><LINK_TEXT text=\"https://www.facebook.com/photo/?fbid=56 ... 3126657657\">https://www.facebook.com/photo/?fbid=5603066939738070&amp;set=pcb.7733543126657657</LINK_TEXT></URL></r>','bc1008929d82bfaf74a0af20fb49e30a',0,'','4vlte',1,0,'',0,0,0,1,0,'',0),(90,6,20,61,0,'185.153.39.80',1649859770,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Rozmawiałam dziś z Adamem. Ustaliłam budżet filmu. Jest zdecydowanie większy niż na film z produkcji, więc możemy wymagać więcej <E>:)</E><br/>\n<br/>\nPrzy okazji ma przygotować z surówki jakieś krótkie filmiki na social media. Musimy się zastanowić jakie potrzebujemy.<br/>\nIntensywnie tematem zajmie się po świętach. Wtedy ustalimy jakie sceny będą do nakręcenia przez naszych zagranicznych przyjaciół.<br/>\nAdam próbuje ogarnąć jakieś lotnisko. Będzie potrzebował skuter, bo trudno kręcić cokolwiek bez niego... On nawet nie wie jak ten skuter wygląda.<br/>\n<br/>\nByć może wystarczy wysłać skuter w 2 miejsca a 3 do Adama.</r>','e9c102f18b495e92f52f17f776ca442b',0,'','796mg',1,0,'',0,0,0,1,0,'',0),(91,6,20,63,0,'85.221.240.2',1649861227,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<t>Ścigałem lotnisko w Poznaniu. Nie udaje się dodzwonić, kontakt mailowy - bez efektów. Chyba najoptymalniej by Adam ścignął u siebie lokalnie, skoro będzie kręcił.</t>','e914184d991fb963b294964906c47a0e',0,'','p49gfd',1,0,'',0,0,0,1,0,'',0),(92,12,31,58,0,'192.162.175.145',1649861322,0,1,1,1,1,'','Re: Godne uwagi tematy','<r>Witku, coś link nie działa ;/ <br/>\n<br/>\nCzyżby to fotki Kowalczuka z ostatnich dni,które publikuje? Czaimy się z Pauliną na nie , jak tylko kwestia umowy z nim się wyjaśni i wyrazi zgodę, fajny repost i fotki na insta.<br/>\n\n<ATTACHMENT filename=\"jk.jpg\" index=\"0\"><s>[attachment=0]</s>jk.jpg<e>[/attachment]</e></ATTACHMENT></r>','4309815f938ea66b63bc4cc744659c59',1,'','ff7y',1,0,'',0,0,0,1,0,'',0),(93,12,31,63,0,'85.221.240.2',1649862984,0,1,1,1,1,'','Re: Godne uwagi tematy','<r>Spróbuj dołączyć do grupy TECHNICAL DIVING TRAINING - jest ustawienie prywatności tylko dla odbiorców. Nieco inna fotka, ale podobna partia materiału <E>;)</E><br/>\n<URL url=\"https://www.facebook.com/groups/1206941425984559\">https://www.facebook.com/groups/1206941425984559</URL><br/>\n<URL url=\"https://www.facebook.com/photo/?fbid=5603066939738070\">https://www.facebook.com/photo/?fbid=5603066939738070</URL></r>','5786e6b749ce1490a6d401c80b53786c',0,'','x6r',1,0,'',0,0,0,1,0,'',0),(94,25,10,61,0,'185.153.39.80',1649916421,0,1,1,1,1,'','Re: Błędy, nie działające linki','<t>Rezygnujemy z usług Marcina.<br/>\nZa chwilę Piotr zadzwoni do Witka w celu ustalenia szczegółów jak to zrobić, bo strasznie namieszali, łącznie z przejęciem konta Tinssena.</t>','29356c0a4443c843f61a840e7fba21c8',0,'','5d48so2i',1,0,'',0,0,0,1,0,'',0),(95,22,18,58,0,'94.232.216.242',1649919617,0,1,1,1,1,'','Re: Karty katalogowe','<r>Wersja po poprawkach i korektach: C:\\SynologyDrive\\MT\\MT_MARKETING\\MILITARY_KARTY KATALOGOWE\\<B><s>[b]</s>Karta TAC1000_v2<e>[/b]</e></B>.pdf<br/>\n<br/>\nUdało się odchudzić i przesunać nieco tabelke specyfikacji od dolnego marginesu.<br/>\n<br/>\nZe specyfikacji z dwóch pozycji Weight without i weight with transport box scaliłem do jednej <B><s>[b]</s>Weight without/with transport box<e>[/b]</e></B>, dzieki czemu zyskaliśmy trochę przestrzeni, dodatkowo przesunałem niecy wyżej tabelkę specyfikacji zgodnie z sugestią, wygląda lepiej wg mnie <E>:)</E><br/>\n<br/>\nW prawym dolnym rogu zwiększyłm wielkosc czcionki z nr katalogwym.</r>','342e865ed498cc33bebc5b1c39cfde03',0,'','82sbadr',1,0,'',0,0,0,1,0,'',0),(96,37,19,58,0,'94.232.216.242',1649921941,0,1,1,1,1,'','Ulotka/flyer ENC3','<t>Temat poświęcony ulotce ENC3.<br/>\n<br/>\nNie posiadamy, ulotki/flyer ENC3, Jarek Karwowski nam robi update tej z ENC2, czy sami ogarniamy? Jeżeli są pliki źródłowe temat do zrobienia.</t>','0002559b1ef636c34965ddd55883acb5',0,'','ms2ibbj',1,0,'',0,0,0,1,0,'',0),(97,37,19,61,0,'185.153.39.80',1649924770,0,1,1,1,1,'','Re: Ulotka/flyer ENC3','<t>Nie mamy plików źródłowych, to było robione z 4 lata temu...<br/>\nMożna go zapytać o to, można mu to zlecić, ale boję się, że czasowo nie wyrobi.</t>','1f874ffdc5abd794dc6e94d540540324',0,'','b83y9ydk',1,0,'',0,0,0,1,0,'',0),(98,22,18,61,0,'185.153.39.80',1649926502,0,1,1,1,1,'','Re: Karty katalogowe','<t>Wygląda idealnie. <br/>\nWydrukujemy w kolorze i sprawdzimy czytelność. Nie wiem czy nr katalogowy na dole jest wystarczająco czytelny. Czcionka jest dość gruba i może się zlewać.<br/>\nWymiary skrzyń podamy w milimetrach, dobrze jest zachować spójność jednostek miar.<br/>\n<br/>\nZawartość merytoryczna -  dobrze żeby Witek sprawdził czy są czytelne i jasne. <br/>\n<br/>\n<br/>\nCo do pozostałych kart - jestem w trakcie tworzenia. Wbrew pozorom nie schodzi z tym tak szybko jak bym chciała...<br/>\nWitek docelowo musi sprawdzić poprawność danych na pliku, który robię. Pewne rzeczy musimy uzgodnić dziś wspólnie.<br/>\nPlik umieszczam w folderze  z kartami. Na razie wgrywam tyle co mam poglądowo.</t>','2a61a63ead324671cb0cb96a51ee824f',0,'','1uxjnew',1,0,'',0,0,0,1,0,'',0),(99,38,23,63,0,'85.221.240.2',1649937371,0,1,1,1,1,'','Japonia','<r>Poniżej lista i opis terminów preferowanych przez naszego lokalnego partnera- Nippon Kaiyo:<br/>\n<br/>\n----<br/>\n<br/>\n∙ Equipment exhibition organized by the Army (2 days between September 5 and 9)<br/>\n <br/>\n→It is held annually at an army base (deep in the mountains) at the foot of Mt.Fuji. Many army suppliers display their latest equipment. We expect the most from the Army as a sales destination for your DPVs. However, since the event is held inside an army base, foreigners need to apply in advance and get permission to enter due to security issues (although NATO members should have no problem).<br/>\n <br/>\n・SEECAT (Security Exhibition) (October 5-7 in Tokyo)<br/>\n<URL url=\"https://www.seecat.biz/2021/english/guideline/\">https://www.seecat.biz/2021/english/guideline/</URL><br/>\n <br/>\n→This is an exhibition for security and defense equipment in Japan. Every year, several domestic distributors of foreign manufacturers exhibit their underwater equipment (for DPVs, Rotinor (this is our company), Patriot3 Jetboots, SUEX, etc. have been exhibited so far).<br/>\n <br/>\n・DSEI JAPAN (Defense Exhibition) (March 15-17, 2023 in Chiba, a prefecture next to Tokyo)<br/>\n<URL url=\"https://www.dsei-japan.com/\">https://www.dsei-japan.com/</URL><br/>\n <br/>\n→This is the Japanese version of DSEI as you know it. As an international exhibition for Asia, many foreign manufacturers directly exhibit at this event. Usually held once every two years, it has been postponed to next year due to Corona.</r>','bf46736994242c399f308f81acb13877',0,'','1275ckz',1,0,'',0,0,0,1,0,'',0),(100,39,23,63,0,'85.221.240.2',1649938312,0,1,1,1,1,'','Nowa Zelandia','<r>Najważniejsza impreza nurkowa rejonu: <URL url=\"https://diveoztek.com.au/\">https://diveoztek.com.au/</URL><br/>\n<br/>\nNasz partner REC w AU :<URL url=\"https://www.snorkeldivemelbourne.com.au/\">https://www.snorkeldivemelbourne.com.au/</URL><br/>\nZnają rejon, NZ również. Mając preferowane daty z dobrym, dużym wyprzedzeniem możemy koordynować nurkowania i spotkania.<br/>\n<br/>\nKluczowe byłoby określenie osób plus przynajmniej miesiąca wyjazdu i na tej bazie dogranie całości.</r>','344de19424d51d7219efe83f2edb79cf',0,'','8yfx',1,0,'',0,0,0,1,0,'',0),(101,25,10,63,0,'85.221.240.2',1649940342,0,1,1,1,1,'','Re: Błędy, nie działające linki','<t>Uzgodniliśmy że całość odbędzie się w sposób skoordynowany i porządny po świętach - włącznie z przenosinami na szybszy serwer.</t>','429d6ec7b2b3891d1b2c2f55a1e7810f',0,'','1x8csz',1,0,'',0,0,0,1,0,'',0),(102,22,18,61,0,'185.153.39.80',1649966018,0,1,1,1,1,'','Re: Karty katalogowe','<t>Wgrana nowa wersja kart (bez nawigacji na razie).<br/>\nWitek zerknij jeszcze na to. Jak ok to można działać dalej.</t>','eb51ffc0b84fe89bfa4bdf0b97657d45',0,'','wx6r66',1,0,'',0,0,0,1,0,'',0),(103,40,31,58,0,'94.232.216.242',1650001440,0,1,1,1,1,'','Najlepszy czas na publiakcję w SM','<r>Przypinam temat, ciekawe zestawienia, może się przyda <E>;)</E> <br/>\n<br/>\nNa bazie badań i danych statystycznych z poprzedniego roku stworzono zestawienie globalnego zaangażowania użytkoników na kanałach social media i określono kiedy teoretycznie najlepiej publikować treści, aby miały największy zasięg:<br/>\n<br/>\n<B><s>[b]</s>Facebook<e>[/b]</e></B>\n<QUOTE><s>[quote]</s>Jako najlepszy czas na publikację na Facebooku podaje się godziny od 10 do 11, a także wieczory, po godzinie 19. Jeśli chodzi o dni tygodnia – wpisy, na których popularności szczególnie nam zależy warto wstawiać w poniedziałki, środy oraz piątki. Pamiętajmy, że również w przypadku Facebooka działa algorytm odpowiedzialny za ranking wyświetlania postów na tablicy użytkownika. Zadbajmy więc o organiczny zasięg postów poprzez wstawianie atrakcyjnego contentu również w dni mniejszej aktywności internautów, a także prowadzenie relacji na żywo. Dzięki temu zwiększymy prawdopodobieństwo, że posty dotrą do użytkowników w czasie ich największej aktywności w sieci.<e>[/quote]</e></QUOTE>\n\n\n<ATTACHMENT filename=\"kiedy-publikowac-na-facebooku.jpg\" index=\"1\"><s>[attachment=1]</s>kiedy-publikowac-na-facebooku.jpg<e>[/attachment]</e></ATTACHMENT>\n\nGlobalne zaangażowanie na Facebook, źródło: <URL url=\"https://sproutsocial.com/insights/best-times-to-post-on-social-media/\"><LINK_TEXT text=\"https://sproutsocial.com/insights/best- ... ial-media/\">https://sproutsocial.com/insights/best-times-to-post-on-social-media/</LINK_TEXT></URL><br/>\n<br/>\n<B><s>[b]</s>Instagram<e>[/b]</e></B>\n<QUOTE><s>[quote]</s>Jednym z najpopularniejszych kanałów społecznościowych jest Instagram, służący przede wszystkim do wstawiania zdjęć oraz krótkich relacji. Przez długi czas na tablicy użytkowników pojawiały się posty w kolejności chronologicznej, dzięki czemu wkrótce po publikacji materiał trafiał na samą górę listy. Jak to wygląda obecnie i kiedy publikować na IG, żeby uzyskać dużo reakcji? W pewnym momencie Instagram odszedł od takiego sposobu wyświetlania treści, wprowadzając algorytm. Trzymanie się określonych, idealnych ram czasowych wciąż jednak ma znaczenie. Najnowsza aktualizacja algorytmu uwzględnia czas publikacji i wspiera posty wstawione w niedalekiej przeszłości.<br/>\n<br/>\nKiedy publikować zdjęcia na Instagramie?<br/>\nPołudnie – pomiędzy 11.00 a 13.00<br/>\nWieczorem – pomiędzy 19.00 a 21.00<br/>\nNajlepsze dni na publikację treści to środy i czwartki<br/>\nNajmniejsze szanse na dotarcie do odbiorców mają z kolei posty publikowane w weekendy, a także te wstawiane tuż po standardowym czasie pracy większości Polaków. Po godzinie 17 zajmują się oni raczej obowiązkami domowymi i dopiero po ich wypełnieniu mają chwilę, by zajrzeć w telefon czy usiąść przy komputerze.<e>[/quote]</e></QUOTE>\n\n<ATTACHMENT filename=\"kiedy-publikowac-na-instagramie.jpg\" index=\"0\"><s>[attachment=0]</s>kiedy-publikowac-na-instagramie.jpg<e>[/attachment]</e></ATTACHMENT>\n\nGlobalne zaangażowanie na Instagramie, źródło: <URL url=\"https://sproutsocial.com/insights/best-times-to-post-on-social-media/\"><LINK_TEXT text=\"https://sproutsocial.com/insights/best- ... ial-media/\">https://sproutsocial.com/insights/best-times-to-post-on-social-media/</LINK_TEXT></URL><br/>\n<br/>\nTak wygląda w teorii, w praktyce bywa różnie, szczególnie, że klientów mamy na całym Świecie, wiec z tym czasem jest różnie, ale warto zwrócić uwagę na te wykresy przy publikacji.</r>','32e06cffe3932261a83df76e9625780e',1,'','3reuyj3v',1,0,'',0,0,0,1,0,'',0),(104,41,50,58,0,'94.232.216.242',1650002649,0,1,1,1,1,'','Podróbki, kopie, plagiaty naszego sprzętu itp','<r>Temat powstały na bazie bieżących potrzeb i wydarzeń, pojawiają się kopie naszego sprzętu, w tym temacie możemy zgłaszać tego typu akcje konkurencji.<br/>\n\n<ATTACHMENT filename=\"skuter uchwyt transportowy.jpg\" index=\"0\"><s>[attachment=0]</s>skuter uchwyt transportowy.jpg<e>[/attachment]</e></ATTACHMENT>\n\n<QUOTE><s>[quote]</s>Zrzynka piękna. Puśćcie na fb że już nas wszyscy kopiują, co znaczy, że wprowadzamy standardy…<br/>\nNie będziemy się gonić z kołkami, ale mamy chyba uchwyt założony na skuterze, który jest chroniony jako wzór (użytkowy albo przemysłowy, nie pamiętam)<br/>\nTrzeba to chyba jakoś przekuć na jakąś korzyść dla nas i takie rzeczy sygnalizować. <br/>\n<br/>\nPutin by sobie z tym doskonale poradził, a co zrobi nasz dział marketingu? \n<e>[/quote]</e></QUOTE>\n\n<br/>\nPost na oficjalnym kanale fb to chyba za mocne, żeby się z kimś kopać (?) i słabo wizerunkowo. Nie są oni dla nas żadną konkurencją <E>:)</E> <br/>\n<br/>\nPomysły? <E>:)</E><br/>\n<br/>\nMożna bardziej roznieść to w grupach nurkowych, gdzieś przemycić w komentarzach, ale nie przez nasz oficjalny profil, bez większej zaplanowanej akcji..<br/>\n<br/>\nedit:<br/>\n<br/>\nPomysł Witka wydaję się być idealnym:<br/>\n\n<QUOTE><s>[quote]</s>Najlepszą opcją \'zauważenia\' jest podniesienie tematu przez niezależy/niepowiązany z marką portal. Jolly divers, Divers24 - idealna opcja na krótkiego posta o kopiowaniu rozwiązań z Polski.<e>[/quote]</e></QUOTE></r>','8c22c71b12184117275bda6239062767',1,'','34pmp',1,0,'',0,0,0,1,0,'',0),(105,40,31,60,0,'91.196.8.186',1650011819,0,1,1,1,1,'','Re: Najlepszy czas na publiakcję w SM','<t>Na początku mocno się sugerowałam tymi godzinami, bo znalazłam podobne opracowanie, ale.. jak publikuję w godzinach 11-13 i 19-21 to odzew potrafi być mega marny, a czasem dodam coś zupełnie rano lub w godzinach popołudniowych i mamy rekordy polubień i wyświetleń.. Ciężko z tym trafić, bo u nas odbiorcy to tylko w małym ułamku Polska.</t>','4feb977109348705bf892eb7423cdf46',0,'','jr3mf9y',1,0,'',0,0,0,1,0,'',0),(106,39,23,60,0,'91.196.8.186',1650011926,0,1,1,1,1,'','Re: Nowa Zelandia','<t>Harmonogram projektowy zakłada realizację dwóch wydarzeń w Nowej Zelandii w terminach: <br/>\n01/07/2022-30/04/2023<br/>\n01/01/2023 31/10/2023</t>','b12c05a142e5a11496f1acf6818376b4',0,'','9ktoy',1,0,'',0,0,0,1,0,'',0),(107,38,23,60,0,'91.196.8.186',1650011948,0,1,1,1,1,'','Re: Japonia','<t>Harmonogram projektowy zakłada realizację dwóch wydarzeń w Japonii w terminach:<br/>\n01/07/2022-30/04/2023<br/>\n01/01/2023 31/10/2023</t>','4e77e547f2f5dada64248a87844990e7',0,'','b6wl',1,0,'',0,0,0,1,0,'',0),(108,42,21,58,0,'94.232.216.242',1650013542,0,1,1,1,1,'','Banner Tarnobrzeg','<r>Temat bannera na Tarnobrzeg o który prosił Jarek,<br/>\n<br/>\nObecny/poprzedni banner w Tarnobrzegu:<br/>\n\n<ATTACHMENT filename=\"stary banner.jpg\" index=\"0\"><s>[attachment=0]</s>stary banner.jpg<e>[/attachment]</e></ATTACHMENT>\n\nJarek dość precyzyjnie określił jakie powinny być rendery skuterów, które przygotował Paweł Wołoszyn:<br/>\n\n<QUOTE><s>[quote]</s>- ale na jednym z obrazów skuter Ghost (ten grubszy) nie ma uchwytu na dziobie (przodzie) skutera,<br/>\n- na skuterach muszą być wrysowane nasze lampy oświetleniowe, [na przednim uchwycie transportowym],<br/>\n- ponadto brakuje „logu”, również na przednim uchwycie transportowym,<br/>\n- trzeba dorysować przewód łączący konsolę ENC z logiem,<br/>\n- trzeba dorysować przewód łączący oświetlenie (lampki) z gniazdem zasilania<br/>\n<br/>\nMoże nie na wszystkich skuterach wszystko, ale na jednym komplet ENC (czyli z logiem), na innym lampy i przewód od gniazda zasilania. A na małym „GO” pewnie nic (taki jak jest) ,\n<e>[/quote]</e></QUOTE>\n\nStworzenie nowych renderów zapewne zajmię trochę czasu Marcinowi, Paweł Wołoszyn, po otrzymaniu tych wytycznych już nic nam nie przesłał  <E>:oops:</E> <br/>\nPytanie, czy aż tak bardzo technicznie muszą być przedstawione rendery skuterów na tym banerze na Tarnobrzeg, czy możemy coś zrobić bardziej spójnego z naszą identyfikacją wizualną, a jak już będziemy mieć takie rendery jak chciał Jarek, to się podmieni?<br/>\n<br/>\nPropozycja bannera:<br/>\n\n<ATTACHMENT filename=\"nowy banner.jpg\" index=\"1\"><s>[attachment=1]</s>nowy banner.jpg<e>[/attachment]</e></ATTACHMENT></r>','0ddb0ea37a15d79f2904fefe0789cfff',1,'','3i472j',1,0,'',0,0,0,1,0,'',0),(109,40,31,58,0,'94.232.216.242',1650014137,0,1,1,1,1,'','Re: Najlepszy czas na publiakcję w SM','<r>Jasne, pełna zgoda, wrzuciłem tutaj, żeby było pod ręką i można było szybko i łatwo porównać, przeanalizować <E>;)</E><br/>\n\n<QUOTE author=\"Paulina &#x15A;l&#x119;zak\" post_id=\"105\" time=\"1650011819\" user_id=\"60\"><s>[quote=\"Paulina Ślęzak\" post_id=105 time=1650011819 user_id=60]</s>\n Ciężko z tym trafić, bo u nas odbiorcy to tylko w małym ułamku Polska.\n<e>[/quote]</e></QUOTE>\n\nTak, tak, w tych zestawieniach chodzi o czas lokalny w danej strefie czasowej, czyli jak coś wrzucamy u nas np o 11 am, to np w Koreii jest wtedy 18.</r>','a7f39cc85df2da514e98c09644d9b471',0,'','3bp17',1,0,'',0,0,0,1,0,'',0),(110,27,23,58,0,'94.232.216.242',1650014752,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Bardzo ładnie te pokrowce się prezentują <E>:)</E><br/>\n<br/>\nA gdyby tak, na te pokrowce drukować nasze logo z jeden strony i wprowadzić obok bannerów i flagi jako materiały reklamowe dla naszych partnerów? <br/>\n<br/>\nAlbo wyposażyć każdego z naszych partnerów w taki porkowiec na stolik, to przestali by nareszcie używać pogiętych bannerów na stolikach.</r>','cb49535f1232377ff0104e6e355d112d',0,'','pw4zdim',1,0,'',0,0,0,1,0,'',0),(111,42,21,61,0,'185.153.39.80',1650015605,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<r>Moim zdaniem jest ok.<br/>\nWyślij proszę do Jarka i Piotra do zatwierdzenia.<br/>\nZ adnotacją, iż projekt jest zgodny z naszą identyfikacją wizualną ale na uwagi jesteśmy oczywiście otwarci  <E>;)</E></r>','b294cc358df445b699f34e181b610847',0,'','30e1md',1,0,'',0,0,0,1,0,'',0),(112,27,23,61,0,'185.153.39.80',1650017216,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<t>Dobry pomysł, proponuję jeszcze wprowadzić ten składany stół - pasuje wymiarowo.</t>','6f50c59864e090858e06e73e92793bbd',0,'','3640e5',1,0,'',0,0,0,1,0,'',0),(113,27,23,63,0,'85.221.240.2',1650022555,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<t>Przetestuję w działaniu- pokrowiec już dotarł i bardzo sensownie wygląda, ale nie nakładałem jeszcze na stół.<br/>\nGeneralnie pomysł z pokrowcem ologowanym Seacraftem jest dobry - natomiast, skutery zdecydowanie lepiej się prezentują na stojakach wystawowych na 1 skuter. <br/>\n<br/>\nNiestety, bariera cenowa jest na tyle duża że nie są one zbyt rozpowszechnione. Również problematyczna- z uwagi na wagę- jest prezentacja na nich Ghostów. Koszt wykonania jest wysoki.<br/>\n<br/>\nRaczej \'marzyłoby mi się\' zwiększenie dostępności ładnych stojaków - albo, przez zwiększenie rabatowania, albo - dodanie prostszego, tańszego modelu.<br/>\nDodatkowo, opcja by zamontować na stojaku również Ghosta/ większy nacisk na użytkowanie stojaków na 3 skutery na wydarzeniach targowych.<br/>\n<br/>\nPrawdopodobnie rozwiązaniem jakie zadziała, jest przesłanie na długoterminową umowę testowania odpowiednich stojaków wszystkim partnerom którzy się wystawiają. (na koszt MT). Partnerzy płacą za stoiska.<br/>\n<br/>\nOd razu do rozważenia temat GO! - idealnie się całość komponuje na stojak na 3 sztuki : Ghost, Future, GO! na jednym stojaku.</t>','ca0f7ccce7c6f0b4eb54b57b4d57f98d',0,'','2q3qal',1,0,'',0,0,0,1,0,'',0),(114,42,21,58,0,'94.232.216.242',1650024083,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<t>Jest akceptacja, zmieni się tylko slogan, na \"innowacyjny sprzęt podwodny\", przygotuję pliki do druku.<br/>\n<br/>\nPaulina, ogarniesz nam wydruk, czy mam tu na miejscu w Krośnie to ogarnąć?</t>','e8cbabdd0c26c26fd85faf53cb0f8995',0,'','9ag',1,0,'',0,0,0,1,0,'',0),(115,27,23,61,0,'185.153.39.80',1650024429,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>My na stojakach nie zarabiamy a do ostatniego modelu obawiam się, że dopłacamy, bo nie dodaliśmy nowego do cennika a wysłaliśmy chyba do Australii jako zamówiony z kodem starego stojaka (już ich nie produkujemy).<br/>\n<br/>\nOstatni model był próbą zrobienia taniego stojaka - niestety nie jest to możliwe. Materiały są w horrendalnych cenach, a robiliśmy jeszcze przed podwyżkami... A to kupę żelaztwa jednak. W dodatku składanego co również podraża koszt.<br/>\nNawet nie wiem jakie ostatecznie wyszły koszty - po świętach sprawdzimy.<br/>\n<br/>\nJeżeli masz pomysł na tani stojak to zapewne Wołoszyn chętnie posłucha  <E>;)</E> <br/>\n<br/>\nOczywiście, że dobrze się komponują 3 sztuki - zostały tak zaprojektowane właśnie by każdy z modeli wszedł - mają dobry rozstaw haków pod każdy model (niezależnie który gdzie położysz) Tomek zęby na tym zjadał... my zresztą też.</r>','eba4a556903a6c9f4fdf16ae36df907b',0,'','8o9p0',1,0,'',0,0,0,1,0,'',0),(116,42,21,60,0,'91.196.8.186',1650349968,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<t>Nie ma sprawy. Podeślij gotowy plik z informacją na jakim materiale i z jakim mocowaniem powinien być wykonany baner. <br/>\nCzy ma mieć dziury do naciągnięcia? Grubość materiału podobna jak w poprzednich?</t>','3ab6bb1c2352ecd1837bb2157519d564',0,'','1bdab8',1,0,'',0,0,0,1,0,'',0),(117,27,23,60,0,'91.196.8.186',1650350177,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<t>Jeśli zdecydujecie się na wprowadzenie pokrowców i stołów do oferty, to dajcie znać. <br/>\nO ile ze stołami oczywiście nie będzie problemu, o tyle pokrowce są w określonych kolorach i będzie trzeba poszukać pewnie wśród producentów takiego, który zafarbuje nam pokrowce. Myślę, że może się to wiązać z koniecznością zamówienia większej liczby pokrowców.</t>','2f102ca5d6d93255512b3f5408678f9e',0,'','2qni8p',1,0,'',0,0,0,1,0,'',0),(118,42,21,58,0,'94.232.216.242',1650350369,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<r>Tak, materiał tak jak ostanio, przypuszczam, że to było tak: materiał frontlight mat 510g,Wykończenie: zgrzewanie, oczkowanie co 50cm. Wymiar 290x140 cm.<br/>\n<br/>\nLink do plików do druku wysłany na maila <E>;)</E></r>','00746b646c13e3268d33d7bb7426546d',0,'','62ng4m3d',1,0,'',0,0,0,1,0,'',0),(119,7,41,61,0,'94.232.216.242',1650353459,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<t>Do dodania nowy produkt:<br/>\n<br/>\nPlatforma ENC3M gen.II<br/>\n<br/>\nObecnie w produkcji prototyp.</t>','a815fde540dff7677572260d9035e6a6',0,'','lqwbkm8',1,0,'',0,0,0,1,0,'',0),(120,43,51,58,0,'94.232.216.242',1650354229,0,1,1,1,1,'','Platforma ENC3M gen.II','<t>Temat dotyczący Platforma ENC3M gen.II</t>','81c2a9b0c221606ad4f8605fccc497f2',0,'','1lfsn',1,0,'',0,0,0,1,0,'',0),(121,31,46,63,0,'85.221.240.2',1650356408,0,1,1,1,1,'','Re: Obciążenie elektroniczne','<r>Manual w wersji online:  <URL url=\"https://support.seacraft.eu/index.php/knowledge-base/battery-capacity-testing/\"><LINK_TEXT text=\"https://support.seacraft.eu/index.php/k ... y-testing/\">https://support.seacraft.eu/index.php/knowledge-base/battery-capacity-testing/</LINK_TEXT></URL><br/>\nManual w wersji pdf generowanej z wersji online: (co gwarantuje aktualnośc treści): <URL url=\"https://support.seacraft.eu/index.php/knowledge-base/battery-capacity-testing/?print=pdf\"><LINK_TEXT text=\"https://support.seacraft.eu/index.php/k ... ?print=pdf\">https://support.seacraft.eu/index.php/knowledge-base/battery-capacity-testing/?print=pdf</LINK_TEXT></URL><br/>\n<br/>\nPliki źródłowe: <URL url=\"https://cloud.seacraft.eu/s/QDTFndegFFkwVDf\">https://cloud.seacraft.eu/s/QDTFndegFFkwVDf</URL></r>','ac0b5e5e30f93bb7bbd60c82b7527065',0,'','hjwp',1,0,'',0,0,0,1,0,'',0),(122,44,21,61,0,'94.232.216.242',1650356674,0,1,1,1,1,'','Foldery do udostępnienia - struktura','<t>Poniżej propozycja Franka. <br/>\nUmieściłam, by nie zaginęło.<br/>\n<br/>\nWg mnie jasny i intuicyjny podział.<br/>\nJednak nazwy folderów i plików nie mogą się powtarzać i muszą mieć unikalne nazwy.<br/>\n<br/>\nMam nadzieję, że dziś Albinowi uda się zaproponować jakiś klucz do nazewnictwa, by można było pójść dalej ...<br/>\n<br/>\n...............................................<br/>\n<br/>\n Brand Book<br/>\n<br/>\nLogos<br/>\n  Recreational<br/>\n  Military<br/>\n<br/>\nFonts<br/>\n<br/>\nProduct Pictures<br/>\n<br/>\n    Scooters<br/>\n<br/>\n    GO!<br/>\n                Photos<br/>\n                               High Res<br/>\n                               Web<br/>\n                Renders<br/>\n                               High Res<br/>\n                               Web<br/>\n                Accessories<br/>\n                               Photos<br/>\n                                               High Res<br/>\n                                               Web<br/>\n                               Renders<br/>\n                                               High Res<br/>\n                                               Web<br/>\n<br/>\n   FUTURE<br/>\n                Photos<br/>\n                               High Res<br/>\n                               Web<br/>\n                Renders<br/>\n                               High Res<br/>\n            