           High Res<br/>\n                                               Web<br/>\n                               Renders<br/>\n                                               High Res<br/>\n                                               Web<br/>\n<br/>\n    ENC<br/>\n                ENC3<br/>\n                               Photos<br/>\n                                               High Res<br/>\n                                               Web<br/>\n                                               Renders<br/>\n                                               High Res<br/>\n                                               Web<br/>\n                               Accessories<br/>\n                                               Photos<br/>\n                                                               High Res<br/>\n                                                               Web<br/>\n                                               Renders<br/>\n                                                               High Res<br/>\n                                                               Web<br/>\n                               Sample Routes<br/>\n<br/>\n    ENCM<br/>\n                ENC3M<br/>\n                               Photos<br/>\n                                               High Res<br/>\n                                               Web<br/>\n                                               Renders<br/>\n                                               High Res<br/>\n                                               Web<br/>\n                               Accessories<br/>\n                                               Photos<br/>\n                                                               High Res<br/>\n                                                               Web<br/>\n                                               Renders<br/>\n                                                               High Res<br/>\n                                                               Web<br/>\n<br/>\nBrochures and Flyers<br/>\n<br/>\nSocial Media<br/>\n                Ads (open format)<br/>\n                Articles (open format)<br/>\n                Movies (adapted size)<br/>\n<br/>\nSuggested documents<br/>\n                Testing agreement (sample)<br/>\n                Rental agreement (sample)<br/>\n<br/>\nCooperation Conditions (latest version)</t>','53733a0dfacdd9d4e6a55e66f77d2d13',0,'','d3apb0h2',1,0,'',0,0,0,1,0,'',0),(123,7,41,61,0,'94.232.216.242',1650357047,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<t>Nowy produkt:<br/>\n<br/>\nStojak do DPC <br/>\n<br/>\nObecnie w fazie projektowej. Powinien być gotowy na: UDT Rotterdam, Holandia 7-9.06.2022</t>','f5ca9ecf6b2c3ce1aaaf53a3920d9760',0,'','1yx483',1,0,'',0,0,0,1,0,'',0),(124,44,21,63,0,'85.221.240.2',1650357167,0,1,1,1,1,'','Re: Foldery do udostępnienia - struktura','<t>Hej<br/>\nCo do propozycji Franka - jest to jedna z opcji, choć nie widzi mi się w 100%.<br/>\n<br/>\n-Wydzieliłbym jako \'Master\' kategorie główne : MIL i REC. (tak będzie to udostępniane odpowiednio partnerom)<br/>\n-Nie wiązałbym Akcesoriów z poszczególnymi modelami, tylko jako całościową grupę. Wydzieliłbym również spójnie z cennikiem ładowarki, baterie, oświetlenie, itd. (możliwe że przepierając teraz karty produktowe MIL ustalimy lepiej nadążający za naszym rozwojem podział na kategorie produktowe)<br/>\n<br/>\n-Brandbook, logotypy, czcionki to tak na prawdę jedna paczka/ jeden folder. Można dodać też szablony prezentacji. Dodaje folder \'Wytyczne wystawiania się\' - również przygotujemy na bazie zdjęć i wrzucimy. Również, powinno być to podzielone na REC i MIL.<br/>\n<br/>\n<br/>\nNie jestem pewien że Albin może tu dużo pomóc - ew.  kwestie techniczne. Możemy całość doprać pon-śr jak będę na miejscu w Krośnie (?)</t>','36055abf00526f986cc3ff2d0de42369',0,'','adhhw4d7',1,0,'',0,0,0,1,0,'',0),(125,45,21,63,0,'85.221.240.2',1650357298,0,1,1,1,1,'','Wytyczne wystawiania się na targach - przewodnik, poradnik','<t>Materiał powinien wskazywać w jaki sposób chcemy by nasz sprzęt byl wystawiany - co jest dopuszczalne (przykłady stoisk), co jest niedopuszczalne.<br/>\nDo tego, zalecane ilości ulotek/ katalogów na np. dzień targów, oraz wskazówki praktyczne - jak ściereczka z microfibry do wycierania paluchów ze skuterów, oraz smar do silnika, by silniki nawet używanych maszyn bardzo płynnie chodziły na sucho.</t>','11ecc75f380d7d1b54ea2e1a13a009e9',0,'','16kq',1,0,'',0,0,0,1,0,'',0),(126,7,41,63,0,'85.221.240.2',1650357603,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<r>&lt;3 (to o stojaku <E>;)</E> )<br/>\n<br/>\nPytanie. Czy chcemy dodawać Franka do forum? Może to usprawni komunikację (a on powinien dać radę z nakładką tłumaczącą na chrome\'a)</r>','f123b8ffc0f7e08d2e427a04e7a63632',0,'','23ikq',1,0,'',0,0,0,1,0,'',0),(127,7,41,58,0,'94.232.216.242',1650357924,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"126\" time=\"1650357603\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=126 time=1650357603 user_id=63]</s>\n&lt;3 (to o stojaku <E>;)</E> )<br/>\n<br/>\nPytanie. Czy chcemy dodawać Franka do forum? Może to usprawni komunikację (a on powinien dać radę z nakładką tłumaczącą na chrome\'a)\n<e>[/quote]</e></QUOTE>\n\nFrank ma dostęp, ale tylko do działu Targie Eventy, oczywiście jak chcemy, możemy mu udzielić dostępu takiego jak @Marketing.</r>','f4583321e961fe8dbd88fb66889d7f65',0,'','1d92zhv',1,0,'',0,0,0,1,0,'',0),(128,46,52,58,0,'94.232.216.242',1650358117,0,1,1,1,1,'','Stojak do DPC','<t>Temat poświęcony: Stojak do DPC</t>','3c6a057e41c489024f8910cdf966486d',0,'','1ekxqot',1,0,'',0,0,0,1,0,'',0),(129,31,46,61,0,'94.232.216.242',1650359288,0,1,1,1,1,'','Re: Obciążenie elektroniczne','<t>Czy wydrukować w kolorze do wysyłek?<br/>\nCzy zostaje tylko wersja do ściągnięcia?</t>','2fa8b58d2afd76a48332e9af740702d5',0,'','26',1,0,'',0,0,0,1,0,'',0),(130,44,21,61,0,'94.232.216.242',1650359770,0,1,1,1,1,'','Re: Foldery do udostępnienia - struktura','<t>Owszem, może i musi nawet.<br/>\nMy się dopasujemy do ogólnej struktury nazewnictwa, by katalogi i pliki się nie powtarzały.<br/>\nWtedy znikają przy wgrywaniu!</t>','0b485f6603f05f82d6c00f460386c8b4',0,'','2srnx',1,0,'',0,0,0,1,0,'',0),(131,44,21,61,0,'94.232.216.242',1650362104,0,1,1,1,1,'','Re: Foldery do udostępnienia - struktura','<t>Owszem, może i musi nawet.<br/>\nMy się dopasujemy do ogólnej struktury nazewnictwa, by katalogi i pliki się nie powtarzały.<br/>\nInaczej znikają przy wgrywaniu!</t>','b04d52afd563920c52a1c0639acbf4cc',0,'','5oltwyi',1,0,'',0,0,0,1,0,'',0),(132,47,28,61,0,'94.232.216.242',1650368085,0,1,1,1,1,'','Opakowanie skutera','<t>Pasowałoby mieć do filmu...<br/>\nPlanowana data odbioru próbek opakowania najwcześniej miedzy 11.05 a 30.05.2022.</t>','b252812bba32adbafa3d0b0eb7a2448f',0,'','u3e2x55',1,0,'',0,0,0,1,0,'',0),(133,48,25,63,0,'85.221.240.2',1650369530,0,1,1,1,1,'','25-26.06.2022 [REC] Handover event Cavebase','<t>Hej<br/>\n<br/>\nProponowany termin eventu przekazania sprzętu/ szkolenia produktowego dla Cavebase to 25-26.06. Tylko ta data pasuje wszystkim członkom.<br/>\n<br/>\nWstępnie zabookowałem go w swoim kalendarzu, Frank- masz chęci również się zaangażować? Jak z terminem?</t>','09b6b786f187c0eadc2384ff95792dfb',0,'','gvti',1,0,'',0,0,0,1,0,'',0),(134,31,46,63,0,'85.221.240.2',1650369636,0,1,1,1,1,'','Re: Obciążenie elektroniczne','<r>Sugeruję wysyłanie wyłącznie z opakowaniu fabrycznym (tak jak kupujemy), manuale serwisowe - dostępne online, bądź do samodzielnego wydrukowania.<br/>\nJesteśmy ekologiczni i oszczędzamy na papierze... <E>;)</E></r>','3b78fd4945e7a1302cad526036528cca',0,'','3iduzi7q',1,0,'',0,0,0,1,0,'',0),(135,44,21,63,0,'85.221.240.2',1650369694,0,1,1,1,1,'','Re: Foldery do udostępnienia - struktura','<t>Czekam w takim razie na decyzje --&gt; jak będzie zatwierdzona struktura, uporządkuję w niej zdjęcia produktowe.</t>','4615cf4c7efd5bc9b8b5a55a8b800736',0,'','1e2mdna',1,0,'',0,0,0,1,0,'',0),(136,24,28,63,0,'85.221.240.2',1650370101,0,1,1,1,1,'','Re: Zdjęcia i materiały','<r>Potrzebuję informacji o możliwej dacie wysyłki maszyn.<br/>\n<br/>\na) Cavebase:\n<QUOTE><s>[quote]</s>I received a globkurier-Message a couple of hours ago. I am wondering what will come next <EMOJI seq=\"1f609\" tseq=\"1f609\">&#128521;</EMOJI> Lights? New DPV? SpeedSensor? Looks like an Easter-Present <EMOJI seq=\"1f603\" tseq=\"1f603\">&#128515;</EMOJI><br/>\n<br/>\nI already discussed with our team. You can send the new DPV to me:<br/>\n<br/>\n <br/>\n<br/>\nSteffen Burger<br/>\n<br/>\nBirkengraben 37<br/>\n<br/>\n96052 Bamberg<br/>\n<br/>\n <br/>\n<br/>\nBut I need it until next week, as I would like to take it to our guys in the north on 22.4. Afterwards I will visit our team in the south.<br/>\n<br/>\nI am looking forward to present nice pictures from Hemmoor and german caves!<br/>\n<br/>\nCan you tell me about your plans how long we can use it? Maybe till handover-meeting?<br/>\n<br/>\n <br/>\n<br/>\nWhat about 25. – 26.6., would it fit for a handover-meeting?<br/>\n<br/>\nThat‘s the date which would fit best for us.<br/>\n\n <e>[/quote]</e></QUOTE>\n\nb) Andrea:<br/>\n\n<QUOTE><s>[quote]</s>Hi Witold, <br/>\n<br/>\nThank you for bringing up these talking points.  <br/>\nI’m familiar with planning (and executing) different kind of video and photo shoots. As you well know this is exactly what we do here at DigitalMovie. We regularly produce digital media to explain products features and convey them into product presentations through video and still photography. We operate comfortably underwater but we also work on terrestrial productions either outdoors as well as in our studio facility. <br/>\n<br/>\nBeing this project currently in the form of ideas, I ask you a few questions below in order to figure out what options we may have and what works best.<br/>\nI think it would be great exchanging products (by Seacraft) and services (by digital movie) with mutual benefit and reciprocal discount agreements.<br/>\nUpdating my unit is a tempting idea, if this can maximise our mutual support, I’ll be happy to do it. <br/>\n<br/>\nOne of the easiest way to move forward with the idea of producing some media about the new product, is sending a unit here at my studio. We can start creating some still life images first (assuming the unit being flawless not beta or battle tested) and taking it underwater for in-action contents right after (unless you have a second unit dedicated to  action/test (this one may have a few signs of use). <br/>\nOf course we can line up production style to your indications/requirements like showing recreational divers, different users including women, different water entrance and situations. Now, here there are a few questions for you: would it be ok also showing a teenager user or is there any legal/safety issues about user age?<br/>\nIs the unit also suitable for cave diving or is it better to keep it in open waters only?<br/>\nHow about T-reb users (I might have a friend to ask to...)? Would it be better on different CCRs or it doesn’t matter?<br/>\nThis kind of production is what we call a \'media package’. The main goal of a media package is to create a variety of media contents for mixed usage (from catalogs and borchures to social media and web).  Essentially it’s a digital media collection, including both stills and videos, delivered in different formats (like 16:9 / 4:5 / 9:16) to be used for product launch, digital presentations, on line and off line product promotion.<br/>\nIf the project timeline is not too compressed, this approach is particularly cost-effective since I am free to seek for good opportunities to shoot maximising production efficiency. When would you ideally need some media to be ready? <br/>\n<br/>\nAs a different option, (not sure if you meant this in your email) we can design, plan and execute a product video from start to finish going for a shoot on a specific location. This is ideal if you want to be part of it in person, attending the shoot and supervising operations on set for the whole production. Please feel free to share your ideas if you have already defined something specific, I am willing to line up and see if we can find a good match with your plan.<br/>\n<br/>\nPlease let me know how about and we’ll set things up at best. <br/>\nAs we move forward in defining some options, I can start working on initial calculations to quote our services and make an offer. <br/>\nI think the best way to make a happy and durable collaboration is to set an exclusive mutual discount that makes reciprocal advantage working together. <br/>\nI’m sure both of us can get some really good perspectives out of this. <br/>\n<br/>\nLooking forward to hearing from you again, feel free to catch up on a call at any time. <e>[/quote]</e></QUOTE></r>','f63fd2a7ed8173a1f0e0142348de50fd',0,'','txvf4n4',1,0,'',0,0,0,1,0,'',0),(137,24,28,61,0,'185.153.39.80',1650389280,0,1,1,1,1,'','Re: Zdjęcia i materiały','<t>Mam nadzieję, że uda się złożyć 2 egzemplarze do przetestowania w niedzielę.<br/>\n<br/>\nPo przetestowaniu można wysyłać.<br/>\nBędą dwa na razie, ponieważ tyle grawerów zrobili. Chyba dzisiaj wysłali do Krosna. Trzecia sztuka będzie montowana jak przyjdzie wygrawerowany trzeci komplet. Nie wiem kiedy, mam nadzieję, że szybko.<br/>\n<br/>\nZatem data 22.04 jest nierealna, ale o tym już pisałam.<br/>\nMuszą podać inny termin o ile jest to możliwe.</t>','1c0f73811bdfc879d8d3290124a584e1',0,'','2fg08x',1,0,'',0,0,0,1,0,'',0),(138,49,11,58,0,'94.232.216.242',1650432246,0,1,1,1,1,'','Wizytówka firmowa w Google','<r>Naszą wizytówkę w Google trzeba będzie zaktualizować, z pilnych zmienić zdjęcie w tle, bo nie jest ustawione domyśle i skrypt wybiera ostatnio dodane (w tym wypadku zdjęcie z opinii/komentarza).<br/>\n\n<ATTACHMENT filename=\"obraz_2022-04-20_071948541.png\" index=\"0\"><s>[attachment=0]</s>obraz_2022-04-20_071948541.png<e>[/attachment]</e></ATTACHMENT>\n\nKto ma dostęp do administracji nadany?</r>','656507538971ae83f66e58bd6033f7c1',1,'','mv3',1,0,'',0,0,0,1,0,'',0),(139,49,11,61,0,'185.153.39.80',1650433854,0,1,1,1,1,'','Re: Wizytówka firmowa w Google','<t>Andrzej się tym zawsze zajmował.</t>','2787a40b8eee79afaf3349635f20aad0',0,'','j2iug',1,0,'',0,0,0,1,0,'',0),(140,49,11,58,0,'94.232.216.242',1650433969,0,1,1,1,1,'','Re: Wizytówka firmowa w Google','<t>Ok, napiszę do niego.</t>','28f95adcb8c286670e20f87812e6d753',0,'','61',1,0,'',0,0,0,1,0,'',0),(141,24,28,58,0,'94.232.216.242',1650434220,0,1,1,1,1,'','Re: Zdjęcia i materiały','<r><QUOTE author=\"Beata So&#x142;tys\" post_id=\"137\" time=\"1650389280\" user_id=\"61\"><s>[quote=\"Beata Sołtys\" post_id=137 time=1650389280 user_id=61]</s>\n<br/>\nBędą dwa na razie, ponieważ tyle grawerów zrobili. Chyba dzisiaj wysłali do Krosna. Trzecia sztuka będzie montowana jak przyjdzie wygrawerowany trzeci komplet. Nie wiem kiedy, mam nadzieję, że szybko.<br/>\n\n<e>[/quote]</e></QUOTE>\n\nWczoraj wysłali dziś powinno być u nas. 3 komplet mają grawerować jak nie będziemy mieć zastrzeżeń co do tych dwóch.<br/>\n\n<QUOTE><s>[quote]</s>Dzień dobry,<br/>\n<br/>\ndobrze, dzisiaj nadamy, jutro, max do czwartku powinny być u Panstwa.<br/>\nMamy wyznakowane dwa, nie chcieliśmy marnować więcej sztuk gdyby były uwagi do jakości graweru (mielibysmy material do poznakowania nowymi parametrami).<e>[/quote]</e></QUOTE></r>','218b7fa64b97709b0b046c3892b5fdcc',0,'','lr03ma9',1,0,'',0,0,0,1,0,'',0),(142,42,21,60,0,'91.196.8.186',1650436115,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<r>Zamówienie puszczone do druku. <E>:)</E></r>','b4fbbe998213266ed8b5129ae62bc963',0,'','9lozf',1,0,'',0,0,0,1,0,'',0),(143,50,39,61,0,'185.153.39.80',1650450852,0,1,1,1,1,'','stojak wystawowy','<t>Koszt produkcji stojaka bez narzutu:<br/>\nStojak na 3 skutery: 2 374,62 zł <br/>\n<br/>\njego cena po uwzględnieniu zniżki 25% dla sprzedwców wynosi obecnie: <br/>\n € 495  = 2277 zł<br/>\nNie może już być niższa, ale jednak nie dokładamy do tematu (dlatego, że wycofaliśmy ściankę z pleksy projektu Karwowskiego)<br/>\nProponuję jednak wprowadzić nową pozycję stojaka do cennika z opisem, że jest na 3 modele naszych skuterów - może  przy okazji jak wprowadzimy skuter GO do cennika, wtedy planowane są też grubsze zmiany.<br/>\n<br/>\n<br/>\nw cenniku jest obecnie stary stojak, który jest wycofany, nie był składany i ciężki w transporcie.<br/>\nU1086	Exhibition stand for FUTURE and GHOST scooters (for 3 scooters)	 € 660 <br/>\ndo Australii poszedł już nowy - zamówiony jako U1086</t>','677bef3b11803adc925b2a71f716d2a0',0,'','skm',1,0,'',0,0,0,1,0,'',0),(144,51,16,58,0,'94.232.216.242',1650519372,0,1,1,1,1,'','Seacraft Newsletter 05.2022','<t>Temat poświęcony propozycjom tematów do kolejnego newslettera:<br/>\n<br/>\nPlanowana wysyłka: 10-15.05.2022<br/>\n<br/>\n___<br/>\n<br/>\nTematy: <br/>\n1. Nurkowe Demo Days, Jaworzno, 14-15.05, mamy tam naszego partnera Deep Adventure, warto o tym poinformować.<br/>\n2. Personalizowany grawer na DPV</t>','0cdaabcaeef8926b22cb032152fbd7ab',0,'','iymh',1,0,'',0,0,0,1,0,'',0),(145,51,16,60,0,'91.196.8.186',1650525035,0,1,1,1,1,'','Re: Seacraft Newsletter 05.2022','<t>Trochę poza tematem: może wrzucę informację na IG/plakat związany z Demo days na koparkach?</t>','5d3f0e943de02b0ae445de64b9391d67',0,'','dg6h',1,0,'',0,0,0,1,0,'',0),(146,51,16,58,0,'94.232.216.242',1650526574,0,1,1,1,1,'','Re: Seacraft Newsletter 05.2022','<t>Myslę, że jak najbardziej tak, ale to bliżej terminu 4 maj może? Przygotuję jakąś grafikę, żeby to ładnie i zgodnie z naszymi kolorami współgrało.</t>','ddd6905e7fb5757785f6199e8d2be127',0,'','34oeb',1,0,'',0,0,0,1,0,'',0),(147,52,9,60,0,'91.196.8.186',1650536676,0,1,1,1,1,'','Produkty Special','<t>Hej, temat będzie dotyczyć wrzucenia produktów z linii Special na stronę internetową.</t>','87aadf32d0f56e4afd6f92d55001c04d',0,'','33h',1,0,'',0,0,0,1,0,'',0),(148,33,40,60,0,'91.196.8.186',1650545618,0,1,1,1,1,'','Re: Cennik - 12.04.2022','<t>Hej, przy okazji następnych zmian usuńcie kody: KM157M, KM167M. <br/>\nTo koszulki fullprint militarne, dla których przyporządkowane zostały po 1 kodzie więcej. Tak jakby dla rozmiaru XXXXL, którego nie było w tym modelu.</t>','21d02597a9dd969db73b776ad1493dd1',0,'','4q4x893b',1,0,'',0,0,0,1,0,'',0),(149,50,39,61,0,'185.153.39.80',1650612288,0,1,1,1,1,'','Re: stojak wystawowy','<t>stojak okrągły:<br/>\n<br/>\ninfo od Izy na temat kosztów:<br/>\n...............<br/>\nCena stojaka z okrągłą podstawą – 1882,13 zł netto + malowanie proszkowe na czarno (nie wiem w tej chwili ile może to kosztować, bo jeszcze nigdy tego nie zlecałam, a nie mam gotowych stojaków jeszcze, żeby zawieźć i prosić o wycenę).</t>','0aa962f0f0ac2412ad1a8f9115eec25d',0,'','sv79mv',1,0,'',0,0,0,1,0,'',0),(150,53,39,61,0,'185.153.39.80',1650621742,0,1,1,1,1,'','Zmiany w kolejnej wersji cennika rec','<r>info od Pauliny - przeniosłam do działu REC:<br/>\n\n<QUOTE><s>[quote]</s>Hej, przy okazji następnych zmian usuńcie kody: KM157M, KM167M.<br/>\nTo koszulki fullprint militarne, dla których przyporządkowane zostały po 1 kodzie więcej. Tak jakby dla rozmiaru XXXXL, którego nie było w tym model<e>[/quote]</e></QUOTE>\n\ni moje<br/>\nCennik należy skategoryzować tak jak militarny, ujednolicenie cennika pozwoli na taką samą strukturę folderów do udostępniania na zewnątrz plików (mil i rec).</r>','c4c084105ec596e8f884eaeb179cbd50',0,'','1qw97cs',1,0,'',0,0,0,1,0,'',0),(151,54,40,61,0,'185.153.39.80',1650622058,0,1,1,1,1,'','Niezbędne zmiany w cenniku special','<r>Naniosłam zmiany w cenniku  kategoriach - niezbędne zarówno do kart militarnych jak i ogólnie do uporządkowania struktury.<br/>\n<br/>\nZmiany w arkuszu kart militarnych \"cennik\" - plik v2<br/>\nWitek musi przejrzeć i zatwierdzić.<SIZE size=\"150\"><s>[size=150]</s><e>[/size]</e></SIZE></r>','316b0a5da3f37e0c277783bebf3a3fd0',0,'','48ina9',1,0,'',0,0,0,1,0,'',0),(152,55,49,61,0,'185.153.39.80',1650622255,0,1,1,1,1,'','serwis suex','<r>Info od Bramsona<br/>\n\n<QUOTE><s>[quote]</s>Katalogu nie mam, ale mam kilka najświeższych info prosto z siedziby Suex <E>;)</E> A dotyczą serwisu i gwarancji.<br/>\n<br/>\nSerwis - mają 3 poziomy serwisu: 1 poziom dostępny praktycznie dla każdego użytkownika i dotyczy przeglądu, smarowania i wymiany głównych o-ring, 2 poziom jest troszkę bardziej zaawansowany, a 3 poziom to rozbieranie całego skutera na części (włącznie z silnikiem) i po tym serwisie gwarancja zostaje przedłużona na kolejny rok. <br/>\n<br/>\nW zeszłym tygodniu na szkoleniu do 3 poziomu były dwie osoby z Polski.\n<e>[/quote]</e></QUOTE></r>','64fb74ea10b62dfcbfa95c975003e9b0',0,'','kf7',1,0,'',0,0,0,1,0,'',0),(153,27,23,61,0,'185.153.39.80',1650622763,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>info od Witka:<br/>\n\n<QUOTE><s>[quote]</s>1. NL<br/>\n<br/>\nBył Flamur (z Sieniawy <E>;)</E>). Bardzo się ucieszył z wyjścia na ogrzewanie, nie widział go w akcji jak był u nas z wizytą. Przetarg na pojedyncze skutery ma być rozpisany na koniec tego roku, z prawdopodobmi testami w wodzie (parametry, specyfikacje, a nawet chcą mierzyć porównawczo akustykę w wodzie). Mam mu wysłać naszą metodologię badań.<br/>\n<br/>\nZ nowinek, SUM wzbudził zainteresowanie, ENC3M również, ale widać że ma już wybrany i zakupiony system nawigacji - nie planuje zmieniać. Zwalniacz mocno zaciekawił, mam podesłać manual po ENG. (mam polski, przetłumaczymy...).<br/>\n<br/>\nDostał wina, prosił żeby pozdrowić i miło wspominał wizytę szczególnie na Buczynach <E>;)</E><br/>\n<br/>\nNurkowie policyjni będą chcieli podłączyć się pod testy w wodzie robione na przetarg. Pogadaliśmy, o różnych maszynach, dostali koszulki, klucze, a nawet miałem woreczki seacrafta coby nie zapomnieli marki...<br/>\n<br/>\nBył nawet gość który się żalił że holenderske organizacje ekologiczne nie pozwalaą na wyszkolenie fok do poszukiwania zwłok pod wodą. (używają do tego psów - wyczuwają nad wodą \'aromat\'...), ale foki byłby jeszcze skuteczniejsze... <E>;)</E><br/>\n<br/>\nTyle z ważniejszych, poza tym pani z działu przetargów i pan z działu logistyki...<br/>\n<br/>\nPoza tym, do przetargu na pewno będzie klauzula o udowodnienie dużej dostawy (Ruben mówił o dostawie na 500 k EUR) i możliwość kontaktu z takim klientem o referencje. Ma dać znać dokładnie o jaką kwotę ma chodzić...<br/>\n<br/>\n2. SIEL<br/>\n<br/>\nSiel działa od lat 60 - na początku robili tylko reby dla marynarki, w tej chwili mają znacznie szersze spektrum działalności. Trochę do nich z dystansem podszedłem (w końcu działają z Suexem), ale okazuje sie że cały system nawigacji, komunikacji pod wodą, komunikacji z baterią i elektonikę robią dla Suexa oni - od S jest tylko rura i silnik jask się Peter Boules wyraził... Niezły gość. Swoją drogą, podobno aktualna bojka GPS Suexa komunikuje się bezprzewodowo z nawigacją - i może być puszczana na sznurku. Oj, rozwiązałoby to trochę tematów... (linka 1mm dyneema i kołowrotek).<br/>\n<br/>\nGeneralnie są otwarci, chyba mają troszę przesyt współpracą z Suexem. O Clemenzie wyrażał się jako \'debil\'. Pooglądałem ich nowe filmy promocyjne- bardzo wysoki poziom, mówił że kupe kasy na to poszło... Również sterowanie autonomiczne łodziami motorowymi (partolowymi) jakie robili dla izraela (z systemem unikania przeszkód i tolerancją na rozkołys, fale, wiatr...)<br/>\n<br/>\nPożyjemy zobaczymy, bardzo chwalili nasz rozwój do tej pory. (choć byli w dwójkę- Peter, dyrektor rynkó eksportowych i drugi włoch - emerytowany nurek Comsubinu). Wkurzali się że im Malezję wygraliśmy (też się szykowali).<br/>\n<br/>\nInne ciekawostki:<br/>\n<br/>\n-Dostawa dla Chińczyków faktycznie się odbyła (rebów). Dostarczyli też skutery Suexa, ale pod nazwą SIEL - Suex się bał<br/>\n<br/>\n-Byli 2 tygodnie temu u naszych czechów z rebami- też się wkurzał że nawet nie było sensu wypowiadać słowa \'Skutery\' bo byli już zdecydowani na Seacrafty<br/>\n<br/>\n-Specjalizują się w łączności podwodnej i komunikacji podwodnej. Mają patenty jakie są wykorzystywane w rozwązaniach dla Suexa. Nawigacja jest ich robty, tylko brandują dla S. Widziałem nowiutki (widać może na foto) ręczny log do wpinania \'konsolki\' i nawigowania przez pływającego z płetwy nurka<br/>\n<br/>\n-Wstępnie pogadaliśmy o ew. współpracy na rynku cywilnym, w Egipcie. Ma tam bardzo dobrych ludzi i dostali po znajomości wyłączenie z bana na permit importy skuterów do kraju. Raczej wątpię że chcą wysondować tematy dla Suexa, raczej wysondować czy nie warto zmienić partnera skuterowego.... Suexa by to utopiło drastycznie.<br/>\n<br/>\n-80% dostaw skuterów załatwił Suexowi Peter. Suex sam dotarł tylko d kilku krajów (głównie północna europa). Cały bliski wschód, azja itd. nagrywał Siel.<br/>\n<br/>\n3. Inne<br/>\n<br/>\nPoza tym był vice dyrektor z Waterproofa, rozwijające dywizję militarną. (skafanry MIL). Można połączyć siły filmowo/ zdjęciowo - mają ładne skafandry, mam też namiary na warte odwiedzenia targi wojskowe.<br/>\n<br/>\nMówi że w Rotinorze nastąpiły roszady pracowników i z 2 dobrych gości jest 1 kiepski. (dział eksportowy). Podobno pare lat temu jeździli wszędzie (ci dobrzy) jak wściekli i generalnie byli wszędzie gdzie tylko się dało<e>[/quote]</e></QUOTE>\n\nMoże warto gdzieś takie informacje zbierać tematycznie, bo w tym miejscu raczej nikt ich nie znajdzie jak będzie szukać  <E>:)</E></r>','608889624928d29d1c99e6a52116413e',0,'','1u01d5',1,0,'',0,0,0,1,0,'',0),(154,26,44,61,0,'185.153.39.80',1650623800,0,1,1,1,1,'','Re: Kartownik','<r>od Izy<br/>\n\n<QUOTE><s>[quote]</s>Piotrek mówi, że muszą go jeszcze poskładać to tak na połowę przyszłego tygodnia ma być gotowy  <E>:D</E> <br/>\n\n <e>[/quote]</e></QUOTE></r>','4f550cf4999b1372453c0c1955e17787',0,'','1ag76q',1,0,'',0,0,0,1,0,'',0),(155,56,29,61,0,'185.153.39.80',1650624080,0,1,1,1,1,'','Cena','<r>Gdzieś w otchłani utonęła mi  informacja o cenie zakupu.<br/>\nKtoś wie?  <E>;)</E></r>','e1b71c68b724b2c4dfcf90e3a6a8acdd',0,'','5m04pl4b',1,0,'',0,0,0,1,0,'',0),(156,49,11,58,0,'94.232.216.242',1650625261,0,1,1,1,1,'','Re: Wizytówka firmowa w Google','<r>Zdjęcie firmy w tle już poprawione i ustawione jako domyślne.<br/>\n\n<ATTACHMENT filename=\"obraz_2022-04-22_125850771.png\" index=\"0\"><s>[attachment=0]</s>obraz_2022-04-22_125850771.png<e>[/attachment]</e></ATTACHMENT>\n\nW wolnej chwili przeglądnę, co tam można jeszcze aktualizować i wzbogacić, dość pusta ta wizytówka.</r>','7048dfb16994375e659b1f539e835516',1,'','aok0y3',1,0,'',0,0,0,1,0,'',0),(157,56,29,58,0,'94.232.216.242',1650625557,0,1,1,1,1,'','Re: Cena','<r>Ten zasobnik jest chyba od tego producenta: <URL url=\"https://military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3\"><LINK_TEXT text=\"https://military-suits.com/offer/tactic ... pment-zas3\">https://military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3</LINK_TEXT></URL><br/>\n<br/>\nMogę napisać o cennik, chyba, że mamy jakieś specjalne ceny u nich.</r>','3934c2d801ca110e4e82883d3df330bc',0,'','1lure',1,0,'',0,0,0,1,0,'',0),(158,29,26,58,0,'94.232.216.242',1650626105,0,1,1,1,1,'','Re: Nurkowe Demo Days Jaworzno, Koparki 14-15.05.22','<r>Na swoim profilu FB, organizatory eventu publikują informację o markach i wystawcach. Post taki jest tam darmowy, możemy przygotować własny opis i grafikę, aby pomóc Marcinowi.<br/>\n<br/>\nOdpowiedź od Marcina:\n<QUOTE><s>[quote]</s> Posty są w ramach \"wstawiania się\", czyli nie są dodatkowo płatne. Będzie też o Seacraft, ale wszystko w swojej kolejności. Jak chcecie pomóc to proszę przygotujcie materiały i tekst na taki post. <e>[/quote]</e></QUOTE></r>','59308d9a605affaa4d1ccee5344b8fc2',0,'','11862d',1,0,'',0,0,0,1,0,'',0),(159,5,23,60,0,'91.196.8.186',1650626526,0,1,1,1,1,'','Re: 7-9.06.2022 [MIL] UDT Rotterdam, Holandia','<r>Rozmawiałam z Frankiem o materiałach tekstylnych na promocję. Chce zabrać ze sobą czapki zimowe z polarem i bez polaru, czapki z daszkiem i koszulki militarne. Pewnie bawełniane, bo fullprintów jest mało, rozmiarówka nie jest na ten moment uzupełniona, a poza tym po podwyżce cen rozdawanie ich to BARDZO zły pomysł <E>:oops:</E> <br/>\nWstępnie poprosiłam Igę o odłożenie dla Franka: <br/>\n- 10 szt czapek zimowych z polarem<br/>\n- 10 szt czapek zimowych bez polaru<br/>\n- 10 szt czapek z daszkiem<br/>\n- po 2-3 szt. (5 w rozmiarze L, XL) t-shirtów bawełnianych MIL.<br/>\n<br/>\nDajcie znać jeśli te ilości powinny być większe/mniejsze, to przekażę Idze.</r>','df38ab9298f4f444c8d6915c96949713',0,'','s183t',1,0,'',0,0,0,1,0,'',0),(160,56,29,61,0,'185.153.39.80',1650631349,0,1,1,1,1,'','Re: Cena','<t>Zapytam Piotra,<br/>\non z nimi ustalał, ale jest duże prawdopodobieństwo, że też wpadło w otchłań tematów...<br/>\nna pewno kontakt przez niego, sami tego nie będziemy załatwiać.</t>','33b5c0b244b9b6613b1917b6c31c183f',0,'','c39d1ers',1,0,'',0,0,0,1,0,'',0),(161,56,29,61,0,'185.153.39.80',1650632649,0,1,1,1,1,'','Re: Cena','<r>Do Pakistanu (MIL) kiedyś wycenialiśmy tak: cena była na pewno podwyższona o 20% upust dla dystrybutora.<br/>\n<br/>\nModel: Dry-bag for sniper rifle - model: \"UNRUG\" – Reference number : M-DB/SR/01.	 € 1 450,00 	<br/>\n<URL url=\"https://www.military-suits.com/offer/tactical-dry-bags/56-dry-bag-for-sniper-rifle\"><LINK_TEXT text=\"https://www.military-suits.com/offer/ta ... iper-rifle\">https://www.military-suits.com/offer/tactical-dry-bags/56-dry-bag-for-sniper-rifle</LINK_TEXT></URL><br/>\nModel: Dry-bag for military equipment \"UNRUG\" – Reference number : M-DB/01 w wersji 40 l 	 € 790,00 	<br/>\n<URL url=\"https://www.military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3\"><LINK_TEXT text=\"https://www.military-suits.com/offer/ta ... pment-zas3\">https://www.military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3</LINK_TEXT></URL><br/>\nModel: Dry-bag for military equipment \"UNRUG\" – Reference number : M-DB/01 w wersji 60 l.	 € 890,00 	<br/>\n<URL url=\"https://www.military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3\"><LINK_TEXT text=\"https://www.military-suits.com/offer/ta ... pment-zas3\">https://www.military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3</LINK_TEXT></URL></r>','a2dfdb50018240815616b407702403f4',0,'','in5w',1,0,'',0,0,0,1,0,'',0),(162,6,20,60,0,'91.196.8.186',1650868829,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Kontaktowałam się z Adamem. Dobra wiadomość jest taka, że <B><s>[b]</s>Adam załatwił możliwość nagrań w Pyrzowicach<e>[/b]</e></B>.<br/>\nPytania od Adama: <br/>\n- w jakich miejscach będziemy kręcić? <br/>\n- jaka jest grupa docelowa dla produktu? Adam pyta konkretnie \"mężczyźni, kobiety, w jakim wieku, single czy rodziny z dziećmi,  zwariowane pary, potrzebuje cechy odbiorcy, który według Was najchętniej to kupi\"<br/>\n- cechy produktu w punktach - informacje podstawowe o produkcie ( waga, długość szerokość, osiągi, jakieś dane konstrukcyjne, które chcecie  podkreślić)<br/>\n- wyjątkowe cechy produktu, które czynią go nadzwyczajnym. W punktach opisowo<br/>\n- prośba o przesłanie zdjęć produktu<br/>\n- co z naszego punktu widzenia jest ważne aby to podkreślić?<br/>\n- gdzie film będzie pokazywany? (jego przeznaczenie i użyteczność)<br/>\n<br/>\nBędę przygotowywać odpowiedzi w oparciu o wnioski itp., ale dajcie też znać co sądzicie.</r>','7b361e88a936599130d470c7f5ccb434',0,'','2zh4f0',1,0,'',0,0,0,1,0,'',0),(163,6,20,60,0,'91.196.8.186',1650868908,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<t>I druga kwestia, żeby długość poprzedniego postu Was nie zraziła. <br/>\nPropozycje Adama: <br/>\nMoje pomysły i propozycje:<br/>\n<br/>\n1.	Film bezpośredni o produkcie gdzie bohater to produkty, sucha narracja wsparta lektorem i infografikami, ewentualnie tekst na dole. ( Rola takiego filmu jest czysto informacyjna, dla klientów, którzy podjęli decyzje o zakupie produktu w tym segmencie teraz tylko muszą wybrać najlepszą ofertę)<br/>\n2.	Film o dobrych emocjach, do których kluczem jest Nowy Seacraft. ( Film dla osób szukających, być może nowych klientów, którzy szukają szczęścia i radości, a w ich znalezieniu pomoże im piękna kobieta, super auto czy najlepszy skuter na świecie. To nie jest film stricte o produkcie a raczej o jego niezastąpionej roli  w drodze do szczęścia  .<br/>\n3.	Film prezentacyjny,  w którym bohater wciela się w role testera i ze swojego punktu widzenia przedstawia produkt. ( To film dla cwaniaków, którzy wiedzą że najlepiej uczyć się na błędach innych ludzi, ale nie tylko, gdyż wielu ludzi nie potrafi podjąć decyzji i dokonać wyboru, bo w ich świecie wiąże się to z ogromnym bliżej niesprecyzowanym ryzykiem. Dlatego kupują przypadkowo – co będzie to będzie, najtaniej aby zminimalizować straty, lub nie kupują wcale aby się nie narażać i nie mieć wyrzutów sumienia, że znowu dali się oszukać. Dobre doświadczenie drugiego człowieka, który kupił produkt i  teraz opowiada i pokazuje jak bardzo dobry był to wybór, sprawia że wahania i wątpliwości znikają, a jeśli nawet okaże się że zakup był złą decyzją  to nie sam kupujący  jest za nią odpowiedzialny więc ma czyste sumienie. Tacy ludzie właśnie potrzebują takich filmów.<br/>\n4.	A może macie zupełnie inny pomysł?</t>','76784e3e0cb34d46ae4eebf383b8dcd6',0,'','d42zg0',1,0,'',0,0,0,1,0,'',0),(164,56,29,58,0,'94.232.216.242',1650954392,0,1,1,1,1,'','Re: Cena','<r>Dry Bag Equipment ten 40/60l mamy zarówno opis (jeszcze do sprawdzenia i korekty) + zdjęcia produktowe, zapowiedź w Newsletterze już poszła.<br/>\n<br/>\nBrakuje:<br/>\n<br/>\n- wycena, dodanie do cennika<br/>\n- dodanie na stronę (jak już wróci do naszej pełnej kotroli  <E>:roll:</E> )<br/>\n- karta katalogowa<br/>\n- poinformowanie partnerów <br/>\n<br/>\nDry Bag Equipment dodajemy jako produkt REC/MIL, a co robimy z tym na broń dodajemy w późniejszym czasie jako kolejna nowość w ofercie tylko jako produkt pod MIL ?</r>','b7cfd5fe0902553e0d98c17d49bc209a',0,'','27g',1,0,'',0,0,0,1,0,'',0),(165,6,20,58,0,'94.232.216.242',1650954647,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Świetna wiadomość odnośnie lotniska. <br/>\n<br/>\nCo do scenariusza, to dość odważny pomysł Adama, trochę odbiega od naszego wstępnego pomysłu i pokazania produktu jako dostępnego dla każdego nie tylko dla cwaniaków jak to określił <E>:D</E> ...ale pomysł ma ciekawy z tym ukazaniem z pozycji testera, jeszcze to na spokojnie przemyśle i uzupełnię komentarz.</r>','7dc2229ded669e4001084c5f3999c0d3',0,'','9c4l',1,0,'',0,0,0,1,0,'',0),(166,29,26,58,0,'94.232.216.242',1650956342,0,1,1,1,1,'','Re: Nurkowe Demo Days Jaworzno, Koparki 14-15.05.22','<r>Kopiuję tutaj, żeby był ślad i nie utoneło w mejlach. Możmey sami stworzyć treść i grafikę do postów na stronie Eventu.<br/>\n\n<QUOTE><s>[quote]</s>Ogólnie myślałem tak:<br/>\n<br/>\nosobny post który ukarze się u nas taki czysto informacyjny opisany ze właśnie świetna okazja do testowania naszego sprzętu na evencie w koparkach ,kiedy i gdzie itd.<br/>\n<br/>\nOraz post z perspektywy ich profilu opisujący właśnie naszą markę i produkt.<br/>\n<br/>\nHarmonogram:<br/>\n<br/>\n-Ten tydzień post u nich (my go sami opisze i wzbogacimy grafiką)<br/>\n-Kilka dni przed wydarzeniem post u nas. (zgrane z newsletterem)<br/>\n<br/>\nEwentualnie z dodatkowym sharowaniem z obu stron i podbiciem zasięgów:<br/>\n<br/>\nTen tydzień post u nich (my go sharujemy tez u nas) <br/>\nKilka dni przed wydarzeniem post u nas (oni shareuja nasz post u nich)<br/>\n<br/>\nCo o tym sądzicie?\n<e>[/quote]</e></QUOTE></r>','23b4936665aa57c385de8e787f30c5a0',0,'','2wmxx',1,0,'',0,0,0,1,0,'',0),(167,57,31,60,0,'91.196.8.186',1650958464,0,1,1,1,1,'','Współpraca z Cavebase','<r>Hej, temat współpracy z Cavebase. <br/>\nWiem, że termin przekazania oficjalnego sprzętu się zbliża, a Cavebase powoli zaczyna udostępniać filmiki/zbitki relacji/zdjęć z zapowiedzią tajemniczych nowych sprzętów itp. <br/>\nNiemniej jednak, od rozpoczęcia z nimi rozmów (kilka miesięcy) co rusz (często kilka razy w tygodniu) oznaczają nas na swoich zdjęciach. I super, tylko nas na tych zdjęciach nie ma <E>:)</E><br/>\nW efekcie mamy np. zdjęcie twarzy jednego z członków ekipy, na zdjęciu oznaczonych jest kilkadziesiąt osób, w tym nasz profil. Jest to problem, bo na siatce oznaczeń mamy mnóstwo zdjęć, na których nie ma naszego sprzętu, a na tym nam nie zależy. <br/>\nWraz z rozpoczęciem z nimi oficjalnej współpracy pewnie dobrze byłoby o tym wspomnieć i może wysłać im małe \"wytyczne\", bo oni nas zaleją zdjęciami swoich twarzy z oznaczeniem \"seacraft\".</r>','676ff9c00114428ef14cac09bab20685',0,'','2qu8w',1,0,'',0,0,0,1,0,'',0),(168,57,31,60,0,'91.196.8.186',1650958781,0,1,1,1,1,'','Re: Współpraca z Cavebase','<r>Siatka oznaczeń: <URL url=\"https://www.instagram.com/seacraftdpv/tagged/\">https://www.instagram.com/seacraftdpv/tagged/</URL><br/>\n<br/>\nPrzykłady zdjęć, o których pisałam: <br/>\n<URL url=\"https://www.instagram.com/p/CczkD8oqYmG/\">https://www.instagram.com/p/CczkD8oqYmG/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CbZqjznADk4/\">https://www.instagram.com/p/CbZqjznADk4/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CZzMT8Zqn5j/\">https://www.instagram.com/p/CZzMT8Zqn5j/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CZWYQTOqlTD/\">https://www.instagram.com/p/CZWYQTOqlTD/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CZCgt_oKmhR/\">https://www.instagram.com/p/CZCgt_oKmhR/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CYgcoSsKFGH/\">https://www.instagram.com/p/CYgcoSsKFGH/</URL><br/>\n<br/>\nPewnie uznają taką formę promocji, że należymy do ich \"ekipy\" więc wszędzie nas oznaczają. No ale my mamy potem na profilu zdjęcia portretowe jakiś gości i fotki kolesi przedzierających się przez lasy <E>:)</E></r>','3acd31dc2ba63164dece833a0f9d3207',0,'','1yxbx',1,0,'',0,0,0,1,0,'',0),(169,57,31,58,0,'94.232.216.242',1650959325,0,1,1,1,1,'','Re: Współpraca z Cavebase','<r>W ramach uzupełniania wrzucam screenshot posta, o którym mówi Paulina i jak to wygląda  <E>:oops:</E> <br/>\n\n<ATTACHMENT filename=\"279011389_5058072887574185_2561308068651019394_n.jpg\" index=\"0\"><s>[attachment=0]</s>279011389_5058072887574185_2561308068651019394_n.jpg<e>[/attachment]</e></ATTACHMENT>\n\nPomysł z wytycznymi oznaczania nas jest wg mnie bardzo dobry. Oznaczenia tak, ale nie w takiej formie gdzie na zjęciu nawet nie ma naszego produktu, a cała siatka oznaczeń.<br/>\n<br/>\nPS. Co do siatki oznaczeń na naszym profilu, to (o ile się nie mylę) można wejść w dane zdjęcie gdzie nas otagowali -&gt; opcje oznaczeń -&gt; usuń mnie z oznaczenia, w ten sposób możemy decydować czy chcemy być oznaczeni na zdjęciach, które później widnieją w naszej siatce. Trzeba by to sprawdzić, czy działa <E>:)</E></r>','33415ec2c3c4bd12181c292063677101',1,'','i321',1,0,'',0,0,0,1,0,'',0),(170,57,31,60,0,'91.196.8.186',1650959824,0,1,1,1,1,'','Re: Współpraca z Cavebase','<r>Działa, działa. Usuwam, niemniej i tak wydaje mi się, że trzeba dać im znać, żeby oznaczali nas tam gdzie sprzęt <E>:D</E></r>','3a9a1707bf2585c1fd8ddaacbde9d1f8',0,'','csnt8yjt',1,0,'',0,0,0,1,0,'',0),(171,56,29,61,0,'94.232.216.242',1650959863,0,1,1,1,1,'','Re: Cena','<r>Mają różne:<br/>\n<URL url=\"https://military-suits.com/offer/tactical-dry-bags\">https://military-suits.com/offer/tactical-dry-bags</URL><br/>\n<br/>\nRaczej kupimy wszystkie po sztuce i porobimy zdjęcia.<br/>\nNa targi pasuje mieć wszystkie.</r>','75f121a2af9386d381e32e1f4bbed351',0,'','69ah0a',1,0,'',0,0,0,1,0,'',0),(172,58,21,58,0,'94.232.216.242',1650960294,0,1,1,1,1,'','Projekty video o Jaskiniach Słowacja, Chorwacja, Hiszpania - propozycja wsparcia','<r>Martin Strimka videographer/photographer/editor publikujący swoje artykuły i materiały w magayznie Tauchen pracuje nad kilkoma ciekawymi projektami: dokument o jaskiniach na Słowacji, niedługo potem duży projekt w Chorwacji (źródło Cetina), a następnie kolejny projekt w Fuentona de Muriel.<br/>\n<br/>\n<URL url=\"https://www.youtube.com/watch?v=up_MCv29Smc\"><s>[url]</s>https://www.youtube.com/watch?v=up_MCv29Smc<e>[/url]</e></URL><br/>\n<br/>\n<URL url=\"https://www.youtube.com/watch?v=HKlfxRXy8co\"><s>[url]</s>https://www.youtube.com/watch?v=HKlfxRXy8co<e>[/url]</e></URL><br/>\n<br/>\nW skrócie, <br/>\n<br/>\nMartin jest zadowolony z naszego sprzętu ale będą potrzebowali jeszcze min 2 skutery i system montowania kamer coś jak Muzeum Malta i to byłyby jego oczekiwania co do naszego wsparcia w tym projekcie.<br/>\n<br/>\nCo nam oferuję, ekspozycje naszego sprzętu, dostęp i możliwość wykorzystania materiałów przez nas. Kolejny argument Maritna, który ma nas zachęcić do współpracy to jego status redaktora/fotografa w magazynie TAUCHEN gdzie również może nas umieścić na materiałach o których będzie pisał.<br/>\n<br/>\nInteresuję nas wsparcie takich projektów? <br/>\nMożemy im zaoferować, podobną formę wsparcia jak Museum w Malcie? (tu nie znam jakie tam były szczegóły ?)<br/>\n<br/>\nKupno skuterów z rabatem ? W zamian za materiały i ekspozycja naszych produktów na nich?<br/>\n<br/>\nCo sądzicie?<br/>\n<br/>\nponiżej oryginalna treść wiadomości od Martina:<br/>\n\n<QUOTE><s>[quote]</s>\n<br/>\nHi Damian,<br/>\n <br/>\nI will skip introducing myself as I believe that visual material always tells more than words.<br/>\n<br/>\nI’m a big fan of your dpvs. (They are highly benefitial for tec divers) but judging from videographer\'s perspective they can add absolutely unique feature to my sequences.<br/>\nHonestly, I’m confident to say that using them I can produce footage nobody has seen before. <br/>\n<br/>\nCurrently we are working on a cave documentary in Slovakia, but shortly after that we will shoot a big project in Croatia (Cetina spring) followed by another project in Fuentona de Muriel.<br/>\n<URL url=\"https://www.youtube.com/watch?v=up_MCv29Smc\">https://www.youtube.com/watch?v=up_MCv29Smc</URL><br/>\n<br/>\nThese happen to be organized by UTD headquarters with big names in cave diving world. <br/>\n<br/>\nFor me and my model, we need dpvs. These will be clearly seen in majority of sequences and will represent great exposure for your products.<br/>\nThe sequences will also be available for you to use according to your needs.<br/>\n<br/>\n<URL url=\"https://www.youtube.com/watch?v=HKlfxRXy8co\">https://www.youtube.com/watch?v=HKlfxRXy8co</URL><br/>\n<br/>\nMy current status in TAUCHEN magazine as house photographer/editor allows me to deliver resonable exposure through articles I write, which can also be highly benefitial to Seacraft.<br/>\n<br/>\nWould you like to support us?<br/>\n<br/>\n---------<br/>\n<br/>\nI\'m glad that our projects sparked your interest and so I\'m happy to describe in detail.<br/>\n<br/>\nMy goal is simple - capturing highest quality visual material - photo and video. Therefor I focus on procedures and technologies that are able to push my capabilties further. With using Seacraft dpv I\'am able to add smoothness and dynamics to video sequences that wouldn\'t be possible otherwise. The other dpv needs to be on the photos and videos, hence we would always need 2 pieces. This way I would be able to feature the product and deliver matching material for you to use on your ad channels.<br/>\n<br/>\nAs for the project dates, we are quite active all the time, but the Cetina spring will take place in June. For the spanish project we do not have exact dates yet.<br/>\n<br/>\nWreck of Haven (Arenzano) and Maris (Vis) are the next events we are going to document this year. <br/>\n<br/>\nWhat I offer: Like I said, as an exchange for your support I offer not only exposure in all materials I produce and publish, but also offer sequences for your marketing and other use.<br/>\n<br/>\nWhat do I need: 2 Dpv and possibly a camera mounting console. <br/>\n<br/>\nHave a nice day,<br/>\nMartin\n<e>[/quote]</e></QUOTE></r>','c0324a378c32718949f45c720c20882b',0,'','101mh7s',1,0,'',0,0,0,1,0,'',0),(173,57,31,60,0,'91.196.8.186',1650960307,0,1,1,1,1,'','Re: Współpraca z Cavebase','<r>Ok, koniecznie trzeba im powiedzieć. Cavebase to kilkunastu (?) nurków i większość z nich tak oznacza. Teraz już wiem skąd ten spam. <br/>\n<URL url=\"https://www.instagram.com/p/CZZowbcqG99/\">https://www.instagram.com/p/CZZowbcqG99/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CYwvL6SqDMe/\">https://www.instagram.com/p/CYwvL6SqDMe/</URL><br/>\nZ Damianem zastanawiamy się czy takie \"spamowe\" oznaczenia wielu profili na jednym zdjęciu nie wpływają na obniżenie zasięgów tych profili.</r>','9198157a75c15f7d47d4b420779e00d9',0,'','15',1,0,'',0,0,0,1,0,'',0),(174,59,25,61,0,'94.232.216.242',1650968229,0,1,1,1,1,'','09.2022 [MIL] Prezentacja sprzętu dla wszystkich 3 (lub 4) jednostek specjalnych w Gdyni.','<r>Z maila od Piotra:\n<QUOTE><s>[quote]</s>We wrześniu mam ustalone z DKWS i AMW prezentację naszego sprzętu dla wszystkich 3 (lub 4) jednostek specjalnych w Gdyni. <br/>\nZe względu na aktualną sytuację dokładny termin DKWS może ustalić dokładnie dopiero w sierpniu.  <e>[/quote]</e></QUOTE></r>','c28801cb6e53affa345969af4a175687',0,'','jsn',1,0,'',0,0,0,1,0,'',0),(175,60,5,63,0,'85.221.240.2',1650971297,0,1,1,1,1,'','Cykl Patenty','<t>Hej<br/>\n<br/>\nZgodnie z prośbą od Pauliny, propozycje postów o patentach Seacrafta:<br/>\n<br/>\n1. Silnik pracujący w wodzie - zastrzeżony przez nas<br/>\n2. Patent na przyciski piezo <br/>\n3. Patent na system zatrzasków (jak będzie przyznany - do weryfikacji)<br/>\n<br/>\nW tej chwili jest kilka cyklu w toku, jak będziemy potrzebować tekstów - napiszemy. Kiedy chcielibyście to ew. puścić?</t>','e2e52c20a3e8ba27ca1f0bfc3a987874',0,'','1babd',1,0,'',0,0,0,1,0,'',0),(176,57,31,63,0,'85.221.240.2',1650971418,0,1,1,1,1,'','Re: Współpraca z Cavebase','<r>Jak najbardziej - jeśli tryb oznaczania na IG nam nie odpowiada, piszcie do nich. Mail kontaktowy do koordynatora promocji: <EMAIL email=\"steffen.burger@cavebase.de\">steffen.burger@cavebase.de</EMAIL><br/>\n<br/>\nMożecie mnie dorzucić DW.<br/>\n<br/>\nSzkicowo, event przekazania- \'oficjalnie\' inaugurujący współpracę, to 25-26.06</r>','30ee191eff62178ce72eff6a4699b5a0',0,'','k3hwvl0',1,0,'',0,0,0,1,0,'',0),(177,18,15,63,0,'85.221.240.2',1650971508,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<t>Ustalmy datę kiedy wysyłamy - targi UDT są już niedługo, trzeba moim zdaniem puścić go w przyszłym tygodniu.</t>','8b53c1393ac823fa721b3326667a5740',0,'','2o33f20l',1,0,'',0,0,0,1,0,'',0),(178,6,20,63,0,'85.221.240.2',1650972042,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Hej<br/>\n<br/>\nOpcja 1 - suchy film o produkcie, moim zdaniem niezbyt pasuje<br/>\nOpcja 2 - elementy tak, ale raczej w kontekście szczęście nurkowego, a nie ogólnego <E>;)</E> Czyli, ew. zestawienie/ sparowanie nieszczęśliwego nurka na wakacjach który chce pożyczyć skuter, ale nigdzie nie ma i potem jest nieszczęśliwy- musi pływać z buta <E>;)</E>, a jego kolega przyleciał ze swoim GO! i spędza swietnie czas.<br/>\nOpcja 3 - hmmm....<br/>\n<br/>\nMyślę że mając na uwadze nośność i przekaz, troszkę musiałoby to być połączenie wszystkich składowych. Czyli - film fabularyzowany z dodaniem elementów marketingowo/prezentacyjno/ promocyjnych.<br/>\nNiepozorny początek (jeszcze nie wiemy że jest to film o skuterze - ale, wypuszczany przez Seacrafta, więc zainteresuje \'o co tu dalej będzie chodzić :&gt;\'). Para? Samotny gość? (targetem są goście 35-50, więc opcja że leci sam i tam spotyka piękne dziewczyny na pewno nie zaszkodzi <E>;)</E>)(również para, oraz szczęśliwa żona która ma leciutku skuter wydaje się kusząca) - lecą razem na wakacje nurkowe. (REC/ REC-TEC). Scenka szybkiego śniadania w domu <E>;)</E>? Pakowanie sprzętu, wliczając w to GO!, odprawa, kontrola bezpieczeństwa, (możemy zestawić obok gościa który próbuje przewieźć np. dużą baterię od konkurencyjnego skutera <E>:)</E>?) widok ze środka samolotu, start, lądowanie...<br/>\n<br/>\nSzybkie złożenie sprzętu i tu następuje część reklamowa- pływanie pod wodą, wchodzienie do wody i cały zestaw pokazujący kluczowe cecny GO! (ładowanie! otwarty skuter i trymowanie!)<br/>\n<br/>\nTu może kadry pokazujące szczęście użytkownika?<br/>\n<br/>\nNa koniec można dać przebitki z nurkowań TECH/ Jaskiniowych/ wrakowych i innych poważniejszych- w formie demówki. Ekran końcowy, GO! Seacraft- Seacraft GO! i voila...<br/>\n<br/>\nLuźna idea z mojej strony.</r>','b820f1938c9d28e137c3814e9e36894d',0,'','1mbhmn1',1,0,'',0,0,0,1,0,'',0),(179,58,21,63,0,'85.221.240.2',1650972487,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Słowacja, Chorwacja, Hiszpania - propozycja wsparcia','<t>Hej<br/>\nNie pisze dokładnie że ma już nasze skutery - ma? Pływał? <br/>\n<br/>\nMożemy zaproponować zniżkę na zakup, bądź wypożyczenie na czas projektu. Możliwe że będzie zainteresowany zakupem 1 i wypożyczeniem 1 dodatkowego na czas pływania.<br/>\n<br/>\nTo dobry gościu, aktywny na Słowacji. Warto napisać że jedyne co możemy zaoferować to zniżka na zakup - dokładny % do ustalenia na bazie zwrotów marketingowych i jego działań, ponieważ możliwe że oczekuje że dostanie 2 skutery za free, co może być ciężkie.<br/>\n<br/>\nWarto złapać ten kontakt.</t>','02a675aa35bf43d4c7b7cfa26bc3b08d',0,'','1pxn',1,0,'',0,0,0,1,0,'',0),(180,56,29,63,0,'85.221.240.2',1650972671,0,1,1,1,1,'','Re: Cena','<t>Czy worki dedykowane do transportu uzbrojenia, nie będą podpadać pod koncesję?<br/>\n<br/>\nJeden worek na broń, i worek 40l (transportowy) powinny wystarczyć do prezentacji na żywo + karty katalogowe pozostałych.</t>','8424850e549b5b4508df597d1c69b232',0,'','456tr',1,0,'',0,0,0,1,0,'',0),(181,54,40,63,0,'85.221.240.2',1650974986,0,1,1,1,1,'','Re: Niezbędne zmiany w cenniku special','<t>Wgrane w trybie zmian jako V3.<br/>\n<br/>\nCałośc oparta na założeniu że nie chcemy w aktualnych kartach ofertować sprzętu i akcesoriów starszej generacji - który jest oczywiście dostępny dla aktualnych użytkowników, ale w cenniku \'zbiorczym\', a karty katalogowe zawierają tylko i wyłącznie \'latest and greatest\'.<br/>\n<br/>\n<br/>\n-Do zastanowienia, czy w typowych częściach zamiennych nie dać dodatkowo poszczególnych pozycji (jak zapasowe przyciski), bądź przynajmniej rozwinąć co wchodzi w skład  \'spare parts set\'.<br/>\n<br/>\n-We wszystkich:<br/>\nTUM1758	Coupling connector\'s set - front and rear - 1 pieces		 € 150 <br/>\n<br/>\nPowinno być  \'1 piece\'</t>','d6f99394bd3203db370955cc5c5c42da',0,'','8x5ajfrj',1,0,'',0,0,0,1,0,'',0),(182,61,36,63,0,'85.221.240.2',1650976945,0,1,1,1,1,'','Warunki współpracy- centra DEMO Seacrafta','<t>Wypada opracować system współpracy i zniżek do zakupu sprzętu, dla centrów DEMO.<br/>\nAktualne założenia bazowe :<br/>\n<br/>\n-centra DEMO nie sprzedają sprzętu - żyją z wynajmu/ wypożyczania<br/>\n-z uwagi na to, potrzebują większej zniżki na zakup<br/>\n-dealerzy mogą swobodnie wysyłać klientów do centrum DEMO (np. Niemców na wakacje do Meksyku, czy na Maltę).<br/>\n-Z definicji są to rejony ze znikomym rynkiem własnym, oraz dużą ilością odwiedzających z różnych krajów<br/>\n<br/>\nPropozycja:<br/>\n-Seria Future/Ghost - 30% zniżki<br/>\n-GO! 50% zniżki <br/>\n-Minimum 1 skuter serii F/G, minimum 3 skutery łącznie + ENC<br/>\n-Max - czy chcemy definiować?<br/>\n<br/>\nSprzęt nie do odsprzedaży przez ...4 ? lata</t>','cf2a54e0abafdba61fbdff6ddc565503',0,'','mdblk1w',1,0,'',0,0,0,1,0,'',0),(183,62,43,63,0,'85.221.240.2',1650978355,0,1,1,1,1,'','Sesja zdjęciowa Irena Stangieska- Czerwiec?','<t>Irenka planuje powoli wyjazdy. Prosi o skoordynowanie dat sesji zdjęciowej z nami.<br/>\n<br/>\nU niej:<br/>\n<br/>\nIrena Stangierska<br/>\nMamy Zenobie na koniec maja i safari wrakowe które sama organizuje na koniec czerwca</t>','ca5cd7820eec8a672bb1c8794b65b764',0,'','6isj',1,0,'',0,0,0,1,0,'',0),(184,62,43,61,0,'94.232.216.242',1650983077,0,1,1,1,1,'','Re: Sesja zdjęciowa Irena Stangieska- Czerwiec?','<r>Wtedy będzie już - mam nadzieję - skuter GO!  <E>:D</E> <br/>\nProfesjonalna sesja będzie bardzo potrzebna.<br/>\n<br/>\nUstal z nią warunki i kiedy musi dostać skuter, może jeszcze coś obfotografuje?</r>','6173ddc95ba1c13752153be675f0d43d',0,'','5twmegpk',1,0,'',0,0,0,1,0,'',0),(185,62,43,63,0,'85.221.240.2',1650991444,0,1,1,1,1,'','Re: Sesja zdjęciowa Irena Stangieska- Czerwiec?','<t>Safari wrakowe jest w Egipcie, Zenobia- Cypr. Obie opcje to transport lotniczy, raczej w grę wchodzi tylko GO!/ połączenie GO! wraz z ENC.<br/>\n<br/>\nZobaczę czy ma w ogóle modeli którzy mogli by być fotografowani w trakcie działań, jeśli ma to zrobić niezależnie od nas na swoim wyjeździe.</t>','72e4d52c380bdd856d8bc7b1329fc5f3',0,'','31grxp',1,0,'',0,0,0,1,0,'',0),(186,62,43,63,0,'85.221.240.2',1650993584,0,1,1,1,1,'','Re: Sesja zdjęciowa Irena Stangieska- Czerwiec?','<t>Egipt- jest to safari dla fotografów podwodnych prowadzone przez Irenkę. Będzie niedobór modeli, natomiast uzyski zdjęciowe jeśli dostarczymy modela ze skuterem mogą być spore.   No i kadry piękne...<br/>\n<br/>\nA może Irenka niech jedzie do Chorwacji z nami? Wstępnie by jej pasowało.<br/>\nWtedy narobimy też zdjęć absolutnie wszystkiego. Reb tlenowy i fotki MIL również będą.<br/>\n<br/>\nInna opcja jaką proponuje Irenka to wyjazd na Sardynię.</t>','dbcc4e4e189baeaf7d75f83f116eeb89',0,'','v7zsgjl',1,0,'',0,0,0,1,0,'',0),(187,57,31,61,0,'185.153.39.80',1650999062,0,1,1,1,1,'','Re: Współpraca z Cavebase','<t>Prawdopodobnie Frank będzie się musiał na event pofatygować, bo data wyjazdu na HR na pewno się przesunie.</t>','c4314a6260044d98db349d2f5a4fdcbe',0,'','fiii',1,0,'',0,0,0,1,0,'',0),(188,62,43,61,0,'185.153.39.80',1650999716,0,1,1,1,1,'','Re: Sesja zdjęciowa Irena Stangieska- Czerwiec?','<r>Fajną modelką jest Ania Paćko.<br/>\nMoże jej zaproponować?<br/>\nWiem, że jesteś najlepszy  <E>:D</E>  ale pasuje mieć inne osoby na zdjęciach.<br/>\n<br/>\nNa Chorwacji będzie Sławek i to wystarczy.</r>','f4d83bb7ff7d6374b638bf34ac05c10a',0,'','9dhc',1,0,'',0,0,0,1,0,'',0),(189,58,21,58,0,'192.162.175.145',1651007310,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Słowacja, Chorwacja, Hiszpania - propozycja wsparcia','<r>Nie posiada, ale zna i pływał stąd jego chęć i pewność co do użycia ich w projekcie.<br/>\n<br/>\n<URL url=\"Mo%C5%BCemy%20zaproponowa%C4%87%20zni%C5%BCk%C4%99%20na%20zakup,%20b%C4%85d%C5%BA%20wypo%C5%BCyczenie%20na%20czas%20projektu.%20Mo%C5%BCliwe%20%C5%BCe%20b%C4%99dzie%20zainteresowany%20zakupem%201%20i%20wypo%C5%BCyczeniem%201%20dodatkowego%20na%20czas%20p%C5%82ywania.\"><s>[url]</s><LINK_TEXT text=\"Możemy zaproponować zniżkę na zakup, bą ... pływania.&#10;\">Możemy zaproponować zniżkę na zakup, bądź wypożyczenie na czas projektu. Możliwe że będzie zainteresowany zakupem 1 i wypożyczeniem 1 dodatkowego na czas pływania.\n</LINK_TEXT><e>[/url]</e></URL><br/>\n<br/>\nPogadam z nim/zbadam temat.</r>','c9f1ea357be329be6eb01ca0b53ebc06',0,'','hisxg',1,0,'',0,0,0,1,0,'',0),(190,18,15,58,0,'94.232.216.242',1651038770,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<r>Proponuję po ddugim weekendzie, może czwartek 05.05.2022, jak już się każdy odkopie z maili i nasz newsletter nie zaginie w akcji <E>;)</E><br/>\n<br/>\nPropozycje tematów?<br/>\n<br/>\n1. Targi UDT<br/>\n<br/>\n2. Info o planowanym wprowadzeniu zasobników pod MIL (tych na broń) ? Czy czekamy dopiero jak je wprowadzimy do oferty sprzedażowej?<br/>\n<br/>\n3. ...</r>','96a61f08cd6c2a1f9fa88e001fa0d7d5',0,'','3i3s50',1,0,'',0,0,0,1,0,'',0),(191,61,36,61,0,'185.153.39.80',1651038973,0,1,1,1,1,'','Re: Warunki współpracy- centra DEMO Seacrafta','<t>Dystrybutorzy mają mieć na GO! 30% upustu? Chyba tak ustalaliśmy?<br/>\n<br/>\nOdnośnie warunków - przeliczę i dam znać. 50% to zdecydowanie za dużo na GO! Nie wiem czy będzie na to miejsce.</t>','c8c3696d59da9639ad298bbe634ed2ca',0,'','2xkvjs',1,0,'',0,0,0,1,0,'',0),(192,7,41,58,0,'94.232.216.242',1651039115,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<r>Na wniosek pani Beaty, rozbiliśmy kategorię targi i eventy na osobne fora (bez subkategorii), tak żeby były łatwiej widoczne i użyteczne. <br/>\n\n<ATTACHMENT filename=\"obraz_2022-04-27_075827466.png\" index=\"0\"><s>[attachment=0]</s>obraz_2022-04-27_075827466.png<e>[/attachment]</e></ATTACHMENT>\n\nKażdy temat eventu będziemy nazywać od daty, a następnie nazwy aby było łatwiej się w nich odnaleźć.<br/>\n<br/>\nProponuję nazewnictwo tematów wg wzoru:<br/>\n<br/>\nData [REC/MIL] Nazwa eventu, miejsce.</r>','4c3521d3160f5cfa21e97f68558aa702',1,'','348wft',1,0,'',0,0,0,1,0,'',0),(193,18,15,61,0,'185.153.39.80',1651039403,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<t>Zasobniki<br/>\nNie będzie zdjęć zasobników do 5 maja, ale to będzie dobre info za miesiąc.<br/>\n<br/>\nCzekamy na ofertę cenową wszystkich dostępnych zasobników żeby mieć na magazynie po 1 sztuce (do pokazania już na targach UDT mam nadzieję).<br/>\nJednak zdjęcia poszczególnych zasobników się różnią, stąd trzeba mieć wszystkie.<br/>\n<br/>\nMoże  informacja o nowych typach sprzęgów - chyba że już to było ostatnio?</t>','e73b1fca064c323ed4cc16a5131978dd',0,'','s0vvt0',1,0,'',0,0,0,1,0,'',0),(194,57,31,63,0,'85.221.240.2',1651043217,0,1,1,1,1,'','Re: Współpraca z Cavebase','<t>Chyba że HR np. 27.06-10.07?<br/>\n <br/>\nZ brakiem gotowości DPC na lipiec, pojawia się tam okienko...</t>','c8c97a49a96984bc37110f638f0f3a46',0,'','62rsszy',1,0,'',0,0,0,1,0,'',0),(195,18,15,63,0,'85.221.240.2',1651043333,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<t>Nowy typ sprzęgów <br/>\nNowy moduł GPS (typ B) i jego standaryzacja<br/>\nNowy katalog MIL -zapraszamy do kontaktu po niego<br/>\nUDT<br/>\n<br/>\n...i będzie.<br/>\n<br/>\nCo do zasobników na UDT. Moim zdaniem ma sens mieć na stoisku 2 różne, więcej - zrobi się \'kramik\' z zasobnikami.</t>','6f24cd9cd2950dcae563fb035cc3633b',0,'','l0gu',1,0,'',0,0,0,1,0,'',0),(196,62,43,63,0,'85.221.240.2',1651043596,0,1,1,1,1,'','Re: Sesja zdjęciowa Irena Stangieska- Czerwiec?','<t>Ania ma w tej chwili małe szczeniaki - Roja rodziła, wątpię że by reflektowała, zwykle też nurkują razem ze Sławkiem. (szczególnie CCR)<br/>\n<br/>\nJak by to mogło kosztowo dla nich wyglądać za zabranie skuterka i skupienie się na pozowaniu z nim - pewnie jak MT dopłaci do wyjazdu to będzie to bardziej motywujące. Podpytam Irenki jak wygląda cały koszt safari.</t>','0d309eb496c5149c85096f66637a9f21',0,'','6pf',1,0,'',0,0,0,1,0,'',0),(197,60,5,60,0,'91.196.8.186',1651044025,0,1,1,1,1,'','Re: Cykl Patenty','<t>Dasz radę na czerwiec/lipiec?</t>','171f8b589ba16dd0b1119ad31cac4f29',0,'','gs66kfh',1,0,'',0,0,0,1,0,'',0),(198,62,43,63,0,'85.221.240.2',1651045533,0,1,1,1,1,'','Re: Sesja zdjęciowa Irena Stangieska- Czerwiec?','<t>Są miejsca. Koszt safari:<br/>\n<br/>\n900e plus tipy 175e plus przelot 2050pln<br/>\n6 dni, 3-4 nurkowania dziennie, cały zespół nastawiony na fotografię podwodną. (Irena prowadzi warsztaty fotograficzne)</t>','08f53bfa7fd17655b6ce59b3390aca0e',0,'','3a96hn',1,0,'',0,0,0,1,0,'',0),(199,62,43,61,0,'185.153.39.80',1651053733,0,1,1,1,1,'','Re: Sesja zdjęciowa Irena Stangieska- Czerwiec?','<t>Witek skupia się na znalezieniu modela - sfinansujemy częściowo koszt wyjazdu.<br/>\nTermin niestety nakłada się z kilkoma innymi i ani Paćki ani Witek nie mają możliwości wyjazdu.<br/>\n<br/>\nTe zdjęcia będą bardzo przydatne o ile nie kluczowe do naszego katalogu produktowego z GO!</t>','a4c6b243352e7786b188c55cff2e2823',0,'','6yynqmnm',1,0,'',0,0,0,1,0,'',0),(200,5,23,61,0,'185.153.39.80',1651056048,0,1,1,1,1,'','Re: 7-9.06.2022 [MIL] UDT Rotterdam, Holandia','<t>Piotr robi wizualizację, od wczoraj niestety walczy z aktualizacją ansysa niestety.</t>','2d3d15e2f924e7cf6423b15c12e5e447',0,'','dner',1,0,'',0,0,0,1,0,'',0),(201,29,26,58,0,'94.232.216.242',1651061389,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<r>Przed wysłaniem do Marcina Bramsona, najpierw wrzucam tataj, abyśmy mogli ustalić jak to widzimy.<br/>\n<br/>\nMoja propozycja:<br/>\n<br/>\n<B><s>[b]</s>28.04.2022 - Post wrzucony na profirl organizatora eventu Nurkowe Demo days:<e>[/b]</e></B><br/>\n\n<QUOTE><s>[quote]</s>Prezentujemy kolejny brand, który będziecie mogli spotkać i testować sprzęt na naszych Demo Days - Seacraft (to będzie podlinkowana na nasz page) polski producena skuterów DPV reprezentowany przez Marcina Bramsona z Deep Adventure (to będzie podlinkowane do strony Marcina)<br/>\nSkutery Seacraft to to jedyne DPV świecie, których silnik pracuje bezpośrednio w wodzie.  W produkcji maszyn bazującej na wieloletnich badaniach i rozwoju zastosowano nowatorskie rozwiązania w zakresie konstrukcji skutera, które nie były dotychczas stosowane w tego typu urządzeniach takich jak: silnik pracujący na pełnym zanurzeniu, brak momentu obrotowego, szybkość, zwrotność, cicha praca, wyjście na ogrzewanie i wiele innych cech. <br/>\nWybierając produkty Seacraft otrzymujesz najbardziej innowacyjnym produkt dostępny obecnie na rynku, serwis, wsparcie i obsługa na miejscu w autryzowanych punktach sprzedaży.<br/>\n<br/>\nNa Nurkowych Demo Days prezentowane i udostępniane do testów będą flagowe modele skuterów Seacraft ,a także elektoniczne konsole nawigacyjne ENC3.<br/>\n<br/>\nPrzyjdź i spotkaj się z przedstawicielami Seacraft osobiście, odpowiedzą na wszystkie Twoje pytania i pomogą w przetestowaniu sprzętu.\n<e>[/quote]</e></QUOTE>\n\nPropozycja grafiki do posta:<br/>\n\n<ATTACHMENT filename=\"demo days scooter.jpg\" index=\"2\"><s>[attachment=2]</s>demo days scooter.jpg<e>[/attachment]</e></ATTACHMENT>\n\n<br/>\n<B><s>[b]</s>04.05.2022 - Post wrzucony na nasz profil fb + stories na insta:<e>[/b]</e></B><br/>\n<br/>\nTutaj zastanawialiśmy się z Paulina, że pomimo że naszym oficjalnym językiem komunikacji jest angielski, to ze względu na to, że wydarzenie jest w Polsce tekst dać zarówno w języka polskim jak i angielskim. Tekst nie za długi bardziej informacyjny zaczynający się od ikonki flagi polskiej dla tekstu po PL i od flagi brytyjskiej dla tekstu po angielsku, żeby to ładnie i przejrzyście wyglądało.<br/>\n\n<QUOTE><s>[quote]</s>Zawsze powtarzamy, że najlepszym sposobem poznania możliwości naszych skuterów jest ich przetestowanie samemu w wodzie. Serdecznie zapraszamy na 11 edycję Nurkowych Demo Days. Przyjdź i spotkaj się z nami osobiście, odpowiemy na wszystkie pytania i pomożemy w przetestowaniu sprzętu.<br/>\n14-15.05.2022, Via Sport Diving Marina \"Koparki\", Jaworzno.\n<e>[/quote]</e></QUOTE>\n\n<QUOTE><s>[quote]</s>\nWe always say that the best way to find out features about our scooters is to test them by yourself in the water. We would like invite you to the 11th edition of Diving Demo Days. Come and meet us in person, we will answer all your questions and help you test the equipment.<br/>\nMay 14-15, 2022, Via Sport Diving Marina \"Koparki\", Jaworzno.<e>[/quote]</e></QUOTE>\n\n2 propozycje grafik, oba bazujace na fotkach Ireny właśnie z \"Koparki\".<br/>\n\n<ATTACHMENT filename=\"nurkowe demo days.jpg\" index=\"0\"><s>[attachment=0]</s>nurkowe demo days.jpg<e>[/attachment]</e></ATTACHMENT>\n\n<ATTACHMENT filename=\"nurkowe demo days2.jpg\" index=\"1\"><s>[attachment=1]</s>nurkowe demo days2.jpg<e>[/attachment]</e></ATTACHMENT></r>','0dd25078516a8178b66b17c21bab8a2e',1,'','6sucd',1,0,'',0,0,0,1,0,'',0),(202,29,26,60,0,'91.196.8.186',1651063218,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>Fajny pomysł z  wykorzystaniem zdjęcia Ireny z koparek- tematycznie do wydarzenia. Pytanko: czy możemy użyć jej zdjęć? Czy powinniśmy wcześniej zapytać, bo jednak będzie to coś innego niż udostępnienie na instagramie.<br/>\n<br/>\nMi bardziej podoba się ta pierwsza propozycja ze zdjęciem Ireny, ale obie są ok. Teksty spoko i wersja polsko i angielskojęzyczna jak najbardziej fajnie.</t>','bc9cacf29d980b70568b3123f4bc4fce',0,'','7mcj2mq',1,0,'',0,0,0,1,0,'',0),(203,29,26,63,0,'85.221.240.2',1651064061,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<r>Hej<br/>\nTroszkę przeredagowana propozycja tekstu niżej. Dopytaj Marcina czy będzie bezproblemowe wypożyczanie sprzętu do wody, czy np. na zapisy (trzeba by w tym poście na dole to zaznaczyć), plus np. informacja że tylko dla certyfikowanych nurków DPV.<br/>\n\n<QUOTE><s>[quote]</s>Prezentujemy kolejną markę, którą będziecie mogli zobaczyć i przetestować na Nukowych Demo Days - Seacraft, polski producent skuterów podwodnych . (to będzie podlinkowana na nasz page) <br/>\nSkutery Seacraft jako jedyna na świecie używają silnika pracującego bezpośrednio w wodzie. Specjalnie zaprojektowana i opatentowana konstrukcja  pozwala na całkowitą eliminację wału napędowego oraz konieczności stosowania zawodnych uszczelnień i przekładni.<br/>\nDodatkowe korzyści takie jak potężna moc, absolutnie cicha praca jak i niezwykła wydajność pracy są efektem wieloletnich badań i rozwoju, które doprowadziły do wdrożenia innych unikalnych rozwiązań, niespotykanych wcześniej na rynku skuterowym. Kierownica strug, która zwiększa wydajność pracy i redukuje do zera efekt skręcania rączki, graficzny wyświetlacz parametrów oraz zewnętrzne gniazdo ładowania - będące jednocześnie miejscem podłączenia opcjonalnego wyjścia 12V do systemów grzewczych to tylko niektóre z nich.<br/>\n<br/>\nPrzyjdź i spotkaj się z przedstawicielami Seacraft osobiście, by poznać wszystkie. Secraft w Polsce jest reprezentowany przez Marcina Bramsona z Deep Adventure (to będzie podlinkowane do strony Marcina). Wybierając produkty Seacraft otrzymujesz najbardziej innowacyjny produkt dostępny obecnie na rynku, a także serwis, wsparcie i obsługę realizowaną bezpośrednio w kraju.<br/>\n<br/>\nNa Nurkowych Demo Days prezentowane i udostępniane do testów certyfikowanym do obsługi skuterów nurkom będą flagowe modele skuterów Seacraft ,a także elektoniczne konsole nawigacyjne ENC3.<br/>\n\n<e>[/quote]</e></QUOTE>\n\nGrafika- elegancko <E>;)</E> Dałbym może \'Come and test Seacraft at Demo Days\' ew. DPV w liczbie mnogiej<br/>\n<br/>\nPierwsza chyba lepsza, dwujęzyczność - najlepiej tak jak piszesz, w końcu jesteśmy polskim producentem. Z ikonką brytyjską uwaga na USA... Nie wiem czy nie lepiej dać skrótu języków: [PL] , [EN] (może są takie w emotkach FB?)</r>','dea95238ba96f6f51cbf1b4e2c154907',0,'','6ec6q',1,0,'',0,0,0,1,0,'',0),(204,29,26,63,0,'85.221.240.2',1651064915,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>Podeślijcie najlepiej Irence z pytaniem o publikację z jej zdjęciem. Wątpię żeby miała coś przeciwko, warto ją otagować.</t>','50da99c0065307abb8ebeb497c5af16c',0,'','cxodilt',1,0,'',0,0,0,1,0,'',0),(205,29,26,58,0,'94.232.216.242',1651065163,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"203\" time=\"1651063218\" user_id=\"60\"><s>[quote=\"Witold Hoffmann\" post_id=203 time=1651063218 user_id=60]</s>\nCome and test Seacraft at Demo Days\' ew. DPV w liczbie mnogiej\n<e>[/quote]</e></QUOTE>\n\nTrafna uwaga, lepiej.<br/>\n<br/>\nDzięki Witku, za wzbogacenie techniczne tekst, brzmi lepiej <E>:)</E> <br/>\n<br/>\nTe ikonki ikonki trzeba będzie faktycznie zwrócić uwagę, sprawdzę jak to będzie wyglądać.<br/>\n\n<QUOTE author=\"Paulina &#x15A;l&#x119;zak\" post_id=\"202\" time=\"1651063218\" user_id=\"60\"><s>[quote=\"Paulina Ślęzak\" post_id=202 time=1651063218 user_id=60]</s>\nPytanko: czy możemy użyć jej zdjęć? Czy powinniśmy wcześniej zapytać, bo jednak będzie to coś innego niż udostępnienie na instagramie.\n<e>[/quote]</e></QUOTE>\n\nPaulina, dasz radę ją zapytać? zapewne wystarczy formułka, ze wyraża zgodę, jeżeli obecna umowa (?) współpracy z nią tego nie okresla.<br/>\n<br/>\n1 wersja grafiki to też był mój faworyt <E>;)</E></r>','0293bba91f2cb3472d3fb00236cc54e8',0,'','tluunl4',1,0,'',0,0,0,1,0,'',0),(206,63,36,63,0,'85.221.240.2',1651065647,0,1,1,1,1,'','Warunki współpracy - uzupełnienia 2022','<t>Na bazie napotykanych pytań/ problemów, do dodania:<br/>\n<br/>\n-Informacja o warunkach wykonywania grawerów, oraz grawerach DEMO na maszynach DEMO<br/>\n-Aktualizacja o zamówieniach - tylko i wyłącznie e-sklep, pierwsze zamóiwienie \'ręcznie\', później utworzenie konta w sklepie</t>','76c62c2685d06e914f469f98c9dda55d',0,'','7jfuh',1,0,'',0,0,0,1,0,'',0),(207,63,36,61,0,'185.153.39.80',1651066401,0,1,1,1,1,'','Re: Warunki współpracy - uzupełnienia 2022','<t>Nie ma sensu tego dopisywać do warunków współpracy, bo wymaga to aneksów.<br/>\nWystarczy pewnie wysłać taką informację w kolejnym newsletterze?</t>','f66cb233b30994b10a4e7542313d371c',0,'','2vnked',1,0,'',0,0,0,1,0,'',0),(208,63,36,63,0,'85.221.240.2',1651079018,0,1,1,1,1,'','Re: Warunki współpracy - uzupełnienia 2022','<r>Nie wymaga aneksowania - możemy jednostronnie powiadomić o aktualizacji warunków współpracy:\n<QUOTE><s>[quote]</s>3.	The Manufacturer reserves the right to unilaterally amend provisions of the “Cooperation Conditions” document, which is an integral part of the agreement. The Manufacturer will notify the Business Partner about any changes of the “Cooperation Conditions” documents at least 30 days in advance. In case of not accepting the changes, the Business Partner will be entitled to terminate the agreement with 14-day notice period.<e>[/quote]</e></QUOTE>\n\nW momencie wprowadzenia skutera GO! do oferty, oraz przy innym rabatowaniu na niego jakie jest planowane - plik i tak będzie musiał ulec zmianie.<br/>\nCzasem pracując w innym miejscu coś przyjdzie do głowy - stąd stworzyłem ten temat by łatwiej te informacje zebrać w całość jak przyjdzie na to czas.<br/>\n<br/>\n<br/>\n---<br/>\n-Dodatkowo, usunąć informację o setach E2000 (wycofane z oferty)</r>','d556dbc465b0d036b0f54140a46fe6ba',0,'','29n7bkp',1,0,'',0,0,0,1,0,'',0),(209,58,21,63,0,'85.221.240.2',1651079768,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Słowacja, Chorwacja, Hiszpania - propozycja wsparcia','<r>Super <E>;)</E> To jest zawsze - z mojego doświadczenia - kluczowe, czy jest ktoś kto faktycznie chce \'pływać z nami\' z uwagi na przekonanie co do sprzętu (najlepsze wyniki współpracy), czy też szuka kogoś kto jak najbardziej zasponsoruje \'cokolwiek\'.</r>','63b6c96f0af50e871b89f751c58a988c',0,'','16pcwfvy',1,0,'',0,0,0,1,0,'',0),(210,64,41,63,0,'85.221.240.2',1651079856,0,1,1,1,1,'','Przenosiny na nowy serwer','<r>Hej<br/>\nRozmawiałem z Andrzejem w innym temacie i przy okazji nadał koniecznośc przeniesienia forum na serwer docelowy. <br/>\nSiedzenie na rosyjskiej domenie to też mało optymalna opcja <E>;)</E><br/>\nBędzie to na pewno związane z przerwą w działaniu forum.</r>','b3bbbf84ba2768a8fd48fe910b60f78b',0,'','3b6xca',1,0,'',0,0,0,1,0,'',0),(211,65,21,63,0,'85.221.240.2',1651082240,0,1,1,1,1,'','Projekty jaskiniowe- Chorwacja','<r>Temat w toku:<br/>\n<br/>\n---<br/>\n<br/>\nHello mr.Hoffmann,<br/>\nI am very happy to hear from you. My first idea is...since we do a lot of cave mapping and at the moment we use Mnemo and a small sonar is to use your ENC 3, and start mapping with it. <br/>\nBased on cave maps that we did...we developed a special methodology for population size estimation of Proteus. This methodology can be applied for any water cave animal in the future but it needs to be more tested. I am also involved in other conservation and scientific project that has to do with sea level change where we dive in anchialine caves of Croatia. Except of this expedition I will be conducting national monitoring of cave habitats with a big team for next 2 years. Plenty of things going on...<br/>\nSo...depends on what we agree, by use of your scooters and navigation systems I can test some of mapping methodology, based on mapes done by Seacraft I can do promotion and presentation of Seacraft through my conservation and scientific projects. How, when, where we can decide together. <br/>\nI am an co-author on 6 books, one being about cave diving explorations in Croatia...it is still now in graphic design...but there is a plan for at least 2 more.I am also a member of Croatian mountain rescue service-Cave rescue comission-Cave diving rescue department.<br/>\nIf you are interested we can meet on line or in person and I can present you my work...but more important,my team of crazy cavers, cave divers, biologists, videographers and photographers.<br/>\nI am looking forward hearing from you!<br/>\nGreetings<br/>\nPetra Kovac Konrad<br/>\n<br/>\n<br/>\n<br/>\n<br/>\nOn Tue, 19 Apr 2022, 16:59 Witold Hoffmann, &lt;<EMAIL email=\"witold.hoffmann@seacraft.eu\">witold.hoffmann@seacraft.eu</EMAIL>&gt; wrote:<br/>\n<br/>\n    Hello<br/>\n<br/>\n    Thank you for contact- and it seems as a very nice combination of speleology and diving <E>;)</E><br/>\n<br/>\n    I was able to access only the facebook linked content.<br/>\n<br/>\n<br/>\n    Please let us know, what are your needs regarding propulsion system - what would be the task to be done, and what are you looking for from Seacraft as possible cooperation partner.<br/>\n<br/>\n<br/>\n    Best regards<br/>\n<br/>\n    -- <br/>\n    Witold Hoffmann<br/>\n<br/>\n    Business Development Manager<br/>\n    tel.: +48 739 219 600<br/>\n<br/>\n    e-mail: <EMAIL email=\"witold.hoffmann@seacraft.eu\">witold.hoffmann@seacraft.eu</EMAIL><br/>\n    +48 000 000 000<br/>\n<br/>\n<br/>\n     <br/>\n    MARINE TECH SA<br/>\n    ul. Franciszka Żwirki i Stanisława Wigury 17, 38-400 Krosno, Poland<br/>\n    <URL url=\"http://www.seacraft.eu\">www.seacraft.eu</URL>; <EMAIL email=\"office@seacraft.eu\">office@seacraft.eu</EMAIL>; phone: +48 502 741 715<br/>\n    NIP: 7811910188 | REGON: 361492147 | KRS: 0000557411 | NCAGE: 99QRH<br/>\n    BDO: 000386158<br/>\n<br/>\n<br/>\n<br/>\n<br/>\n<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     From: Petra Kovač-Konrad &lt;<EMAIL email=\"petrakovkon1@gmail.com\">petrakovkon1@gmail.com</EMAIL>&gt;<br/>\n&gt;     Sent: Monday, April 18, 2022 3:43 PM<br/>\n&gt;     To: <EMAIL email=\"office@seacraft.eu\">office@seacraft.eu</EMAIL><br/>\n&gt;     Subject: Fwd: Support for expedition in Croatia<br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     Dear Seacraft  team,<br/>\n&gt;<br/>\n&gt;     I am a cave diver and also<br/>\n&gt;<br/>\n&gt;      FAL_1580487.jpg<br/>\n&gt;<br/>\n&gt;     a organizer of numerous cave-diving expeditions in Croatia. Up to now I organized over 30 expeditions. This year we plan to do exploration of a spring in National park Krka. The springs there are famous, except for its beauty, for the unique amphibian, cave predator Proteus anguinus. For this expedition we will have a french video producers and international French-Mexican-English-Swiss-Croatian team of cave-divers and we will create a short docu-film, numerous photos, and daily trailers for social media. We are looking for your support  if possible in return of lot of publicity. <br/>\n&gt;<br/>\n&gt;     I am sending you few links and attachments to get an idea of what we do. You can see also promotion that we did for Apeks and Isotta. Last year we mapped and connected one of the deepest springs in Croatia to longest regional cave system.  I am looking foward to hearing from you.<br/>\n&gt;<br/>\n&gt;     Petra Kovac Konrad, phd karstology <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     <URL url=\"https://web.facebook.com/Florianlaunettephotography/videos/168783181929832\"><LINK_TEXT text=\"https://web.facebook.com/Florianlaunett ... 3181929832\">https://web.facebook.com/Florianlaunettephotography/videos/168783181929832</LINK_TEXT></URL><br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     <URL url=\"https://web.facebook.com/Florianlaunettephotography/videos/2092919877391203\"><LINK_TEXT text=\"https://web.facebook.com/Florianlaunett ... 9877391203\">https://web.facebook.com/Florianlaunettephotography/videos/2092919877391203</LINK_TEXT></URL><br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     <URL url=\"https://web.facebook.com/Florianlaunettephotography/videos/3075759479161895\"><LINK_TEXT text=\"https://web.facebook.com/Florianlaunett ... 9479161895\">https://web.facebook.com/Florianlaunettephotography/videos/3075759479161895</LINK_TEXT></URL><br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     <URL url=\"https://web.facebook.com/Florianlaunettephotography/videos/355392605397358\"><LINK_TEXT text=\"https://web.facebook.com/Florianlaunett ... 2605397358\">https://web.facebook.com/Florianlaunettephotography/videos/355392605397358</LINK_TEXT></URL><br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      3.tif<br/>\n&gt;<br/>\n&gt;</r>','55add2e6047c2aa2bbcf4d85ba284bb1',0,'','4too9',1,0,'',0,0,0,1,0,'',0),(212,64,41,58,0,'94.232.216.242',1651123495,0,1,1,1,1,'','Re: Przenosiny na nowy serwer','<r>tak, szczegolnie, że szybko nam się rozrasta <E>:)</E> Bedziemy przenosić, zaplanujemy to najpewniej na piątek po 15.</r>','632be415709bbf75c6e3d8e3bf483090',0,'','14qxgx5g',1,0,'',0,0,0,1,0,'',0),(213,18,15,58,0,'94.232.216.242',1651126281,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"195\" time=\"1651043333\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=195 time=1651043333 user_id=63]</s>\nNowy typ sprzęgów <br/>\nNowy moduł GPS (typ B) i jego standaryzacja<br/>\nNowy katalog MIL -zapraszamy do kontaktu po niego<br/>\n<br/>\n...i będzie.<br/>\n\n<e>[/quote]</e></QUOTE>\n\nWitku, byłbyś w stanie przygotować krótką notkę techniczną na temat nowych sprzęgów i modułu GPS (typ B)?<br/>\nKatalog w pdf jak już będzie wrzuć proszę na seacraft cloud i tam podlinkujemy z Newslettera.</r>','0229d60f4147e28d8bce77d9b00be63c',0,'','147aqgl',1,0,'',0,0,0,1,0,'',0),(214,7,41,61,0,'94.232.216.242',1651128169,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<t>MOTOWIDŁO - nowy produkt do dodania</t>','b29d3632dd849fab76b636aef18dcb21',0,'','t0mt7vv',1,0,'',0,0,0,1,0,'',0),(215,6,20,58,0,'94.232.216.242',1651130256,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"178\" time=\"1650972042\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=178 time=1650972042 user_id=63]</s>\n<br/>\nOpcja 2 - elementy tak, ale raczej w kontekście szczęście nurkowego, a nie ogólnego <E>;)</E> Czyli, ew. zestawienie/ sparowanie nieszczęśliwego nurka na wakacjach który chce pożyczyć skuter, ale nigdzie nie ma i potem jest nieszczęśliwy- musi pływać z buta <E>;)</E>, a jego kolega przyleciał ze swoim GO! i spędza swietnie czas.<br/>\n\n<e>[/quote]</e></QUOTE>\n\nTen pomysł ze szcześliwym i nieszcześliwym nurkiem wydaje wydaje mi się bardzo ciekawy i można byłoby go połączyć z naszym wstępnym planem, a dokłądniej:<br/>\n<br/>\nFilm zaczyna się o tego nieszczesliwego nurka na wakacjach, który nei może nigdzie wypożyczyć skutera i patrzyo na szczesliwego nurka który przyjechał ze swoim Go!, wtedy następuje taki flash back do ujęc jak do tego doszło czyli caly nasz wstępny plan:<br/>\n\n<QUOTE><s>[quote]</s>- na wstępie krótko chcemy pokazać, że produkcja skutera odbywa się u nas w Krośnie, bez większych szczegółów,<br/>\n- następnie skuter trafia do klienta,<br/>\n- przygotowanie skutera do podróży,<br/>\n- zapakowanie skutera do torby podróżnej, baterie osobno do podręcznego,<br/>\n- odprawa bagażowa i kontrola (x-ray baterii) ,<br/>\n- wejście do samolotu ze skuterem, ewentualnie ujęcie samolotu i innej osoby, która żegna/macha w stronę samolotu<br/>\n- użycie skutera w fajnym miejscu, może egzotycznym,<br/>\n- użycie skutera przez kobietę - sprzęt jest lekki<e>[/quote]</e></QUOTE>\n\nWszystko to w formie takiego flashbacka, sekwencja szybkich ujęc fajnie zmontowanych, po ktorych nastepuje ponownie powrot do naszego szczesliwego i nieszczesliwego nurka, szczesliwy pływa w fajnych miejscach z GO! Wtedy narracja techniczna na temat GO, zakończenie.<br/>\n<br/>\nCo sądzicie?</r>','792282cebf0475414f810ac62e8eb4ae',0,'','3xj9op8w',1,0,'',0,0,0,1,0,'',0),(216,6,20,63,0,'85.221.240.2',1651131344,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>...A nieszczęśliwy nurek, próbuje nurkować w hotelowym basenie z emerytkami... (tylko tam dopłynie bez skutera), bądź ora plażę (niska widoczność, gołe dno) obok leżaków... <E>;)</E><br/>\n<br/>\nMyślę że trzeba wysłać do Adama taką wizję - zobaczymy czy ją poczuje / zaproponuje coś będącego składem z z pomysłów.</r>','facd6ff0eab600ffa7279f3101d5ea53',0,'','yzpti',1,0,'',0,0,0,1,0,'',0),(217,29,26,60,0,'94.232.216.242',1651131960,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>Irenka nie ma nic przeciwko, zgodziła się na wykorzystanie fotek. Pamiętajcie tylko proszę o jakimś oznaczeniu jej nazwiska nawet na końcu posta, bo jednak nie ma tu znaku wodnego.</t>','c458b57a8c6a24b0cf9c2e634757aae6',0,'','138f7vd',1,0,'',0,0,0,1,0,'',0),(218,29,26,58,0,'94.232.216.242',1651132538,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>Świetnie, czekam już tylko jak Marcin potwierdzi czy wypożyczanie sprzetu bedzie bezproblemowe czy z zapisami i wyślę mu naszą wersję tego posta.</t>','468f8c7ec25c92c2b367f625dbc7e543',0,'','su9',1,0,'',0,0,0,1,0,'',0),(219,6,20,58,0,'94.232.216.242',1651132688,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"216\" time=\"1651131344\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=216 time=1651131344 user_id=63]</s>\n...A nieszczęśliwy nurek, próbuje nurkować w hotelowym basenie z emerytkami... (tylko tam dopłynie bez skutera), bądź ora plażę (niska widoczność, gołe dno) obok leżaków... <E>;)</E><br/>\n\n<e>[/quote]</e></QUOTE>\n\ni tak o powstanie kolektywna historia, która powinna zainteresować oglądających do samego końca filmu  <E>:D</E></r>','452a167881abfb1aa29c89523398655f',0,'','3km11',1,0,'',0,0,0,1,0,'',0),(220,66,23,63,0,'85.221.240.2',1651149871,0,1,1,1,1,'','Bahrajn - targi wojskowe','<r><URL url=\"https://www.bahraindefence.com\">https://www.bahraindefence.com</URL><br/>\nDostałem namiar że jest to godna uwagi impreza.</r>','0409ace5386e74ef7b20dfeef58601a2',0,'','68s1j',1,0,'',0,0,0,1,0,'',0),(221,67,23,63,0,'85.221.240.2',1651149912,0,1,1,1,1,'','USA - targi sił specjalnych','<r>Jedna z głównych imprez - warto rozważyć na 2023: <URL url=\"https://www.sofic.org/\">https://www.sofic.org/</URL></r>','6defbf8a2b3ed6d5f52258bc7e838572',0,'','13ya935',1,0,'',0,0,0,1,0,'',0),(222,67,23,61,0,'185.153.39.80',1651209937,0,1,1,1,1,'','Re: USA - targi sił specjalnych','<t>Damianie,<br/>\ndodaj do naszego spisu w excelu.<br/>\nSzkoda, ze w tym roku o tym nie wiedzieliśmy i jest już za późno.</t>','ca40fcc674bcf1dcf076df5d9b511e90',0,'','g2t8pb',1,0,'',0,0,0,1,0,'',0),(223,66,23,61,0,'185.153.39.80',1651210251,0,1,1,1,1,'','Re: Bahrajn - targi wojskowe','<t>Do dopisania do tabelki - to oczywiste.<br/>\nTrzeba się zastanowić jak tam się wystawić. Czy osobiście czy poszukać tam jakiegoś przedstawiciela seacrafta.<br/>\nNie wiadomo kiedy te targi będą?</t>','f545087c4dc62902d18668ca475dd612',0,'','l26nn6u',1,0,'',0,0,0,1,0,'',0),(224,66,23,58,0,'94.232.216.242',1651210841,0,1,1,1,1,'','Re: Bahrajn - targi wojskowe','<r><QUOTE><s>[quote]</s>Details of the rescheduled dates for BIDEC will be available soon.<e>[/quote]</e></QUOTE>\n\nNa chwilę obecną to jedyny komunikat to, że event z 2021 został przełożony, a nowa data będzie dostępna wkrótce, napisze tam czy już coś wiadomo.</r>','88fb105116058ae968d24ae98e6d7dbc',0,'','fjddf4u',1,0,'',0,0,0,1,0,'',0),(225,7,41,58,0,'94.232.216.242',1651212965,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<r>Nawiązując do wczorajszego zapytania Witka o możliwości oznaczania postów i tematów, na forum jest w każdym wątku opcja Bookmark, można każdy interesujacy temat do którego chcemy wrócić lub zapmietać, dodać do \"ulubionych\", wtedy wskazane wątki będą w naszym profilu przypięte.<br/>\n<br/>\nNa dole każdego wątku:\n<ATTACHMENT filename=\"1.jpg\" index=\"0\"><s>[attachment=0]</s>1.jpg<e>[/attachment]</e></ATTACHMENT>\n\nNastępnie oznaczone jako ulubione wątki ladują w naszym profilu:\n<ATTACHMENT filename=\"2.jpg\" index=\"1\"><s>[attachment=1]</s>2.jpg<e>[/attachment]</e></ATTACHMENT>\n\nW zakładce, tak jak na screenshocie możemy nimi zarządzać.\n<ATTACHMENT filename=\"3.jpg\" index=\"2\"><s>[attachment=2]</s>3.jpg<e>[/attachment]</e></ATTACHMENT></r>','b8ffa1255039ee410ed7ec65fd40c545',1,'','m0zk',1,0,'',0,0,0,1,0,'',0),(226,22,18,60,0,'91.196.8.186',1651217469,0,1,1,1,1,'','Re: Karty katalogowe','<r><B><s>[b]</s>Zdjęcia do kart katalogowych: <e>[/b]</e></B><br/>\n<br/>\n1. Nasz fotograf ma mobilne studio i często robi zdjęcia u klientów na miejscu. Prosi jedynie o: <br/>\n- listę produktów do sfotografowania, <br/>\n- wymiary większych i najmniejszych przedmiotów - mniej więcej, żeby wiedział jaki sprzęt ze sobą zabrać<br/>\n- jeśli się da to kilka fotek z telefonu, żeby widział rodzaj sprzętu, pozwoli mu to lepiej dobrać tła i cały ekwipunek studia mobilnego<br/>\n<br/>\n2. Lista produktów do sfotografowania: <br/>\nDobrze by było pewnie do końca przyszłego tygodnia przygotować taką listę. Ustalimy co fotografujemy, a co ewentualnie będzie w renderach. Wtedy umówimy fotografa i/lub damy znać Pawłowi, żeby coś przygotował.</r>','055a44fa6b5c75d902ce9e1e0dfc5755',0,'','8p1sk',1,0,'',0,0,0,1,0,'',0),(227,68,28,60,0,'91.196.8.186',1651217718,0,1,1,1,1,'','Premiera skutera GO!','<r><B><s>[b]</s>Podsumowanie dotychczasowych pomysłów i ustaleń dot. premiery skutera GO!:<e>[/b]</e></B><br/>\n<br/>\n1. Ustalono minimum 50 sztuk skutera do 15.08.2022<br/>\n2. Oprócz filmu promocyjnego musimy przygotować treści na stronę www, ulotkę, specyfikację. <U><s>[u]</s>Zastanówmy się co jeszcze musimy przygotować<e>[/u]</e></U>. <br/>\n3. Event promocyjny: <br/>\n- Seacraft organizuje swoje główne wydarzenie, <br/>\n- w tym czasie lub później nasi partnerzy organizują mniejsze wydarzenia,<br/>\n- do ustalenia miejsce eventu Seacraft, <br/>\n- do ustalenia lista zaproszonych partnerów na event Seacraft,<br/>\n- do ustalenia jakich partnerów poprosimy o eventy lokalne + jak możemy im pomóc,<br/>\n- kontakt z Lannym z Cavecamp, żeby 10.09.2022 zrobić event dedykowany skuterowi GO! podczas obozu</r>','0ceb887d6dec81e56266dfba66eedc36',0,'','30oi',1,0,'',0,0,0,1,0,'',0),(228,6,20,60,0,'91.196.8.186',1651217898,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><B><s>[b]</s>Ustalenia po wczorajszym spotkaniu: <e>[/b]</e></B><br/>\n1. Nowy pomysł na film: 3 nurków wylatuje z jednego lotniska w 3 różne destynacje; 1 osoba typowo turystycznie np. kobieta w Egipcie, 2 freediver np. na jachcie, 3. nurek jaskiniowy. Łączy ich produkt. Na koniec filmu opis skutera, innowacje itp. <br/>\n2. Prześlę i omówię nasze pomysły z Adamem. Być może to on wybierze miejsce gdzie będzie kręcić film.</r>','b2306062148694d3286818399006920b',0,'','c6gjl9gi',1,0,'',0,0,0,1,0,'',0),(229,69,54,60,0,'91.196.8.186',1651218014,0,1,1,1,1,'','Internacjonalizacja DPC','<r><B><s>[b]</s>Zgodnie z wczorajszymi ustaleniami:<e>[/b]</e></B><br/>\nBędziemy przygotowywać nowy projekt na Internacjonalizację DPC. Zgodziliśmy się na wybór 2 destynacji: Indie i Indonezja.<br/>\nW najbliższym czasie sprawdzę nową dokumentację konkursową pod kątem progów na koszty marketingowe i ewentualnych zapisów militarnych. <br/>\nJeśli macie inne propozycje na nowe destynacje to dajcie znać.</r>','838b3ee85b7e7dff1abbfc32d5e4e721',0,'','3eapfm',1,0,'',0,0,0,1,0,'',0),(230,48,25,60,0,'91.196.8.186',1651218083,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Czy musimy coś przygotować na event Cavebase?</t>','a61045a6f2caa16be68424cec30290bb',0,'','9ntte',1,0,'',0,0,0,1,0,'',0),(231,69,54,61,0,'185.153.39.80',1651219312,0,1,1,1,1,'','Re: Internacjonalizacja DPC','<t>Proszę o jakieś inne sensowne propozycje:<br/>\n<br/>\nIndie w trakcie - dziś WH ma wysłać wzory umów dla nich<br/>\nIndonezja - też jest otwarta karta kontaktu i chyba chcą kupić demo.<br/>\n<br/>\nKraje idealne, ale nie wiem czy damy radę przesunąć ich na sierpień...</t>','f4a8435810a124bf4fd20d07cbebda08',0,'','11eo',1,0,'',0,0,0,1,0,'',0),(232,5,23,61,0,'185.153.39.80',1651219493,0,1,1,1,1,'','Re: 7-9.06.2022 [MIL] UDT Rotterdam, Holandia','<t>Niezbędny do stoiska stojak do DPC jeszcze w fazie projektowania!<br/>\nPoganiam wszystkich ale wykonanie w terminie może być poza naszymi możliwościami.<br/>\nIza wie o terminie i robi co w jej mocy by zamówić profile.</t>','ff8d4f15e31f8238273b8969d74b9c87',0,'','80nr2',1,0,'',0,0,0,1,0,'',0),(233,48,25,63,0,'85.221.240.2',1651220297,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Fajnie będzie zabrać flagi do wrzucenia w tle.<br/>\n-Komunikacja z Frankiem, czy się pojawi? Czy wyśle Michaela z Upstream? <br/>\n-Komunikacja z Olivierem Steinle - jako dealerem<br/>\n<br/>\nWyślę dzisiaj update do Cavebasu z DW do Pauliny i Damiana.</t>','947e4e668ca6730d727c903c2734ecc7',0,'','3lar',1,0,'',0,0,0,1,0,'',0),(234,48,25,61,0,'185.153.39.80',1651220589,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Na razie nic nie pisz! - Paulina ustali szczegóły z Frankiem.<br/>\nDopiero później ich poinformujemy, bo jeszcze nie wiemy jak sytuacja się rozwinie.<br/>\nMuszą dostać od razu konkrety.</t>','2afad93823691290e19c098ee4849b9d',0,'','he3otrjj',1,0,'',0,0,0,1,0,'',0),(235,48,25,60,0,'91.196.8.186',1651224317,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Witek daj proszę znać o wszystkich szczegółach jakie ustalałeś z Cavebase: <br/>\n- event ma trwać 1 czy 2 dni?<br/>\n- czy planowane było nurkowanie?<br/>\n- gdzie ma się odbyć przekazanie?<br/>\n- czy Cavebase będzie mieć fotografa, który zrobi zdjęcia z przekazania?</t>','ec0ae56f80aba8769ceaec6f86d92b80',0,'','4dnrzk',1,0,'',0,0,0,1,0,'',0),(236,68,28,61,0,'185.153.39.80',1651227030,0,1,1,1,1,'','Re: Premiera skutera GO!','<t>Proponuję:<br/>\n<br/>\nMeksyk<br/>\nSardynia<br/>\nHonoratka - ustalone z Marcinem Bramsonem<br/>\nimpreza tematyczna dla freediverów - chyba na deepspocie - tam już mamy nasze skutery<br/>\n<br/>\nChyba w niedługim czasie trzeba ustalać terminy - do lipca pewnie max.</t>','ae7987ab3aa4cf83937da9a11a37098b',0,'','27jq',1,0,'',0,0,0,1,0,'',0),(237,62,43,61,0,'185.153.39.80',1651229339,0,1,1,1,1,'','Re: Sesja zdjęciowa Irena Stangieska- Czerwiec?','<t>Trzeba znaleźć inny sposób na dobre zdjęcia.<br/>\nZapomnijmy o tym, że skuter uda się dostarczyć do Egiptu. Nie sądzę, żeby Ahmed Gabr nam w tym pomógł. Ostatnio jesteśmy w niezbyt przyjaznych stosunkach z kilku powodów.<br/>\n<br/>\nW każdym razie nie możemy liczyć na tą imprezę.</t>','70b61782d637d25dfeaa6908afad193e',0,'','q0df2c',1,0,'',0,0,0,1,0,'',0),(238,7,41,63,0,'85.221.240.2',1651237291,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<r>O! Coś mi świtało <E>;)</E> Dzięki, dokładnie o to chodziło. (czyli np. jeśli jest wątek gdzie chcę odpowiedzieć, a nie mam czasu na moment czytania --&gt; wrzucę sobie w bookmarki)</r>','2056ac28f1c0c114305920c27e4423a7',0,'','cyv2aylh',1,0,'',0,0,0,1,0,'',0),(239,66,23,63,0,'85.221.240.2',1651260819,0,1,1,1,1,'','Re: Bahrajn - targi wojskowe','<t>Z aktualnymi cenami ropy naftowej, warto przejrzeć podobne imprezy w innych krajach \'roponośnych\'.<br/>\nKiedy byliśmy w Dubaju sporo o tym było mowy (wtedy trafiliśmy na okres niskich cen ropy).</t>','9c3e041f698d0f0b526d973ba9f49b29',0,'','jlpmqkm',1,0,'',0,0,0,1,0,'',0),(240,67,23,63,0,'85.221.240.2',1651260875,0,1,1,1,1,'','Re: USA - targi sił specjalnych','<t>Z informacji od wizeprezesa Waterproofa- bywa ciężko z miejscem, trzeba bookować z dużym wyprzedzeniem.</t>','b25f7c646e04c62025371fbc1b650a8b',0,'','4o7g',1,0,'',0,0,0,1,0,'',0),(241,48,25,63,0,'85.221.240.2',1651261097,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<r>Kontakt: <EMAIL email=\"steffen.burger@cavebase.de\">steffen.burger@cavebase.de</EMAIL><br/>\n<br/>\nNa chwilę obecną udało się ustalić datę. Na miejscu ma być większość teamu - nie jest w 100% ustalone to o co pytasz. Oczywiście planowane jest nurkowanie, oraz mają być osoby do robienia zdjęć pod wodą. Warto doprecyzować też zdjęcia na sucho i generalnie plan działań - sugeruję zdjęcia grupowe pod wodą jako plan dla nich. (wiele skuterów na jednym zdjęciu). <br/>\n<br/>\nOstatnia komunikacja:<br/>\n\n <QUOTE><s>[quote]</s>\nWe will discuss about 25/26.6. We reached first goal to have a date <EMOJI seq=\"1f609\" tseq=\"1f609\">&#128521;</EMOJI><br/>\n<br/>\nMaybe Nordhausen could fit, as it is allowed to drive DPV there. I will ask in our team about a favorite. Nordhausen is also very middle for each guy.<e>[/quote]</e></QUOTE>\n\nNie pisałem o aktualizacji tematu na chwilę obecną.</r>','54ca5e6f7668f034d8a04c27ab70dae6',0,'','g67',1,0,'',0,0,0,1,0,'',0),(242,18,15,63,0,'85.221.240.2',1651263212,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<r>-Super że udało się załadować zdjęcie tła w konwencji MIL <E>;)</E> <br/>\n<br/>\n-Do kompilacji jest lista wysyłkowa... Jak możesz, dodaj wszystkich partnerów MIL. Ja spróbuję przebić się przez mojego maila i dodać wszystkie osoby które warto tam dodać. Tag wysyłkowy : \'Military newsletter\'.<br/>\nUważam że warto i można go puścić również wszystkim kontrahentom REC (czyli 2 listy Reseller i Distributor).  Zeby później jak kołki z Tajwanu nie pytali czy w ogóle mamy ofertę militarną.<br/>\n<br/>\n-zmodyfikowałem nieco opis UDT. Czy przypadkiem logotyp nie ma niewielkiego paska na dole?<br/>\n<br/>\n-podpięty link do katalogu<br/>\n<br/>\n-Opisy:<br/>\n<br/>\na) Nowy system sprzęgający. Zdjęcie można dać z newslettera styczniowego. Podlinkowałbym też do: <URL url=\"https://seacraft.eu/products/accessories-and-spares/scooters-coupling-platform/\"><LINK_TEXT text=\"https://seacraft.eu/products/accessorie ... -platform/\">https://seacraft.eu/products/accessories-and-spares/scooters-coupling-platform/</LINK_TEXT></URL><br/>\n\n<QUOTE><s>[quote]</s>We are happy to introduce a new type of coupling system. It allows connecting scooters faster and easier. Modular construction allows for quick and simple conversions, as well as part replacements. In addition to this - there are two compatible connecting platforms available:<br/>\n- TUM1000 Scooters coupling platform ‐ wide, for cargo bags or ENC3M platform (dedicated to TAC1000 and TAC2000 scooters) with<br/>\nadjustable buoyancy floats ‐ gen. II<br/>\n- TUM1100 Scooters coupling platform ‐ narrow (dedicated to TAC1000 and TAC2000 scooters) with adjustable buoyancy floats ‐ gen. II<br/>\n<br/>\nDual DPV systems can be built using a chosen platform, and based on both TAC1000 and TAC2000.<br/>\n\n<e>[/quote]</e></QUOTE>\n\n-Informacja o workach transportowych może zasadniczo iśc w podobnym kształcie (zdjęcie - chyba że są już lepsze?)<br/>\n<br/>\nTekst:\n<QUOTE><s>[quote]</s>Dry-Bag for equipment transport<br/>\nWe are happy to add a series of Dry-Bags for equipment underwater transport. It has been designed to use with DPV scooters for underwater transportation of equipment.<br/>\nThe kit includes external backpack and internal dry-chamber.  Backpack straps can be packed into dedicated pockets, for underwater carriage - to reduce entangelemnts risk.<br/>\nThe external backpack which has drainage system allowing for quick water escaping and molle system which enables to attach and carry out additional equipment. The internal dry-chamber has molle plate placed on bottom for attaching equipment. The dry-chamber has also inflation system powered by 0,5l tank, which includes corrugated inflator type \"K\" ended by valve and additional separate exhaust valve.<br/>\n<br/>\nDry-bags are available in various sizes: 40l, 60l, 80l, 120l (regular cargo packs), as well in shapes dedicated for firearms transport.<br/>\n\n<e>[/quote]</e></QUOTE>\n\n<br/>\n<br/>\nKorekta się przyda, pisane w miarę na szybko.</r>','7e149ac16ccfa67ae64b9710e6210481',0,'','3xof',1,0,'',0,0,0,1,0,'',0),(243,70,26,61,0,'185.153.39.80',1651487841,0,1,1,1,1,'','18 - 21 październik 2022; Euronaval','<r>Temat poświęcony targom militarnym we Francji.<br/>\n<br/>\n<URL url=\"https://www.euronaval.fr/21/exhibitors-2022\">https://www.euronaval.fr/21/exhibitors-2022</URL><br/>\n<br/>\nBardzo duża impreza, musimy znaleźć kogoś poważnego kto wystawi nasz produkt.<br/>\n\n<QUOTE><s>[quote]</s>\nI will exhibit to Eurosatory, Euronaval and Fireman congress this year. <br/>\nDo you think it’s possible to get from you military demo units ?<br/>\nDo you think it’s possible to schedule a phone/video call with you to have an update on the products to be good in front of the military ?\n<e>[/quote]</e></QUOTE>\n\nChciał to zrobić Arnaud, ale to jest zły pomysł. Zwłaszcza po ostatnim jego występie na targach.</r>','eeb92282bb46d8a3caa3185eae6406c9',0,'','5ydshbo',1,0,'',0,0,0,1,0,'',0),(244,16,9,58,0,'94.232.216.242',1651644530,0,1,1,1,1,'','Re: Aktualizacja zakładki MIL','<r>Dopisuję, aby nam nie uciekło.<br/>\n\n<QUOTE><s>[quote]</s><URL url=\"https://www.csgroup.eu/fr/technologies-innovation/projets-rd/\"><LINK_TEXT text=\"https://www.csgroup.eu/fr/technologies- ... rojets-rd/\">https://www.csgroup.eu/fr/technologies-innovation/projets-rd/</LINK_TEXT></URL><br/>\n<br/>\n<URL url=\"https://www.csgroup.eu/fr/technologies-innovation/\">https://www.csgroup.eu/fr/technologies-innovation/</URL><br/>\n<br/>\n<URL url=\"https://rtsys.eu/\">https://rtsys.eu/</URL>#<br/>\n<br/>\nMusimy rozbudować cześć MIL seacraft.eu o trochę opisów w zakresie prowadzonych prac B+R. <br/>\nTakie SOCOM i inni przeglądają to i musimy się wykazać że takie projekty morskie prowadzimy i z AMW i innymi współpracujemy, bo może uda się kiedyś pozyskać zagranicznych partnerów. <br/>\n \n<e>[/quote]</e></QUOTE></r>','6d46b5342412190131ea19faf9ec9636',0,'','3a1o2',1,0,'',0,0,0,1,0,'',0),(245,12,31,58,0,'94.232.216.242',1651644893,0,1,1,1,1,'','Re: Godne uwagi tematy','<r><QUOTE><s>[quote]</s>Hi Witold, <br/>\n<br/>\nI am finally happy to share with you the project I had once mentioned to you which we have been working on for years. <br/>\n<br/>\nIn 2017, an iconic natural arch in Gozo (Malta) known as the Azure Window, collapsed. By mounting cameras and lights atop Seacraft scooters, we undertook photogrammetry of the remains, which span around 8000 square meters, and were able to reconstruct the collapse event.<br/>\n<br/>\nIt\'s in the news today, e.g. here:<br/>\n<URL url=\"https://timesofmalta.com/articles/view/this-is-how-the-azure-window-collapsed.951730\"><LINK_TEXT text=\"https://timesofmalta.com/articles/view/ ... sed.951730\">https://timesofmalta.com/articles/view/this-is-how-the-azure-window-collapsed.951730</LINK_TEXT></URL><br/>\n<br/>\nA website dedicated to the project is available at <URL url=\"http://www.dwejra.net\">http://www.dwejra.net</URL><br/>\n<br/>\nWe have also produced a video documentary which showcases the Seacraft scooters in use; this is available here: <URL url=\"https://youtu.be/39tbP-F-iSc\">https://youtu.be/39tbP-F-iSc</URL><br/>\n<br/>\nWe have a dedicated website for the project (<URL url=\"http://www.dwejra.net/azure-window/\">www.dwejra.net/azure-window/</URL>) and I have put some images for you in this Google Drive:<br/>\n<URL url=\"https://drive.google.com/drive/folders/1RqIIjcMHnz87oMotQ-_e7O60APrybmLj?usp=sharing\"><LINK_TEXT text=\"https://drive.google.com/drive/folders/ ... sp=sharing\">https://drive.google.com/drive/folders/1RqIIjcMHnz87oMotQ-_e7O60APrybmLj?usp=sharing</LINK_TEXT></URL><br/>\n<br/>\nI hope you find some of this useful, Witold! <E>:)</E><br/>\n<br/>\nBest wishes,<br/>\n<br/>\nJoseph<br/>\n\n<e>[/quote]</e></QUOTE></r>','9e82175a8e84d42469781c21639d828d',0,'','2vgqnu',1,0,'',0,0,0,1,0,'',0),(246,18,15,58,0,'94.232.216.242',1651645208,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<r>Dzięki z opis do sprzęgów i podlinkownaie katalgou w pdf.<br/>\n<br/>\nO workach napiszemy już w następnym jak będziemy mieć pozostałe opcje.<br/>\n\n<QUOTE><s>[quote]</s>-Do kompilacji jest lista wysyłkowa... Jak możesz, dodaj wszystkich partnerów MIL. Ja spróbuję przebić się przez mojego maila i dodać wszystkie osoby które warto tam dodać. Tag wysyłkowy : \'Military newsletter\'.<br/>\nUważam że warto i można go puścić również wszystkim kontrahentom REC (czyli 2 listy Reseller i Distributor). Zeby później jak kołki z Tajwanu nie pytali czy w ogóle mamy ofertę militarną.<e>[/quote]</e></QUOTE>\n\nZaktualizuję maile obecnych partnerów MIL;<br/>\nMoże warto ten Newsletter MIL zawsze puszczać też dla partnerów REC ?<br/>\n\n<QUOTE><s>[quote]</s>Czy przypadkiem logotyp nie ma niewielkiego paska na dole?<e>[/quote]</e></QUOTE>\n\nLogoty jest ok, ale atrybut ALT został pusty i wyświetlało ramkę podświetlenia tekstu, już poprawione.</r>','f71200468f2d00ffd5499ee33f279998',0,'','czv42lz1',1,0,'',0,0,0,1,0,'',0),(247,24,28,58,0,'94.232.216.242',1651649813,0,1,1,1,1,'','Re: Zdjęcia i materiały','<r><QUOTE><s>[quote]</s>Andrea -  <URL url=\"https://www.digitalmovie.it/\">https://www.digitalmovie.it/</URL> - jest w stanie zrobić dla nas zarówno zdjęcia jak i video wysokiej jakości GO!, zarówno studyjnie, jak i w akcji.<br/>\nW zamian za to - zniżka na zakup nowego skutera (jeden ma <E>;)</E>) , możliwe że 2 dla pozostałych członków zespołu (np. Andrea Bada).<br/>\nBędę wdzięczny za skoordynowanie tematu na początku przyszłego tygodnia. Mail kontaktowy: Andrea &lt;<EMAIL email=\"andrea@digitalmovie.it\">andrea@digitalmovie.it</EMAIL>&gt;\n<e>[/quote]</e></QUOTE>\n\nJeden z tematów do skoordynowania od Witka, <br/>\n<br/>\nNie mamy jeszcze fizycznie gotowych skuterów, więc może dobrze byłoby ustalić kto je dostanie jako pierwszy, aby nie było później niedomówień, że ktoś nie dostał.<br/>\n<br/>\nAndrea - 1 skuter (wyślę mail z informacją, że dostanie go zgodnie z ustaleniami w tym miesiacu, poinformujemy dokładnie jak będziemy mieć gotowy skuter do wysyłki) - akceptujemy jego warunki? <br/>\n<br/>\nCave Base - 1 skuter - poinformujemy ich, że wyślemy zgodnei z ustaleniami na wskazany przez nich addres jak skuter będzie gotowy.<br/>\n<br/>\nTrzeci skuter dla Ireny?</r>','e51ec4d45710b40c54b460692e010739',0,'','bpp',1,0,'',0,0,0,1,0,'',0),(248,71,34,58,0,'94.232.216.242',1651728588,0,1,1,1,1,'','Level 0+1 lista kontrahentów','<r>Lista naszych Resellerów i ProResellerów do szekolenia level 0+1<br/>\n<br/>\nEU - ProReseller - Black Duck Diving (Finlandia)<br/>\nEU - ProReseller - Multi Safety Support System - M3S (Francja)<br/>\nEU - ProReseller - Silent Explorers (Grecja)<br/>\nEU - ProReseller - Extreme Diving School (Holandia)<br/>\nEU - ProReseller - South West Technical Diving (Irlandia)<br/>\nEU - ProReseller - Duo Training Sp. z o.o (Polska)<br/>\nEU - Reseller - Oloturia sub DC (Włochy)<br/>\nOVERSEAS - ProReseller - Indigo-blue Technology Co.,LTD (Tajwan)<br/>\nOVERSEAS - ProReseller - Xtreme Deep Asia Limited (Hong Kong, Chiny)<br/>\nEU - ProReseller - René Melichárek s.r.o. (Czechy)<br/>\nEU - Reseller - ESSENTIAL DIVING (Francja)<br/>\nEU - Reseller - Groborz-Tauch-Technik (Niemcy)<br/>\nEU - ProReseller - TecServe UG (Niemcy)<br/>\nEU - ProReseller - Tauchshop regler-service.at Helmut Hubalek (Austria)<br/>\nEU - ProReseller - Die Tauchschule Oliver Perschke (Niemcy)<br/>\nEU - ProReseller - TecXpedition GmbH (Niemcy)<br/>\nEU - ProReseller - Sidemount explorer UG (Niemcy)<br/>\nEXPORT - ProReseller - TekForce(Ukraina)<br/>\nEU - ProReseller - Tauchshop Kwella Thomas Kwella (Niemcy)<br/>\nEU - ProReseller - SmartDive LTA (Portugalia)<br/>\nEU - ProReseller - Dykeriet AB  (Szwecja)<br/>\nEU - ProReseller - BLUE DEEP Scuba Shop (Włochy)<br/>\nEU - ProReseller - MALAGA DIVE S.L.U. (Portugalia)<br/>\n<B><s>[b]</s>EU - ProReseller - Dragor Lux (Chorawacja) umowa przygotowana do wyslania<br/>\nEXPORT - ProReseller - Nammu Tech (Wielka Brytania) - wkrótce powinni spełnić warunk<br/>\nEU - ProReseller - CENTRUL DE SCUFUNDĂRI TRANSILVANIA (Rumunia) wkrótce powinni spełnić warunki <e>[/b]</e></B></r>','9afe0c7f8df16aa13a1d3c4254b00b47',0,'','44yaco',1,0,'',0,0,0,1,0,'',0),(249,72,34,58,0,'94.232.216.242',1651728825,0,1,1,1,1,'','Level 2 lista kontrahentow','<t>Lista naszych dystrybutorów<br/>\n<br/>\nEU - Dystrybutor - Upstream UG (Niemcy)<br/>\nEXPORT - Dystrybutor - Safenor AS (Norwegia)<br/>\nEXPORT - Dystrybutor - Decostop GmbH (Szwajcaria)<br/>\nEXPORT - Dystrybutor - KNS Trading PTY LTD (Snorkel and Dive Safari Altona Beach) (Australia)<br/>\nEXPORT - DYSTRYBUTOR - B.M.Z Or ltd Palamida Dive Center (Izrael)<br/>\nEXPORT - DYSTRYBUTOR - Mares SSI Korea co., ltd. (Korea)<br/>\n<br/>\nMIL<br/>\nEU - Electron Progress (Bułgaria)<br/>\nOVERSEAS - Aqualung Group (Tajlandia)<br/>\nOVERSEAS - Apollo Military (Vietnam)<br/>\nEXPORT - Oztekin Technical Service Equipment and Defense Industry Commerce Ltd. Comp. (Turcja)<br/>\nOVERSEAS - XR Hub (Emiraty)</t>','07b398454fb5eaeabb7f83935e85b528',0,'','e76',1,0,'',0,0,0,1,0,'',0),(250,73,55,61,0,'94.232.216.242',1651743959,0,1,1,1,1,'','Bateria lotnicza','<t>Nowy produkt:<br/>\n<br/>\nBateria Lotnicza:<br/>\nwersja 600Wh, 700Wh, 800Wh<br/>\n<br/>\nPrawdopodobnie będzie wyceniona osobno obudowa i jeden pakiet - każdy kupi sobie ile chce<br/>\n<br/>\nPlanowana seria produkcyjna - początek czerwca, do zdjęcia będzie za jakieś dwa tygodnie<br/>\n<br/>\nTemat transportu lotniczego:<br/>\nmusi być zaślepka z wtrysku - Paweł dostał zlecenie narysowania (zaślepka jest planowana z wtrysku)<br/>\nwalizeczka transportowa - Iza szuka<br/>\n<br/>\nBardzo ważna informacja, która musi znaleźć się w instrukcji - używane pakiety muszą mieć ten sam poziom naładowania. Inaczej cała bateria będzie miała moc taką jak ma najsłabsze ogniwo.</t>','65f533f5f52fa0b8f604e6f31b4cd8cb',0,'','l2osykp',1,0,'',0,0,0,1,0,'',0),(251,74,34,63,0,'85.221.240.2',1651840163,0,1,1,1,1,'','E-learning - zasady ogólne + prototyp level 0','<r>Hej<br/>\n<br/>\nSiadłem nad tematami szkoleń kontrahentów.<br/>\nW naszej branży będziemy się nieustannie mierzyć z potrzebą edukowania, oraz egzekowania/ weryfikacji wiedzy użytkowników. Chcą zaprosić każdego osobiście na szkolenie- niestety, padniemy, a oni zapomną połowę po tygodniu.<br/>\n<br/>\n Zdecydowana większość tematów, z uwagi na relatywną rzadkość stosowania będzie również wymagać dostępności materiałów online/ drukowanych - by dana osoba mogła np. pracować serwisowo opierajac się 1:1 na manualu.<br/>\n<br/>\nManuale - jak wszystko - ulegają zmianom, korektom, oraz wymyślamy lepsze metody.<br/>\n<br/>\nW zwiążku z tym przygotowałem oraz proponuję natępującą strukturę szkoleń naszych kontrahentów. Na chwilę obecną - opieram się tylko na szkoleniach REC, ale do MIL widzę podobną strukturę. <br/>\n<br/>\n1. Ukończenie szkoleń i zdanie testów obowiązkowe jest dla wszystkich kontrahentów:<br/>\na) szkolenie techniczne poziom 0 <br/>\nb) szkolenie marketingowe - odpowiedzialny Frank. (jest zalążek/ stare szkolenie na edu)<br/>\nc) (od 2023) - coroczny update informacji technicznych i marketingowych (jeśli były zmiany) <br/>\n<br/>\n<br/>\n2. Wymagane od PRO Resellerow<br/>\na) szkolenie techniczne poziom 1  (dostępne po zdaniu poziomu 0)<br/>\nb) (od 2023) - coroczny update informacji technicznych i marketingowych (jeśli były zmiany) <br/>\n<br/>\n3. Wymagane od Dystrybutorów<br/>\na) szkolenie techniczne poziom 2 - tylko osobiście w fabryce (po zdaniu poziomu 1 online)<br/>\n<br/>\n<br/>\nDocelowo- do dodania będą moduły o ENC...<br/>\n<br/>\nTroche myślałem nad strukturą modułów w Moodle i finalnie zdecydowałem się na umieszczanie treści jako \'book\' (książka), z ważnymi danymi/ linkowaniem do modułów zewnętrznych (support), tak by nie zachodziła potrzeba aktualizacji np. procedury serwisowej w 2 miejsach. (a tylko na supporcie).<br/>\n<br/>\nNa: <URL url=\"https://edu.seacraft.eu\">https://edu.seacraft.eu</URL> jest już dostępny kurs techniczny level 0. Dopinam jeszcze kilka ustawień i będę zapraszał:<br/>\n<br/>\n-Franka<br/>\n-Damiana<br/>\n-Office<br/>\n<br/>\n<br/>\nJeśli nie będzie problemów technicznych, dodamy kolejne osoby z \'węższego grona\', a następnie --&gt; wszyscy sprzedawcy w określonym terminie powinni to zaliczyć. Optymalnie by zaliczali zarówno szkolenie marketingowe i techniczne w jednej komunikacji.<br/>\n<br/>\nProszę o przejrzenie całości i uwagi, a następnie podejście do egzaminów i zadań.<br/>\nZdjęcia możecie wgrać dowolne- chcę sprawdzić jak zadziała moduł oceniania i kończenia aktywności.</r>','3c91edc659814811313d5b2e780f1555',0,'','1816b',1,0,'',0,0,0,1,0,'',0),(252,12,31,63,0,'85.221.240.2',1651848878,0,1,1,1,1,'','Re: Godne uwagi tematy','<t>Film wygląda dobrze. Nadaje się na większy post tematyczny, a nawet na newsletter.<br/>\nRównież - do sekcji \'środowisko\' na stronie WWW.</t>','e6c880a93ba7fbe6f60a3bcf128081fd',0,'','cafj',1,0,'',0,0,0,1,0,'',0),(253,75,42,63,0,'85.221.240.2',1651849208,0,1,1,1,1,'','Dodanie kodów do naklejek na produkty','<t>Hej<br/>\nJest sugestia (uważam że słuszna) by np. na ładowarkach umieszczać również ich kody produktowe zgodne z naszym cennikiem. Podobnie z innymi produktami - pozwoli to na łatwą identyfikację np. na cle, czy przy dostawach.<br/>\nNiepilne, ale ważne.</t>','7c684e8422a6443fdd69bf7027876016',0,'','1hxgj',1,0,'',0,0,0,1,0,'',0),(254,12,31,58,0,'176.111.23.110',1651948513,0,1,1,1,1,'','Re: Godne uwagi tematy','<t>Zdecyddowanie tak, materiał na 3 platformy, fb, newstletter i artykul na strone.</t>','0adb9e3f7cdd504fd5fee848713b336e',0,'','9k0ax',1,0,'',0,0,0,1,0,'',0),(255,76,37,61,0,'91.196.8.186',1652079958,0,1,1,1,1,'','Umowy','<t>Przeniosłam folder MT_UMOWY do folderu MARKETING<br/>\nDokumenty do przejrzenia i umieszczenia we właściwym miejscu.</t>','566d4487999cf94e7458a1775138d1e4',0,'','3buqe',1,0,'',0,0,0,1,0,'',0),(256,75,42,61,0,'91.196.8.186',1652080110,0,1,1,1,1,'','Re: Dodanie kodów do naklejek na produkty','<t>Od kogo taka sugestia wyszła?<br/>\nCzy oznaczane powinny być wszystkie produkty?<br/>\nTo będzie kłopotliwe i doda sporo pracy.</t>','221accc9474a4b194fafb1704d812fad',0,'','dusmvgz9',1,0,'',0,0,0,1,0,'',0),(257,74,34,61,0,'91.196.8.186',1652080725,0,1,1,1,1,'','Re: E-learning - zasady ogólne + prototyp level 0','<t>Czy Frank wie, że ma przygotować szkolenie marketingowe?<br/>\nJesteście w kontakcie?</t>','6e5691361c982ae197458a3fabe37ccf',0,'','srzcpa2x',1,0,'',0,0,0,1,0,'',0),(258,76,37,58,0,'94.232.216.242',1652082575,0,1,1,1,1,'','Re: Umowy','<t>Uporządkuję je w naszej strukturze folderów.</t>','93b88c6467530275a9874fbe32807516',0,'','5c00g',1,0,'',0,0,0,1,0,'',0),(259,75,42,63,0,'85.221.240.2',1652096123,0,1,1,1,1,'','Re: Dodanie kodów do naklejek na produkty','<t>Chorwacki dealer. Miał problem z identyfikacją ładowarki tylko po nazwie, choć można je określić po mocy to już np. z dwoma standardami złącz ładowania robi się już 6 kombinacji.<br/>\nNa pewno nie trzeba tego robić na złamanie karku, natomiast z czasem trzeba przymyśleć etykietowanie produktów....</t>','0cdbadcc9000f556a12d1386ab9ff332',0,'','2fd4hz',1,0,'',0,0,0,1,0,'',0),(260,48,25,63,0,'85.221.240.2',1652096147,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Czy kontaktowaliście się już z nimi w tej kwestii?<br/>\nWypadałoby...</t>','5e94331d9083a93b1eaffee2ec1f1389',0,'','aplw',1,0,'',0,0,0,1,0,'',0),(261,74,34,63,0,'85.221.240.2',1652096188,0,1,1,1,1,'','Re: E-learning - zasady ogólne + prototyp level 0','<t>Mówił że zrobi. Dzisiaj spytałem na kiedy i wkleję co odpisze.</t>','47667bc43194f4d67add7f46e9da61fd',0,'','1gsadiq',1,0,'',0,0,0,1,0,'',0),(262,48,25,60,0,'91.196.8.186',1652097052,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Sytuacja wygląda tak: <br/>\nPrzedyskutowaliśmy ostatnio formę tego wydarzenia i wspólnie z Zarządem ustaliliśmy, że nie będziemy organizować eventu. Nie potrzebujemy takiej formy promocji. Zależy nam tylko na fotkach od nich. Także nasza propozycja jest taka, żeby wyznaczyć im datę, np. do końca czerwca i niech oni się spotkają, zrobią sobie zdjęcia i ogłoszą przejście na Seacrafta w mediach. <br/>\nPytałam też Franka czy ewentualnie on jako nasz niemiecki dealer chciałby uczestniczyć w wydarzeniu, ale nie chciał. <br/>\nJeśli chodzi o szkolenie serwisowe, to najlepiej będzie się z nimi dogadać, albo przyjadą do Krosna, albo po prostu w innym terminie. <br/>\nNa ten moment uznaliśmy, że nie czujemy potrzeby odbycia z nimi takiego eventu i nasza obecność jest zbędna. W najbliższych dniach przygotuję im jakąś miłą odpowiedź i spróbuję ustalić szczegóły, np. jakich zdjęć potrzebujemy itp.</t>','03b91e2a80c8a389a66bb0c8ca82d107',0,'','c1iqun5t',1,0,'',0,0,0,1,0,'',0),(264,6,20,60,0,'91.196.8.186',1652097828,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><B><s>[b]</s>Ostateczne ustalenia dot. filmu: <e>[/b]</e></B><br/>\n<br/>\nTemat przewodni: <B><s>[b]</s>wyprawa po skarb<e>[/b]</e></B><br/>\nl. Zajawienie historii<br/>\nEkipa (mężczyzna i kobieta lub więcej osób )  przygotowuje wyprawę.<br/>\nLogistyka i przygotowanie.<br/>\n<br/>\nll. Rozwinięcie<br/>\nTransport łodzią  gdzie dowiadujemy się, że jest to wyprawa nurkowa.<br/>\nRozpoczęcie nurkowania<br/>\nPoszukiwania  detektorem po piaszczystym dnie, w jaskini i we wraku<br/>\n<br/>\nOdnalezienie starej skrzyni we wraku, a w niej skarb - nowy skuter.<br/>\n<br/>\nllL. Zakończenie <br/>\nCzas na przedstawienie skutera od strony technicznej<br/>\nWydobycie skutera na łódź<br/>\nPrezentacja znaleziska. ( tu możemy zademonstrować poszczególne elementy i skuter z tekstem lektora + infografiką)<br/>\nWieczór, zachodzące słońce, ognisko na plaży odkrywcy śmieją się i wznoszą toast, Obok nich stoi nowy Seacraft.</r>','b705f91b63b70287b04e9568dc76bb7e',0,'','d6g5at5',1,0,'',0,0,0,1,0,'',0),(265,6,20,60,0,'91.196.8.186',1652097936,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>W nawiązaniu do powyższego pomysłu na scenariusz, wielka prośba od Adama: <br/>\n<br/>\nPoproszę o informacje co ma się znaleźć w <U><s>[u]</s>części informacyjnej o produkcie<e>[/u]</e></U>. Jakie <U><s>[u]</s>informacje techniczne<e>[/u]</e></U>?<br/>\nBo muszę wiedzieć ile czasu będzie trwał tekst lektorski – i to jest pilne.<br/>\nProszę to <U><s>[u]</s>wypunktować<e>[/u]</e></U>.<br/>\n<br/>\nNa ten moment na pewno pokażemy podróż samolotem ze skuterem.</r>','9e4c7f770c01e7e300c9580f401b818b',0,'','9d93x8rm',1,0,'',0,0,0,1,0,'',0),(266,6,20,63,0,'85.221.240.2',1652100687,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Pomysł z poszukiwaniami - fajny! Nada się!<br/>\nCzy będziemy ujmować transport lotniczy? Mogła by to być np. droga powrotna... <E>;)</E><br/>\n<br/>\n-Informacje techniczne --&gt; powinny się pojawić również jako plansza.<br/>\n<br/>\n-Max. ciąg statyczny (do weryfikacji jaki jest finalny)<br/>\n-Masa całkowita<br/>\n-Czas pracy z prędkością 45m/min (do weryfikacji jaki jest finalny)<br/>\n-bateria dozwolona do transportu lotniczego (z pokazaniem modułów)<br/>\n-ładowanie zewnętrzne bez żadnego korka ładowania - bezpośrednio do pinów<br/>\n-ilość biegów + wsteczny<br/>\n-wyświetlacz paskowy<br/>\n-Tryb sterowania Seacraft (piezo + 2 manetki i uchwyt dwuręczny)<br/>\n-3 tryby pracy  (do weryfikacji, możliwe że bedą 2-standard i Freediving)<br/>\n-Łatwe trymowanie (prezentacja/ rendery/ wizualizacja?)<br/>\n-plansza z akcesoriami --&gt; uchwyt transportowy, montaż ENC, montaż latarek bateryjnych (opcja)<br/>\n<br/>\nTyle bym dał na pewno. Możliwe że coś małego dojdzie, można też ew. obciąć akcesoria i trymowanie.</r>','cba4f98a6ce3b6c60933a7ddbe20ad32',0,'','16ptgkb',1,0,'',0,0,0,1,0,'',0),(267,48,25,63,0,'85.221.240.2',1652100797,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Porozmawiać z Olivierem czy nie chciałby się pojawić jako nasz przedstawiciel?<br/>\n<br/>\nUważam że wypada, by ktoś się pojawił. Może szybki lot na miejsce żeby nie jeździć?</t>','d5ab755ff139b58206342192bc1fbdaa',0,'','jlqf',1,0,'',0,0,0,1,0,'',0),(268,75,42,61,0,'185.153.39.80',1652118994,0,1,1,1,1,'','Re: Dodanie kodów do naklejek na produkty','<t>Pewnie kody kreskowe trzeba będzie wprowadzić docelowo.</t>','049ee749629a3bc80de86433acbbae81',0,'','chlv',1,0,'',0,0,0,1,0,'',0),(269,48,25,61,0,'185.153.39.80',1652120076,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Olivier to nie jest nasz przedstawiciel, nie wiem za bardzo co to zmieni w tej sytuacji.</t>','a2109e45506cf2edb5ed1f6b67444608',0,'','1kfsp1q',1,0,'',0,0,0,1,0,'',0),(270,77,18,58,0,'94.232.216.242',1652162949,0,1,1,1,1,'','[MIL] Brakujące zdjęcia produktowe','<t>Lista brakujących zdjęć produktowych Military:<br/>\n<br/>\nGM1765 - Stand TAC2000 - zarówno dla TAC1000 i TAC2000 / Future i Ghost używamy tego samego zdjęcia<br/>\nTFM1_1742 Dual scooter Tac1000 wide platform<br/>\nTGM1_1744 Dual scooter Tac2000 wide platform<br/>\nTFM2_1742 Dual scooter Tac1000 narrow platform<br/>\nTGM2_1744 Dual scooter Tac2000 narrow platform<br/>\nTFM1800 Coupling set II gen. wide platform wide platform for Tac1000<br/>\nTGM1800 Coupling set II gen. wide platform wide platform for Tac2000<br/>\nTUM1000 platform wide - jest jedno zdjecie, ale słabej jakości<br/>\nTFM1723 Transport bracket twin front fi 160<br/>\nTFM1724 Transport bracket twin rear fi 160<br/>\nEM1824 ENC3M neutral bouyancy float<br/>\nEM1815 Foldable rigid mast with gps<br/>\nEM1734 Transport case for navigation platform (mamy, ale z pokazaną zawartościa, mając fotografa na miejscu można zrobić jeszcze pustą na wzór enc3m case małej)<br/>\n<br/>\nNa bazie kart produktowych MIL takich fotek się nie doszukałem, część brakujących będzie pokrywać się z REC.<br/>\nByć może macie jeszcze gdzieś zachomikowane u siebie (Witek?), to będę wdzięczny za podesłane lub ewentualnie sugestię które trzeba zrobić nowe fotki, które już są nieaktualne. Na mega i synoglogy chyba wszystko przewertowałem.<br/>\n<br/>\nWszystkie coupling sets i platformy do weryfikacji.</t>','33a419ade2a53b4c03121a9fe8deebd5',0,'','9bkbt',1,0,'',0,0,0,1,0,'',0),(271,58,21,58,0,'94.232.216.242',1652163289,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Słowacja, Chorwacja, Hiszpania - propozycja wsparcia','<r><QUOTE><s>[quote]</s>I appreciate your persisting interests and therefor I feel that I can be completely honest with you.<br/>\n<br/>\nI truly believe your dpvs are the best on the market. I like working with the top notch equipment and so you are the first producer I got in touch with. In fact, we could place any dpv in the videos and possibly get a sponsorship, but I, myself, wanted Seacraft for the most important reason - non of other dpvs I have tried, provides me with such capabilities in terms of shooting videos. Non of them maneuvers so smoothly and precisely to get the footage I want. This is critically important. <br/>\n  <br/>\nLike I said before, I also believe my tec/cave diving production is of the highest quality and generates a strong impact to attracts quality brands.<br/>\n<br/>\nI also understand your side in terms of costs and know that giving out 2 expensive pieces of gear may be too much too ask for.<br/>\n<br/>\nMy idea would be having your dpvs on a long/short term use free of charge, initially for 1-2 projects. After completing these projects you can decide if such an exposure brings enough benefits to continue or we give the products back. <br/>\nAs I mentioned before, the footage would be available for you to use and even if we quit our cooperation, the visual material will remain properly licenced to Seacraft for future.\n<e>[/quote]</e></QUOTE>\n\nSzuka sponsora, nie jest skłonny zapłacić. Interesuje i opłaca nam się wypożyczenie mu 2 skuterów do 2 projektów?</r>','c5e4576d4f95484a07d041cf2562cddd',0,'','7oyhk',1,0,'',0,0,0,1,0,'',0),(272,78,28,58,0,'94.232.216.242',1652164849,0,1,1,1,1,'','Reklamy GO! na FB','<r>Warto mieć na uwadze przygotowanie reklam graficznych do \"rolki\" na FB, oprócz samego filmu, który będziemy promować, reklama statyczna też będzie potrzebna, dotychczasowa za niewielki koszt daje całkiem fajne efekty.<br/>\n<br/>\nPoniżej wycięte screenshoty z obecnej rolki z Future.<br/>\n\n<ATTACHMENT filename=\"fb rolka.jpg\" index=\"0\"><s>[attachment=0]</s>fb rolka.jpg<e>[/attachment]</e></ATTACHMENT>\n\nSzablony mamy, gdy pojawią się fotki z Go! w akcji, możemy kombinować <E>:)</E></r>','71045046229a285cd745bd515643176d',1,'','16zviag',1,0,'',0,0,0,1,0,'',0),(273,6,20,60,0,'91.196.8.186',1652165335,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Podpytałam też Franka co on by pokazał i poniżej jego propozycje: <br/>\n<br/>\n-	Magnetic drive / Silence / Very little maintenance requirements<br/>\n-	Compact, simple, and clear design – easy handling<br/>\n-	Battery suitable for flying – the ideal travel scooter (not many other brands currently offer this)<br/>\n-	Low weight of the unit – perfect for recreational divers (not sure if we should target women especially…?)<br/>\n-	Variable operation modes (please clarify with Tomasz): If there will be a free diving mode, we MUST market this <EMOJI seq=\"1f609\" tseq=\"1f609\">&#128521;</EMOJI><br/>\n-	Possible use of the GO! As backup scooter for Tec divers</r>','693a1e9521284d6925bf30bfff095d60',0,'','fcdwvm7',1,0,'',0,0,0,1,0,'',0),(274,6,20,58,0,'94.232.216.242',1652165614,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>W międzyczasie dotarła do nas nasza skrzynia od Adama.<br/>\n\n<ATTACHMENT filename=\"280092293_3130145203914328_1972688013633357119_n (1).jpg\" index=\"0\"><s>[attachment=0]</s>280092293_3130145203914328_1972688013633357119_n (1).jpg<e>[/attachment]</e></ATTACHMENT>\n\nWygląda świetnie. <br/>\n<br/>\nMusimy pomyślęc czym ją w środku wyłożyć, aby osiągnąc ten odbijajacy się efekt światła niczym złota. <br/>\n<br/>\nPomysły? <E>:)</E></r>','4a67dc0823227d54e9a9bffb54294f58',1,'','5z7sar86',1,0,'',0,0,0,1,0,'',0),(275,6,20,61,0,'94.232.216.242',1652165829,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Skrzynia przyjechała do Krosna i jest rodem Piratów z Karaibów  <E>:D</E> <br/>\nPaulino, zapytaj Adama czy ta tkanina będzie ok.<br/>\nMoim zdaniem nadaje się idealnie.<br/>\n<br/>\n<URL url=\"https://www.tkaniny.net/63-06508-011_aksamit-elastyczny-zloto.html?gclid=CjwKCAjw9-KTBhBcEiwAr19ig_0uUpQjeTbFjYCvuASTa0BsfvUj5ge888gStJdRUbO7WiIvCMIY2hoC8mQQAvD_BwE\"><LINK_TEXT text=\"https://www.tkaniny.net/63-06508-011_ak ... mQQAvD_BwE\">https://www.tkaniny.net/63-06508-011_aksamit-elastyczny-zloto.html?gclid=CjwKCAjw9-KTBhBcEiwAr19ig_0uUpQjeTbFjYCvuASTa0BsfvUj5ge888gStJdRUbO7WiIvCMIY2hoC8mQQAvD_BwE</LINK_TEXT></URL></r>','cc43e1e7a16060529aeb49715a89245f',0,'','1ak3',1,0,'',0,0,0,1,0,'',0),(276,6,20,61,0,'94.232.216.242',1652165938,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><URL url=\"https://kucmar.pl/product-pol-13600-Organza-brokatowa-zlota-36cm-rolka-9m-ORG-019.html?utm_source=iai_ads&amp;utm_medium=google_shopping\"><LINK_TEXT text=\"https://kucmar.pl/product-pol-13600-Org ... e_shopping\">https://kucmar.pl/product-pol-13600-Organza-brokatowa-zlota-36cm-rolka-9m-ORG-019.html?utm_source=iai_ads&amp;utm_medium=google_shopping</LINK_TEXT></URL><br/>\n<br/>\ni trochę tego może</r>','da7972a59f6b3a610f69bc087d838e4c',0,'','17h92b',1,0,'',0,0,0,1,0,'',0),(277,48,25,63,0,'85.221.240.2',1652171275,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Jako Reseller - również jest lokalnym przedstawicielem Seacrafta.<br/>\n<br/>\nPaulino - czy chcesz do nich napisać, czy ja mam to zrobić? Wypadałoby dać znać dzisiaj/ jutro...</t>','bb73b6f78cc35fc02434b116e31285b0',0,'','3m0r1m',1,0,'',0,0,0,1,0,'',0),(278,6,20,63,0,'85.221.240.2',1652171718,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><URL url=\"https://allegro.pl/oferta/zlote-monety-do-gier-i-zabaw-zetony-144-szt-poker-12114721168\"><LINK_TEXT text=\"https://allegro.pl/oferta/zlote-monety- ... 2114721168\">https://allegro.pl/oferta/zlote-monety-do-gier-i-zabaw-zetony-144-szt-poker-12114721168</LINK_TEXT></URL><br/>\nNie wiem jak z pływalnością, można trochę dorzucić (doważone np: <URL url=\"https://allegro.pl/oferta/pasta-wolframowa-downforce-prologic-3-x-10-g-11674758909?bi_s=ads&amp;bi_m=listing%3Adesktop%3Aquery&amp;bi_c=NjNjMTk2YzQtM2VlMy00OTU0LWIxYmUtMjcxNmZiNTVlN2M1AA&amp;bi_t=ape&amp;referrer=proxy&amp;emission_unit_id=03c19f21-9f78-4aff-9841-21856fee456e\"><LINK_TEXT text=\"https://allegro.pl/oferta/pasta-wolfram ... 856fee456e\">https://allegro.pl/oferta/pasta-wolframowa-downforce-prologic-3-x-10-g-11674758909?bi_s=ads&amp;bi_m=listing%3Adesktop%3Aquery&amp;bi_c=NjNjMTk2YzQtM2VlMy00OTU0LWIxYmUtMjcxNmZiNTVlN2M1AA&amp;bi_t=ape&amp;referrer=proxy&amp;emission_unit_id=03c19f21-9f78-4aff-9841-21856fee456e</LINK_TEXT></URL> )</r>','2705848d5e3e14af2ab19fceebb94671',0,'','7mjwv',1,0,'',0,0,0,1,0,'',0),(279,58,21,63,0,'85.221.240.2',1652171873,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Słowacja, Chorwacja, Hiszpania - propozycja wsparcia','<t>Myślę że wypożyczenie 2 skuterów do projektów jest rozsądne (w zamian za pełne prawa licencyjne). <br/>\nMimo tego, po okresie wypożyczenia, na pewno nie będzie mógł ich zatrzymać. (chyba że zdziała cuda), natomiast trzeba by lojalnie o tym powiedzieć.<br/>\n<br/>\nMamy braki w maszynach testowych, natomiast zbliża się czas \'oddania\' skuterów z Deepspotu ( w zamian za 3 GO!). Czy ma linię czasu kiedy by ich potrzebował?</t>','68b1fe8dd46fe5e3b73636d758c2872b',0,'','iwg37v8y',1,0,'',0,0,0,1,0,'',0),(280,48,25,58,0,'94.232.216.242',1652173372,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>W mailu do nich warto byłoby też określić jakie zdjęcia będziemy chcieli aby dla nas zrobili i je publikowali odnośnie samego ogłoszenia tego. (oni już tam coś dodają jak docierają do nich paczki).<br/>\n<br/>\nJednym z pomysłów był post informujący przez nich że przechodzą na nasz sprzęt i takie zbiorcze zdjęcie gdzie wszyscy są w wodzie z naszymi skuterami na 1 ujęciu.<br/>\n<br/>\nPóźniej każdy z nich (jest ich 10) mógłby publikować w odstępach czasu jakąś realcję/galerię zdjęć w akcji ze skuterami.<br/>\n<br/>\nCo sądzicie?</t>','ae410cc814e683a31344b3382c3741e0',0,'','24gl9k',1,0,'',0,0,0,1,0,'',0),(281,7,41,58,0,'94.232.216.242',1652175159,0,1,1,1,1,'','Re: Sugestie, pomysły, zgłoszenia','<t>Dziś po 17 zaplanowaliśmu przeniesienie Forum i jego zawartości na nasz server. Proszę o nie dodawanie wpisów po 17.00. <br/>\n<br/>\nPodeślę link do przeniesionego forum, jak wszystko pójdzie zgodnie z planem.</t>','1660041736cbbc471ab9e2367c97fbc5',0,'','648aj',1,0,'',0,0,0,1,0,'',0),(282,53,39,61,0,'94.232.216.242',1652345887,0,1,1,1,1,'','Re: Zmiany w kolejnej wersji cennika rec','<t>Dodałam do cennika baterię lotniczą.<br/>\n<br/>\nWitek, zerknij i przetłumacz. Dodaj również kartownik - Izabela wycenia.</t>','de019b4b5a96058a554d14335a77b020',0,'','903tf',1,0,'',0,0,0,1,0,'',0),(283,54,40,61,0,'91.196.8.186',1652686721,0,1,1,1,1,'','Re: Niezbędne zmiany w cenniku special','<r>Dołożyć do oferty tablet lub raczej laptop do ENC.<br/>\nPropozycja<br/>\nLatitude 7220<br/>\n<br/>\n<URL url=\"https://kuplaptopa.pl/product/785389/dell-rugged-7220-i7-11.6-fhd-dotyk-1000nits-16gb-512gb-ssd-gps-wifi-bt-win10pro-ip-65-mil-810-3y-nbd?gclid=CjwKCAjw7IeUBhBbEiwADhiEMb3sceCvrx9WLWyLJnzs0jZbFWI4_XDUK-_0qaRbgah92aVfiRl4YBoC5iUQAvD_BwE\"><LINK_TEXT text=\"https://kuplaptopa.pl/product/785389/de ... iUQAvD_BwE\">https://kuplaptopa.pl/product/785389/dell-rugged-7220-i7-11.6-fhd-dotyk-1000nits-16gb-512gb-ssd-gps-wifi-bt-win10pro-ip-65-mil-810-3y-nbd?gclid=CjwKCAjw7IeUBhBbEiwADhiEMb3sceCvrx9WLWyLJnzs0jZbFWI4_XDUK-_0qaRbgah92aVfiRl4YBoC5iUQAvD_BwE</LINK_TEXT></URL><br/>\n<br/>\n<br/>\nSugerowana cena końcowa:<br/>\n3780 E<br/>\n<br/>\n10% narzutu<br/>\nz czego 5% dla dystrybutora i 5% zostaje dla nas na koszty operacyjne.<br/>\n<br/>\nZauważyłam, że we wzorze umowy załącznik nr 1 nie zawiera cen po których sprzedajemy tylko sugerowane ceny końcowe. Chyba będziemy musieli wszystkim wysłać ten załącznik.</r>','c7a735e857d60ef076df00d788ce2a1d',0,'','76jnv',1,0,'',0,0,0,1,0,'',0);
